INSERT INTO `Term` (`ID`, `Accession`, `FK_OntologyID`, `Name`, `Definition`, `XRefValueType`, `IsObsolete`) VALUES
(2,	'UO:0000000',	1,	'unit',	'\"A unit of measurement is a standardized quantity of a physical quality.\" [Wikipedia:Wikipedia]',	NULL,	0),
(3,	'UO:0000001',	1,	'length unit',	'\"A unit which is a standard measure of the distance between two points.\" [Wikipedia:Wikipedia]',	NULL,	0),
(4,	'UO:0000002',	1,	'mass unit',	'\"A unit which is a standard measure of the amount of matter/energy of a physical object.\" [Wikipedia:Wikipedia]',	NULL,	0),
(5,	'UO:0000003',	1,	'time unit',	'\"A unit which is a standard measure of the dimension in which events occur in sequence.\" [Wikipedia:Wikipedia]',	NULL,	0),
(6,	'UO:0000004',	1,	'electric current unit',	'\"A unit which is a standard measure of the flow of electric charge.\" [Wikipedia:Wikipedia]',	NULL,	0),
(7,	'UO:0000005',	1,	'temperature unit',	'\"A unit which is a standard measure of the average kinetic energy of the particles in a sample of matter.\" [Wikipedia:Wikipedia]',	NULL,	0),
(8,	'UO:0000006',	1,	'substance unit',	'\"A unit which is a standardised quantity of an element or compound with uniform composition.\" [Wikipedia:Wikipedia]',	NULL,	0),
(9,	'UO:0000007',	1,	'luminous intensity unit',	'\"A unit which is a standard measure of the wavelength-weighted power emitted by a light source in a particular direction.\" [Wikipedia:Wikipedia]',	NULL,	0),
(10,	'UO:0000008',	1,	'meter',	'\"A length unit which is equal to the length of the path traveled by light in vacuum during a time interval of 1/299 792 458 of a second.\" [BIPM:BIPM, NIST:NIST]',	NULL,	0),
(11,	'UO:0000009',	1,	'kilogram',	'\"A mass unit which is equal to the mass of the International Prototype Kilogram kept by the BIPM at Svres, France.\" [BIPM:BIPM, NIST:NIST]',	NULL,	0),
(12,	'UO:0000010',	1,	'second',	'\"A time unit which is equal to the duration of 9 192 631 770 periods of the radiation corresponding to the transition between the two hyperfine levels of the ground state of the caesium 133 atom.\" [BIPM:BIPM, NIST:NIST]',	NULL,	0),
(13,	'UO:0000011',	1,	'ampere',	'\"An electric current unit which is equal to the constant current which, if maintained in two straight parallel conductors of infinite length, of negligible circular cross-section, and placed 1 m apart in vacuum, would produce between these conductors a force equal to 2 x 10^[-7] newton per meter of length.\" [BIPM:BIPM, NIST:NIST]',	NULL,	0),
(14,	'UO:0000012',	1,	'kelvin',	'\"A thermodynamic temperature unit which is equal to the fraction 1/273.16 of the thermodynamic temperature of the triple point of water.\" [BIPM:BIPM, NIST:NIST]',	NULL,	0),
(15,	'UO:0000013',	1,	'mole',	'\"A substance unit which is equal to the amount of substance of a molecular system which contains as many elementary entities as there are atoms in 0.012 kilogram of carbon 12.\" [BIPM:BIPM, NIST:NIST]',	NULL,	0),
(16,	'UO:0000014',	1,	'candela',	'\"A luminous intensity unit which equal to the luminous intensity, in a given direction, of a source that emits monochromatic radiation of frequency 540 x 1012 hertz and that has a radiant intensity in that direction of 1/683 watt per steradian.\" [BIPM:BIPM, NIST:NIST]',	NULL,	0),
(17,	'UO:0000015',	1,	'centimeter',	'\"A length unit which is equal to one hundredth of a meter or 10^[-2] m.\" [NIST:NIST]',	NULL,	0),
(18,	'UO:0000016',	1,	'millimeter',	'\"A length unit which is equal to one thousandth of a meter or 10^[-3] m.\" [NIST:NIST]',	NULL,	0),
(19,	'UO:0000017',	1,	'micrometer',	'\"A length unit which is equal to one millionth of a meter or 10^[-6] m.\" [NIST:NIST]',	NULL,	0),
(20,	'UO:0000018',	1,	'nanometer',	'\"A length unit which is equal to one thousandth of one millionth of a meter or 10^[-9] m.\" [NIST:NIST]',	NULL,	0),
(21,	'UO:0000019',	1,	'angstrom',	'\"A length unit which is equal to 10 [-10] m.\" [NIST:NIST]',	NULL,	0),
(22,	'UO:0000020',	1,	'picometer',	'\"A length unit which is equal to 10^[-12] m.\" [NIST:NIST]',	NULL,	0),
(23,	'UO:0000021',	1,	'gram',	'\"A mass unit which is equal to one thousandth of a kilogram or 10^[-3] kg.\" [NIST:NIST]',	NULL,	0),
(24,	'UO:0000022',	1,	'milligram',	'\"A mass unit which is equal to one thousandth of a gram or 10^[-3] g.\" [UOC:GVG]',	NULL,	0),
(25,	'UO:0000023',	1,	'microgram',	'\"A mass unit which is equal to one millionth of a gram or 10^[-6] g.\" [UOC:GVG]',	NULL,	0),
(26,	'UO:0000024',	1,	'nanogram',	'\"A mass unit which is equal to one thousandth of one millionth of a gram or 10^[-9] g.\" [UOC:GVG]',	NULL,	0),
(27,	'UO:0000025',	1,	'picogram',	'\"A mass unit which is equal to 10^[-12] g.\" [UOC:GVG]',	NULL,	0),
(28,	'UO:0000026',	1,	'femtogram',	'\"A mass unit which is equal to 10^[-15] g.\" [NIST:NIST]',	NULL,	0),
(29,	'UO:0000027',	1,	'degree Celsius',	'\"A temperature unit which is equal to one kelvin degree. However, they have their zeros at different points. The centigrade scale has its zero at 273.15 K.\" [NIST:NIST]',	NULL,	0),
(30,	'UO:0000028',	1,	'millisecond',	'\"A time unit which is equal to one thousandth of a second or 10^[-3] s.\" [NIST:NIST]',	NULL,	0),
(31,	'UO:0000029',	1,	'microsecond',	'\"A time unit which is equal to one millionth of a second or 10^[-6] s.\" [NIST:NIST]',	NULL,	0),
(32,	'UO:0000030',	1,	'picosecond',	'\"A time unit which is equal to 10^[-12] s.\" [NIST:NIST]',	NULL,	0),
(33,	'UO:0000031',	1,	'minute',	'\"A time unit which is equal to 60 seconds.\" [Wikipedia:Wikipedia]',	NULL,	0),
(34,	'UO:0000032',	1,	'hour',	'\"A time unit which is equal to 3600 seconds or 60 minutes.\" [Wikipedia:Wikipedia]',	NULL,	0),
(35,	'UO:0000033',	1,	'day',	'\"A time unit which is equal to 24 hours.\" [Wikipedia:Wikipedia]',	NULL,	0),
(36,	'UO:0000034',	1,	'week',	'\"A time unit which is equal to 7 days.\" [Wikipedia:Wikipedia]',	NULL,	0),
(37,	'UO:0000035',	1,	'month',	'\"A time unit which is approximately equal to the length of time of one of cycle of the moon\'s phases which in science is taken to be equal to 30 days.\" [Wikipedia:Wikipedia]',	NULL,	0),
(38,	'UO:0000036',	1,	'year',	'\"A time unit which is equal to 12 months which in science is taken to be equal to 365.25 days.\" [Wikipedia:Wikipedia]',	NULL,	0),
(39,	'UO:0000037',	1,	'milliampere',	'\"An electric current unit current which is equal to one thousandth of an ampere or 10^[-3] A.\" [UOC:GVG]',	NULL,	0),
(40,	'UO:0000038',	1,	'microampere',	'\"An electric current unit current which is equal to one millionth of an ampere or 10^[-6] A.\" [UOC:GVG]',	NULL,	0),
(41,	'UO:0000039',	1,	'micromole',	'\"A substance unit equal to a millionth of a mol or 10^[-6] mol.\" [NIST:NIST]',	NULL,	0),
(42,	'UO:0000040',	1,	'millimole',	'\"A substance unit equal to a thousandth of a mol or 10^[-3] mol.\" [NIST:NIST]',	NULL,	0),
(43,	'UO:0000041',	1,	'nanomole',	'\"A substance unit equal to one thousandth of one millionth of a mole or 10^[-9] mol.\" [NIST:NIST]',	NULL,	0),
(44,	'UO:0000042',	1,	'picomole',	'\"A substance unit equal to 10^[-12] mol.\" [NIST:NIST]',	NULL,	0),
(45,	'UO:0000043',	1,	'femtomole',	'\"A substance unit equal to 10^[-15] mol.\" [NIST:NIST]',	NULL,	0),
(46,	'UO:0000044',	1,	'attomole',	'\"A substance unit equal to 10^[-18] mol.\" [NIST:NIST]',	NULL,	0),
(47,	'UO:0000045',	1,	'base unit',	'\"A unit which is one of a particular measure to which all measures of that type can be related.\" [NIST:NIST]',	NULL,	0),
(48,	'UO:0000046',	1,	'prefix',	'',	NULL,	0),
(49,	'UO:0000047',	1,	'area unit',	'\"A unit which is a standard measure of the amount of a 2-dimensional flat surface.\" [UOC:GVG]',	NULL,	0),
(50,	'UO:0000048',	1,	'acceleration unit',	'\"A unit which is a standard measure of the rate of change of velocity in either speed or direction.\" [Wikipedia:Wikipedia]',	NULL,	0),
(51,	'UO:0000049',	1,	'angular velocity unit',	'\"A unit which is a standard measure of the rate of angular movement about an axis; the angle rotated in a given time.\" [Wikipedia:Wikipedia]',	NULL,	0),
(52,	'UO:0000050',	1,	'angular acceleration unit',	'\"A unit which is a standard measure of the rate of change of angular velocity.\" [Wikipedia:Wikipedia]',	NULL,	0),
(53,	'UO:0000051',	1,	'concentration unit',	'\"A unit which represents a standard measurement of how much of a given substance there is mixed with another substance.\" [UOC:GVG]',	NULL,	0),
(54,	'UO:0000052',	1,	'mass density unit',	'\"A density unit which is a standard measure of the mass of a substance in a given volume.\" [UOC:GVG]',	NULL,	0),
(55,	'UO:0000053',	1,	'luminance unit',	'\"A unit which is a standard measure of the luminous intensity impinging on a given area.\" [Wikipedia:Wikipedia]',	NULL,	0),
(56,	'UO:0000054',	1,	'area density unit',	'\"A density unit which is a standard measure of the mass exerting an influence on a given area.\" [Wikipedia:Wikipedia]',	NULL,	0),
(57,	'UO:0000055',	1,	'molar mass unit',	'\"A unit which is a standard measure of the mass of a homogeneous substance containing 6.02 x 1023 atoms or molecules.\" [Wikipedia:Wikipedia]',	NULL,	0),
(58,	'UO:0000056',	1,	'molar volume unit',	'\"A unit which is a standard measure of the volume of a homogeneous substance containing 6.02 x 1023 atoms or molecules.\" [Wikipedia:Wikipedia]',	NULL,	0),
(59,	'UO:0000057',	1,	'momentum unit',	'\"A unit which is a standard measure of the quantity of motion measured by the product of mass and velocity.\" [Wikipedia:Wikipedia]',	NULL,	0),
(60,	'UO:0000058',	1,	'rotational frequency unit',	'\"A unit which is a standard measure of the number of rotations in a given time.\" [NIST:NIST]',	NULL,	0),
(61,	'UO:0000059',	1,	'specific volume unit',	'\"A unit which is a standard measure of the volume of a given mass of substance (the reciprocal of density).\" [Wikipedia:Wikipedia]',	NULL,	0),
(62,	'UO:0000060',	1,	'speed/velocity unit',	'\"A unit which is a standard measure of the rate of movement. Speed is measured in the same physical units of measurement as velocity, but does not contain the element of direction that velocity has. Speed is thus the magnitude component of velocity.\" [Wikipedia:Wikipedia]',	NULL,	0),
(63,	'UO:0000061',	1,	'unit of molarity',	'\"A concentration unit which is a standard measure of the number of moles of a given substance per liter of solution.\" [UOC:GVG]',	NULL,	0),
(64,	'UO:0000062',	1,	'molar',	'\"A unit of concentration which expresses a concentration of 1 mole of solute per liter of solution (mol/L).\" [UOC:GVG]',	NULL,	0),
(65,	'UO:0000063',	1,	'millimolar',	'\"A unit of molarity which is equal to one thousandth of a molar or 10^[-3] M.\" [UOC:GVG]',	NULL,	0),
(66,	'UO:0000064',	1,	'micromolar',	'\"A unit of molarity which is equal to one millionth of a molar or 10^[-6] M.\" [UOC:GVG]',	NULL,	0),
(67,	'UO:0000065',	1,	'nanomolar',	'\"A unit of molarity which is equal to one thousandth of one millionth of a molar or 10^[-9] M.\" [UOC:GVG]',	NULL,	0),
(68,	'UO:0000066',	1,	'picomolar',	'\"A unit of molarity which is equal to 10^[-12] M.\" [UOC:GVG]',	NULL,	0),
(69,	'UO:0000067',	1,	'unit of molality',	'\"A concentration unit which is a standard measure of the number of moles of a given substance per kilogram of solvent.\" [UOC:GVG]',	NULL,	0),
(70,	'UO:0000068',	1,	'molal',	'\"A unit of concentration which expresses a concentration of a solution of 1 mole per kilogram of solvent (mol/kg).\" [UOC:GVG]',	NULL,	0),
(71,	'UO:0000069',	1,	'millimolal',	'\"A molality unit which is equal to one thousandth of a molal or 10^[-3] m.\" [UOC:GVG]',	NULL,	0),
(72,	'UO:0000070',	1,	'micromolal',	'\"A molality unit which is equal to one millionth of a molal or 10^[-6] m.\" [UOC:GVG]',	NULL,	0),
(73,	'UO:0000071',	1,	'nanomolal',	'\"A molality unit which is equal to one thousandth of one millionth of a molal or 10^[-9] m.\" [UOC:GVG]',	NULL,	0),
(74,	'UO:0000072',	1,	'picomolal',	'\"A molality unit which is equal to 10^[-12] m.\" [UOC:GVG]',	NULL,	0),
(75,	'UO:0000073',	1,	'femtomolar',	'\"A unit of molarity which is equal to 10^[-15] M.\" [UOC:GVG]',	NULL,	0),
(76,	'UO:0000074',	1,	'unit of normality',	'\"A unit of concentration which highlights the chemical nature of salts.\" [Wikipedia:Wikipedia]',	NULL,	0),
(77,	'UO:0000075',	1,	'normal',	'\"A unit of concentration which is one gram equivalent of a solute per liter of solution. A gram equivalent weight or equivalent is a measure of the reactive capacity of a given molecule.\" [Wikipedia:Wikipedia]',	NULL,	0),
(78,	'UO:0000076',	1,	'mole fraction',	'\"A concentration unit which denotes the number of moles of solute as a proportion of the total number of moles in a solution.\" [Wikipedia:Wikipedia]',	NULL,	0),
(79,	'UO:0000077',	1,	'meter per second per second',	'\"An acceleration unit which is equal to the acceleration an object changing its velocity by 1meter/s over a time period that equals one second.\" [NIST:NIST]',	NULL,	0),
(80,	'UO:0000078',	1,	'radian per second per second',	'\"An angular unit acceleration which is equal to the angular acceleration of an object changing its angular velocity by 1rad/s over a time period that equals one second.\" [NIST:NIST]',	NULL,	0),
(81,	'UO:0000079',	1,	'radian per second',	'\"An angular unit velocity which is equal to about 9.54930 rpm (revolutions per minute).\" [NIST:NIST]',	NULL,	0),
(82,	'UO:0000080',	1,	'square meter',	'\"An area unit which is equal to an area enclosed by a square with sides each 1 meter long.\" [NIST:NIST]',	NULL,	0),
(83,	'UO:0000081',	1,	'square centimeter',	'\"An area unit which is equal to one ten thousandth of a square meter or 10^[-4] m^[2].\" [NIST:NIST]',	NULL,	0),
(84,	'UO:0000082',	1,	'square millimeter',	'\"An area unit which is equal to one millionth of a square meter or 10^[-6] m^[2].\" [NIST:NIST]',	NULL,	0),
(85,	'UO:0000083',	1,	'kilogram per cubic meter',	'\"A mass unit density which is equal to mass of an object in kilograms divided by the volume in cubic meters.\" [UOC:GVG]',	NULL,	0),
(86,	'UO:0000084',	1,	'gram per cubic centimeter',	'\"A mass unit density which is equal to mass of an object in grams divided by the volume in cubic centimeters.\" [UOC:GVG]',	NULL,	0),
(87,	'UO:0000085',	1,	'candela per square meter',	'\"A luminance unit which is equal to a luminous intensity of one candela radiating from a surface whose area is one square meter.\" [NIST:NIST]',	NULL,	0),
(88,	'UO:0000086',	1,	'kilogram per square meter',	'\"An area density unit which is equal to the mass of an object in kilograms divided by the surface area in meters squared.\" [NIST:NIST]',	NULL,	0),
(89,	'UO:0000087',	1,	'kilogram per mole',	'\"A molar mass unit which is equal to one kilogram of mass of one mole of chemical element or chemical compound.\" [NIST:NIST]',	NULL,	0),
(90,	'UO:0000088',	1,	'gram per mole',	'\"A molar mass unit which is equal to one gram of mass of one mole of chemical element or chemical compound.\" [NIST:NIST]',	NULL,	0),
(91,	'UO:0000089',	1,	'cubic meter per mole',	'\"A molar volume unit which is equal to 1 cubic meter occupied by one mole of a substance in the form of a solid, liquid, or gas.\" [NIST:NIST]',	NULL,	0),
(92,	'UO:0000090',	1,	'cubic centimeter per mole',	'\"A molar volume unit which is equal to 1 cubic centimeter occupied by one mole of a substance in the form of a solid, liquid, or gas.\" [NIST:NIST]',	NULL,	0),
(93,	'UO:0000091',	1,	'kilogram meter per second',	'\"A momentum unit which is equal to the momentum of a one kilogram mass object with a speed of one meter per second.\" [NIST:NIST]',	NULL,	0),
(94,	'UO:0000092',	1,	'turns per second',	'\"A rotational frequency unit which is equal to the number complete turn in a period of time that equals to 1 second.\" [NIST:NIST]',	NULL,	0),
(95,	'UO:0000093',	1,	'cubic meter per kilogram',	'\"A specific volume unit which is equal to one cubic meter volume occupied by one kilogram of a particular substance.\" [NIST:NIST]',	NULL,	0),
(96,	'UO:0000094',	1,	'meter per second',	'\"A speed/velocity unit which is equal to the speed of an object traveling 1 meter distance in one second.\" [NIST:NIST]',	NULL,	0),
(97,	'UO:0000095',	1,	'volume unit',	'\"A unit which is a standard measure of the amount of space occupied by any substance, whether solid, liquid, or gas.\" [NIST:NIST]',	NULL,	0),
(98,	'UO:0000096',	1,	'cubic meter',	'\"A volume unit which is equal to the volume of a cube with edges one meter in length. One cubic meter equals to 1000 liters.\" [NIST:NIST]',	NULL,	0),
(99,	'UO:0000097',	1,	'cubic centimeter',	'\"A volume unit which is equal to one millionth of a cubic meter or 10^[-9] m^[3], or to 1 ml.\" [NIST:NIST]',	NULL,	0),
(100,	'UO:0000098',	1,	'milliliter',	'\"A volume unit which is equal to one thousandth of a liter or 10^[-3] L, or to 1 cubic centimeter.\" [NIST:NIST]',	NULL,	0),
(101,	'UO:0000099',	1,	'liter',	'\"A volume unit which is equal to one thousandth of a cubic meter or 10^[-3] m^[3], or to 1 decimeter.\" [NIST:NIST]',	NULL,	0),
(102,	'UO:0000100',	1,	'cubic decimeter',	'\"A volume unit which is equal to one thousand of a cubic meter or 10^[-3] m^[3], or to 1 L.\" [NIST:NIST]',	NULL,	0),
(103,	'UO:0000101',	1,	'microliter',	'\"A volume unit which is equal to one millionth of a liter or 10^[-6] L.\" [NIST:NIST]',	NULL,	0),
(104,	'UO:0000102',	1,	'nanoliter',	'\"A volume unit which is equal to one thousandth of one millionth of a liter or 10^[-9] L.\" [NIST:NIST]',	NULL,	0),
(105,	'UO:0000103',	1,	'picoliter',	'\"A volume unit which is equal to 10^[-12] L.\" [NIST:NIST]',	NULL,	0),
(106,	'UO:0000104',	1,	'femtoliter',	'\"A volume unit which is equal to 10^[-15] L.\" [NIST:NIST]',	NULL,	0),
(107,	'UO:0000105',	1,	'frequency unit',	'\"A unit which is a standard measure of the number of repetitive actions in a particular time.\" [NIST:NIST]',	NULL,	0),
(108,	'UO:0000106',	1,	'hertz',	'\"A frequency unit which is equal to 1 complete cycle of a recurring phenomenon in 1 second.\" [NIST:NIST]',	NULL,	0),
(109,	'UO:0000107',	1,	'force unit',	'\"A unit which is a standard measure of the force is applied when a mass is accelerated.\" [NIST:NIST]',	NULL,	0),
(110,	'UO:0000108',	1,	'newton',	'\"A force unit which is equal to the force required to cause an acceleration of 1m/s2 of a mass of 1 Kg in the direction of the force.\" [NIST:NIST]',	NULL,	0),
(111,	'UO:0000109',	1,	'pressure unit',	'\"A unit which is a standard measure of the force applied to a given area.\" [NIST:NIST]',	NULL,	0),
(112,	'UO:0000110',	1,	'pascal',	'\"A pressure unit which is equal to the pressure or stress on a surface caused by a force of 1 newton spread over a surface of 1 m^[2].\" [NIST:NIST]',	NULL,	0),
(113,	'UO:0000111',	1,	'energy unit',	'\"A unit which is a standard measure of the work done by a certain force (gravitational, electric, magnetic, force of inertia, etc).\" [NIST:NIST]',	NULL,	0),
(114,	'UO:0000112',	1,	'joule',	'\"An energy unit which is equal to the energy required when a force of 1 newton moves an object 1 meter in the direction of the force.\" [NIST:NIST]',	NULL,	0),
(115,	'UO:0000113',	1,	'power unit',	'\"A unit which is a standard measure power or the rate of doing work.\" [NIST:NIST]',	NULL,	0),
(116,	'UO:0000114',	1,	'watt',	'\"A power unit which is equal to the power used when work is done at the rate of 1 joule per second.\" [NIST:NIST]',	NULL,	0),
(117,	'UO:0000115',	1,	'illuminance unit',	'\"A unit which is a standard measure of the luminous flux incident on a unit area.\" [Wikipedia:Wikipedia]',	NULL,	0),
(118,	'UO:0000116',	1,	'lux',	'\"An illuminance unit which is equal to the illuminance produced by 1 lumen evenly spread over an area 1 m^[2].\" [NIST:NIST]',	NULL,	0),
(119,	'UO:0000117',	1,	'luminous flux unit',	'\"A unit which is a standard measure of the flow of radiant energy.\" [Wikipedia:Wikipedia]',	NULL,	0),
(120,	'UO:0000118',	1,	'lumen',	'\"A luminous flux unit which is equal to the luminous flux emitted into 1 steradian by a point source of 1 candela.\" [NIST:NIST]',	NULL,	0),
(121,	'UO:0000119',	1,	'catalytic activity unit',	'\"A unit which is a standard measure of the amount of the action of a catalyst.\" [NIST:NIST]',	NULL,	0),
(122,	'UO:0000120',	1,	'katal',	'\"A catalytic unit activity which is equal to the activity of a catalyst in moles per second, such as the amount of an enzyme needed to transform one mole of substrate per second.\" [NIST:NIST]',	NULL,	0),
(123,	'UO:0000121',	1,	'angle unit',	'\"A unit which is a standard measure of the figure or space formed by the junction of two lines or planes.\" [Wikipedia:Wikipedia]',	NULL,	0),
(124,	'UO:0000122',	1,	'plane angle unit',	'\"A unit which is a standard measure of the angle formed by two straight lines in the same plane.\" [Wikipedia:Wikipedia]',	NULL,	0),
(125,	'UO:0000123',	1,	'radian',	'\"A plane angle unit which is equal to the angle subtended at the center of a circle by an arc equal in length to the radius of the circle, approximately 57 degrees 17 minutes and 44.6 seconds.\" [NIST:NIST]',	NULL,	0),
