(379,	'UO:0010047',	1,	'united states fda cup',	'\"A United States FDA cup is a unit of measurement of volume used by the US Federal Department of Agriculture as a nutritional serving measure. It equals a 240 mL volume.\" [Wikipedia:https\\://en.wikipedia.org/wiki/United_States_customary_units#Cooking_measures]',	NULL,	0),
