(449,	'MS:1000068',	2,	'septum',	'\"A disc composed of a flexible material that seals the entrance to the reservoir. Can also be entrance to the vacuum chamber.\" [PSI:MS]',	NULL,	0),
(450,	'MS:1000069',	2,	'thermospray inlet',	'\"A method for generating gas phase ions from a solution of an analyte by rapid heating of the sample.\" [PSI:MS]',	NULL,	0),
(451,	'MS:1000070',	2,	'atmospheric pressure chemical ionization',	'\"Chemical ionization that takes place at atmospheric pressure as opposed to the reduced pressure is normally used for chemical ionization.\" [PSI:MS]',	NULL,	0),
(452,	'MS:1000071',	2,	'chemical ionization',	'\"The formation of a new ion by the reaction of a neutral species with an ion. The process may involve transfer of an electron, a proton or other charged species between the reactants. When a positive ion results from chemical ionization the term may be used without qualification. When a negative ion results the term negative ion chemical ionization should be used. Note that this term is not synonymous with chemi-ionization.\" [PSI:MS]',	NULL,	0),
(453,	'MS:1000072',	2,	'Electronic Ionization',	'\"OBSOLETE The ionization of an atom or molecule by electrons that are typically accelerated to energies between 50 and 150 eV. Usually 70 eV electrons are used to produce positive ions. The term \'electron impact\' is not recommended.\" [PSI:MS]',	NULL,	1),
(454,	'MS:1000073',	2,	'electrospray ionization',	'\"A process in which ionized species in the gas phase are produced from an analyte-containing solution via highly charged fine droplets, by means of spraying the solution from a narrow-bore needle tip at atmospheric pressure in the presence of a high electric field. When a pressurized gas is used to aid in the formation of a stable spray, the term pneumatically assisted electrospray ionization is used. The term ion spray is not recommended.\" [PSI:MS]',	NULL,	0),
(455,	'MS:1000074',	2,	'fast atom bombardment ionization',	'\"The ionization of any species by the interaction of a focused beam of neutral atoms having a translational energy of several thousand eV with a sample that is typically dissolved in a solvent matrix. See also secondary ionization.\" [PSI:MS]',	NULL,	0),
(456,	'MS:1000075',	2,	'matrix-assisted laser desorption ionization',	'\"The formation of gas-phase ions from molecules that are present in a solid or solvent matrix that is irradiated with a pulsed laser. See also laser desorption/ionization.\" [PSI:MS]',	NULL,	0),
(457,	'MS:1000076',	2,	'negative ion mode',	'\"OBSOLETE.\" [PSI:MS]',	NULL,	1),
(458,	'MS:1000077',	2,	'positive ion mode',	'\"OBSOLETE.\" [PSI:MS]',	NULL,	1),
(459,	'MS:1000078',	2,	'axial ejection linear ion trap',	'\"A linear ion trap mass spectrometer where ions are ejected along the axis of the analyzer.\" [PSI:MS]',	NULL,	0),
(460,	'MS:1000079',	2,	'fourier transform ion cyclotron resonance mass spectrometer',	'\"A mass spectrometer based on the principle of ion cyclotron resonance in which an ion in a magnetic field moves in a circular orbit at a frequency characteristic of its m/z value. Ions are coherently excited to a larger radius orbit using a pulse of radio frequency energy and their image charge is detected on receiver plates as a time domain signal. Fourier transformation of the time domain signal results in a frequency domain signal which is converted to a mass spectrum based in the inverse relationship between frequency and m/z.\" [PSI:MS]',	NULL,	0),
(461,	'MS:1000080',	2,	'magnetic sector',	'\"A device that produces a magnetic field perpendicular to a charged particle beam that deflects the beam to an extent that is proportional to the particle momentum per unit charge. For a monoenergetic beam, the deflection is proportional to m/z.\" [PSI:MS]',	NULL,	0),
(462,	'MS:1000081',	2,	'quadrupole',	'\"A mass spectrometer that consists of four parallel rods whose centers form the corners of a square and whose opposing poles are connected. The voltage applied to the rods is a superposition of a static potential and a sinusoidal radio frequency potential. The motion of an ion in the x and y dimensions is described by the Matthieu equation whose solutions show that ions in a particular m/z range can be transmitted along the z axis.\" [PSI:MS]',	NULL,	0),
(463,	'MS:1000082',	2,	'quadrupole ion trap',	'\"Quadrupole Ion Trap mass analyzer captures the ions in a three dimensional ion trap and then selectively ejects them by varying the RF and DC potentials.\" [PSI:MS]',	NULL,	0),
(464,	'MS:1000083',	2,	'radial ejection linear ion trap',	'\"A linear ion trap mass spectrometer where ions are ejected along the radius of the analyzer.\" [PSI:MS]',	NULL,	0),
(465,	'MS:1000084',	2,	'time-of-flight',	'\"Instrument that separates ions by m/z in a field-free region after acceleration to a fixed acceleration energy.\" [PSI:MS]',	NULL,	0),
(466,	'MS:1000085',	2,	'baseline',	'\"An attribute of resolution when recording the detector response in absence of the analyte.\" [PSI:MS]',	NULL,	0),
(467,	'MS:1000086',	2,	'full width at half-maximum',	'\"A measure of resolution represented as width of the peak at half peak height.\" [PSI:MS]',	NULL,	0),
