(488,	'MS:1000107',	2,	'channeltron',	'\"A horn-shaped (or cone-shaped) continuous dynode particle multiplier. The ion strikes the inner surface of the device and induces the production of secondary electrons that in turn impinge on the inner surfaces to produce more secondary electrons. This avalanche effect produces an increase in signal in the final measured current pulse.\" [PSI:MS]',	NULL,	0),
(489,	'MS:1000108',	2,	'conversion dynode electron multiplier',	'\"A surface that is held at high potential so that ions striking the surface produce electrons that are subsequently detected.\" [PSI:MS]',	NULL,	0),
(490,	'MS:1000109',	2,	'conversion dynode photomultiplier',	'\"A detector in which ions strike a conversion dynode to produce electrons that in turn generate photons through a phosphorescent screen that are detected by a photomultiplier.\" [PSI:MS]',	NULL,	0),
(491,	'MS:1000110',	2,	'daly detector',	'\"Detector consisting of a conversion dynode, scintillator and photomultiplier. The metal knob at high potential emits secondary electrons when ions impinge on the surface. The secondary electrons are accelerated onto the scintillator that produces light that is then detected by the photomultiplier detector.\" [PSI:MS]',	NULL,	0),
(492,	'MS:1000111',	2,	'electron multiplier tube',	'\"A device to amplify the current of a beam or packet of charged particles or photons by incidence upon the surface of an electrode to produce secondary electrons.\" [PSI:MS]',	NULL,	0),
(493,	'MS:1000112',	2,	'faraday cup',	'\"A conducting cup or chamber that intercepts a charged particle beam and is electrically connected to a current measuring device.\" [PSI:MS]',	NULL,	0),
(494,	'MS:1000113',	2,	'focal plane array',	'\"An array of detectors for spatially disperse ion beams in which all ions simultaneously impinge on the detector plane.\" [PSI:MS]',	NULL,	0),
(495,	'MS:1000114',	2,	'microchannel plate detector',	'\"A thin plate that contains a closely spaced array of channels that each act as a continuous dynode particle multiplier. A charged particle, fast neutral particle, or photon striking the plate causes a cascade of secondary electrons that ultimately exits the opposite side of the plate.\" [PSI:MS]',	NULL,	0),
(496,	'MS:1000115',	2,	'multi-collector',	'\"A detector system commonly used in inductively coupled plasma mass spectrometers.\" [PSI:MS]',	NULL,	0),
(497,	'MS:1000116',	2,	'photomultiplier',	'\"A detector for conversion of the ion/electron signal into photon(s) which are then amplified and detected.\" [PSI:MS]',	NULL,	0),
(498,	'MS:1000117',	2,	'analog-digital converter',	'\"Analog-to-digital converter (abbreviated ADC, A/D or A to D) is an electronic integrated circuit (i/c) that converts continuous signals to discrete digital numbers.\" [PSI:MS]',	NULL,	0),
(499,	'MS:1000118',	2,	'pulse counting',	'\"Definition to do.\" [PSI:MS]',	NULL,	0),
