(515,	'MS:1000134',	2,	'plasma desorption',	'\"The ionization of material in a solid sample by bombarding it with ionic or neutral atoms formed as a result of the fission of a suitable nuclide, typically 252Cf. Synonymous with fission fragment ionization.\" [PSI:MS]',	NULL,	0),
(516,	'MS:1000135',	2,	'post-source decay',	'\"A technique specific to reflectron time-of-flight mass spectrometers where product ions of metastable transitions or collision-induced dissociations generated in the drift tube prior to entering the reflectron are m/z separated to yield product ion spectra.\" [PSI:MS]',	NULL,	0),
