(586,	'MS:1000205',	2,	'selected ion monitoring',	'\"The operation of a mass spectrometer in which the intensities of several specific m/z values are recorded rather than the entire mass spectrum.\" [PSI:MS]',	NULL,	0),
(587,	'MS:1000206',	2,	'selected reaction monitoring',	'\"Data acquired from specific product ions corresponding to m/z selected precursor ions recorded via multiple stages of mass spectrometry. Selected reaction monitoring can be performed in time or in space.\" [PSI:MS]',	NULL,	0),
(588,	'MS:1000207',	2,	'accurate mass',	'\"OBSOLETE An experimentally determined mass that is can be to determine a unique elemental formula. For ions less than 200 u, a measurement with 5 ppm accuracy is sufficient to determine the elemental composition.\" [PSI:MS]',	NULL,	1),
(589,	'MS:1000208',	2,	'average mass',	'\"OBSOLETE The mass of an ion or molecule calculated using the average mass of each element weighted for its natural isotopic abundance.\" [PSI:MS]',	NULL,	1),
(590,	'MS:1000209',	2,	'appearance energy',	'\"OBSOLETE The minimum energy that must be imparted to an atom or molecule to produce a specified ion. The term appearance potential is not recommended.\" [PSI:MS]',	NULL,	1),
(591,	'MS:1000210',	2,	'base peak',	'\"The peak in a mass spectrum that has the greatest intensity. This term may be applied to the spectra of pure substances or mixtures.\" [PSI:MS]',	NULL,	0),
(592,	'MS:1000211',	2,	'OBSOLETE charge number',	'\"OBSOLETE The total charge on an ion divided by the electron charge e. OBSOLETED 2009-10-27 since this was viewed as a duplication of 00041 charge state.\" [PSI:MS]',	NULL,	1),
(593,	'MS:1000212',	2,	'dalton',	'\"OBSOLETE A non-SI unit of mass (symbol Da) that is equal to the unified atomic mass unit',	NULL,	1),
(594,	'MS:1000213',	2,	'electron affinity',	'\"OBSOLETE The electron affinity of M is the minimum energy required for the process M- ? M + e where M- and M are in their ground rotational, vibrational and electronic states and the electron has zero kinetic energy.\" [PSI:MS]',	NULL,	1),
(595,	'MS:1000214',	2,	'electron energy obsolete',	'\"OBSOLETE The potential difference through which electrons are accelerated before they are used to bring about electron ionization.\" [PSI:MS]',	NULL,	1),
(596,	'MS:1000215',	2,	'exact mass',	'\"OBSOLETE The calculated mass of an ion or molecule containing a single isotope of each atom.\" [PSI:MS]',	NULL,	1),
(597,	'MS:1000216',	2,	'field-free region',	'\"A section of a mass spectrometer in which there are no electric or magnetic fields.\" [PSI:MS]',	NULL,	0),
(598,	'MS:1000217',	2,	'ionization cross section',	'\"OBSOLETE A measure of the probability that a given ionization process will occur when an atom or molecule interacts with a photon, electron, atom or molecule.\" [PSI:MS]',	NULL,	1),
(599,	'MS:1000218',	2,	'ionization efficiency',	'\"OBSOLETE The ratio of the number of ions formed to the number of electrons, molecules or photons used.\" [PSI:MS]',	NULL,	1),
(600,	'MS:1000219',	2,	'ionization energy',	'\"OBSOLETE The minimum energy required to remove an electron from an atom or molecule to produce a positive ion.\" [PSI:MS]',	NULL,	1),
(601,	'MS:1000220',	2,	'isotope dilution mass spectrometry',	'\"OBSOLETE A quantitative mass spectrometry technique in which an isotopically enriched compound is used as an internal standard.\" [PSI:MS]',	NULL,	1),
(602,	'MS:1000221',	2,	'magnetic deflection',	'\"The deflection of charged particles in a magnetic field due to a force equal to qvxB where q is the particle charge, v its velocity and B the magnetic field. Magnetic deflection of an ion beam is used for m/z separation in a magnetic sector mass spectrometer.\" [PSI:MS]',	NULL,	0),
(603,	'MS:1000222',	2,	'mass defect',	'\"OBSOLETE The difference between the monoisotopic and nominal mass of a molecule or atom.\" [PSI:MS]',	NULL,	1),
(604,	'MS:1000223',	2,	'mass number',	'\"OBSOLETE The sum of the protons and neutrons in an atom, molecule or ion.\" [PSI:MS]',	NULL,	1),
(605,	'MS:1000224',	2,	'molecular mass',	'\"Mass of a molecule measured in unified atomic mass units (u or Da).\" [https://en.wikipedia.org/wiki/Molecular_mass]',	NULL,	0),
(606,	'MS:1000225',	2,	'monoisotopic mass',	'\"OBSOLETE The mass of an ion or molecule calculated using the mass of the most abundant isotope of each element.\" [PSI:MS]',	NULL,	1),
(607,	'MS:1000226',	2,	'molecular beam mass spectrometry',	'\"OBSOLETE A mass spectrometry technique in which the sample is introduced into the mass spectrometer as a molecular beam.\" [PSI:MS]',	NULL,	1),
(608,	'MS:1000227',	2,	'multiphoton ionization',	'\"Photoionization of an atom or molecule in which in two or more photons are absorbed.\" [PSI:MS]',	NULL,	0),
(609,	'MS:1000228',	2,	'nitrogen rule',	'\"OBSOLETE An organic molecule containing the elements C, H, O, S, P, or halogen has an odd nominal mass if it contains an odd number of nitrogen atoms.\" [PSI:MS]',	NULL,	1),
(610,	'MS:1000229',	2,	'nominal mass',	'\"OBSOLETE The mass of an ion or molecule calculated using the mass of the most abundant isotope of each element rounded to the nearest integer value.\" [PSI:MS]',	NULL,	1),
(611,	'MS:1000230',	2,	'odd-electron rule',	'\"OBSOLETE Odd-electron ions may dissociate to form either odd or even-electron ions, whereas even-electron ions generally form even-electron fragment ions.\" [PSI:MS]',	NULL,	1),
(612,	'MS:1000231',	2,	'peak',	'\"A localized region of relatively large ion signal in a mass spectrum. Although peaks are often associated with particular ions, the terms peak and ion should not be used interchangeably.\" [PSI:MS]',	NULL,	0),
(613,	'MS:1000232',	2,	'peak intensity',	'\"OBSOLETE The height or area of a peak in a mass spectrum.\" [PSI:MS]',	NULL,	1),
(614,	'MS:1000233',	2,	'proton affinity',	'\"OBSOLETE The proton affinity of a species M is defined as the negative of the enthalpy change for the reaction M + H+ ->[M+H]+, where all species are in their ground rotational, vibrational and electronic states.\" [PSI:MS]',	NULL,	1),
(615,	'MS:1000234',	2,	'mass resolving power',	'\"OBSOLETE In a mass spectrum, the observed mass divided by the difference between two masses that can be separated. The method by which delta m was obtained and the mass at which the measurement was made should be reported.\" [PSI:MS]',	NULL,	1),
(616,	'MS:1000235',	2,	'total ion current chromatogram',	'\"Representation of the total ion current detected in each of a series of mass spectra versus time.\" [PSI:MS]',	NULL,	0),
(617,	'MS:1000236',	2,	'transmission',	'\"The ratio of the number of ions leaving a region of a mass spectrometer to the number entering that region.\" [PSI:MS]',	NULL,	0),
(618,	'MS:1000237',	2,	'unified atomic mass unit',	'\"OBSOLETE A non-SI unit of mass (u) defined as one twelfth of ^12 C in its ground state and equal to 1.660 538 86(28) x 10^-27 kg.\" [PSI:MS]',	NULL,	1),
(619,	'MS:1000238',	2,	'accelerator mass spectrometry',	'\"OBSOLETE A mass spectrometry technique in which atoms extracted from a sample are ionized, accelerated to MeV energies and separated according to their momentum, charge and energy.\" [PSI:MS]',	NULL,	1),
(620,	'MS:1000239',	2,	'atmospheric pressure matrix-assisted laser desorption ionization',	'\"Matrix-assisted laser desorption ionization in which the sample target is at atmospheric pressure and the ions formed by the pulsed laser are sampled through a small aperture into the mass spectrometer.\" [PSI:MS]',	NULL,	0),
(621,	'MS:1000240',	2,	'atmospheric pressure ionization',	'\"Any ionization process in which ions are formed in the gas phase at atmospheric pressure.\" [PSI:MS]',	NULL,	0),
(622,	'MS:1000241',	2,	'Atmostpheric Pressure Photoionization',	'\"OBSOLETE Atmospheric pressure chemical ionization in which the reactant ions are generated by photo-ionization.\" [PSI:MS]',	NULL,	1),
(623,	'MS:1000242',	2,	'blackbody infrared radiative dissociation',	'\"A special case of infrared multiphoton dissociation wherein excitation of the reactant ion is caused by absorption of infrared photons radiating from heated blackbody surroundings, which are usually the walls of a vacuum chamber. See also infrared multiphoton dissociation.\" [PSI:MS]',	NULL,	0),
(624,	'MS:1000243',	2,	'charge-remote fragmentation',	'\"OBSOLETE A fragmentation of an even-electron ion in which the cleaved bond is not adjacent to the apparent charge site.\" [PSI:MS]',	NULL,	1),
(625,	'MS:1000244',	2,	'consecutive reaction monitoring',	'\"OBSOLETE MSn experiment with three or more stages of m/z separation and in which a particular multi-step reaction path is monitored.\" [PSI:MS]',	NULL,	1),
(626,	'MS:1000245',	2,	'charge stripping',	'\"The reaction of a positive ion with an atom or molecule that results in the removal of one or more electrons from the ion.\" [PSI:MS]',	NULL,	0),
(627,	'MS:1000246',	2,	'delayed extraction',	'\"The application of the accelerating voltage pulse after a time delay in desorption ionization from a surface. The extraction delay can produce energy focusing in a time-of-flight mass spectrometer.\" [PSI:MS]',	NULL,	0),
(628,	'MS:1000247',	2,	'desorption ionization',	'\"The formation of ions from a solid or liquid material after the rapid vaporization of that sample.\" [PSI:MS]',	NULL,	0),
(629,	'MS:1000248',	2,	'direct insertion probe',	'\"A device for introducing a solid or liquid sample into a mass spectrometer ion source for desorption ionization.\" [PSI:MS]',	NULL,	0),
(630,	'MS:1000249',	2,	'direct liquid introduction',	'\"The delivery of a liquid sample into a mass spectrometer for spray or desorption ionization.\" [PSI:MS]',	NULL,	0),
(631,	'MS:1000250',	2,	'electron capture dissociation',	'\"A process in which a multiply protonated molecules interacts with a low energy electrons. Capture of the electron leads the liberation of energy and a reduction in charge state of the ion with the production of the (M + nH) (n-1)+ odd electron ion, which readily fragments.\" [PSI:MS]',	NULL,	0),
(632,	'MS:1000251',	2,	'even-electron ion',	'\"OBSOLETE An ion containing no unpaired electrons in its ground electronic state, e.g. CH3+ in its ground state.\" [PSI:MS]',	NULL,	1),
(633,	'MS:1000252',	2,	'electron-induced excitation in organics',	'\"OBSOLETE The reaction of an ion with an electron in which the translational energy of the collision is converted into internal energy of the ion.\" [PSI:MS]',	NULL,	1),
(634,	'MS:1000253',	2,	'electron multiplier',	'\"A device to amplify the current of a beam or packet of charged particles or photons by incidence upon the surface of an electrode to produce secondary electrons. The secondary electrons are then accelerated to other electrodes or parts of a continuous electrode to produce further secondary electrons.\" [PSI:MS]',	NULL,	0),
(635,	'MS:1000254',	2,	'electrostatic energy analyzer',	'\"A device consisting of conducting parallel plates, concentric cylinders or concentric spheres that separates charged particles according to their kinetic energy by means of an electric field that is constant in time.\" [PSI:MS]',	NULL,	0),
(636,	'MS:1000255',	2,	'flowing afterglow',	'\"An ion source immersed in a flow of helium or other inert buffer gas that carries the ions through a meter-long reactor at pressures around 100 Pa.\" [PSI:MS]',	NULL,	0),
(637,	'MS:1000256',	2,	'high-field asymmetric waveform ion mobility spectrometry',	'\"OBSOLETE The separation of ions between two concentric cylindrical electrodes due to application of a high voltage asymmetric waveform whereby ions migrate towards one of the two electrodes depending on the ratio of the high- to low-field mobility of the ion.\" [PSI:MS]',	NULL,	1),
(638,	'MS:1000257',	2,	'field desorption',	'\"The formation of gas-phase ions from a material deposited on a solid surface in the presence of a high electric field. Because this process may encompass ionization by field ionization or other mechanisms, it is not recommended as a synonym for field desorption ionization.\" [PSI:MS]',	NULL,	0),
(639,	'MS:1000258',	2,	'field ionization',	'\"The removal of electrons from any species by interaction with a high electric field.\" [PSI:MS]',	NULL,	0),
(640,	'MS:1000259',	2,	'glow discharge ionization',	'\"The formation of ions in the gas phase and from solid samples at the cathode by application of a voltage to a low pressure gas.\" [PSI:MS]',	NULL,	0),
(641,	'MS:1000260',	2,	'ion kinetic energy spectrometry',	'\"OBSOLETE A method of analysis in which a beam of ions is separated according to the ratio of its translational energy to charge.\" [PSI:MS]',	NULL,	1),
(642,	'MS:1000261',	2,	'ion mobility spectrometry',	'\"OBSOLETE The separation of ions according to their velocity through a buffer gas under the influence of an electric field.\" [PSI:MS]',	NULL,	1),
(643,	'MS:1000262',	2,	'infrared multiphoton dissociation',	'\"Multiphoton ionization where the reactant ion dissociates as a result of the absorption of multiple infrared photons.\" [PSI:MS]',	NULL,	0),
(644,	'MS:1000263',	2,	'isotope ratio mass spectrometry',	'\"OBSOLETE The measurement of the relative quantity of the different isotopes of an element in a material with a mass spectrometer.\" [PSI:MS]',	NULL,	1),
(645,	'MS:1000264',	2,	'ion trap',	'\"A device for spatially confining ions using electric and magnetic fields alone or in combination.\" [PSI:MS]',	NULL,	0),
(646,	'MS:1000265',	2,	'kinetic energy release distribution',	'\"OBSOLETE Distribution of values of translational kinetic energy release for an ensemble of metastable ions undergoing a specific dissociation reaction.\" [PSI:MS]',	NULL,	1),
(647,	'MS:1000266',	2,	'Laser Desorption',	'\"OBSOLETE The formation of ions through the interaction of a laser with a material or with gas-phase ions or molecules.\" [PSI:MS]',	NULL,	1),
(648,	'MS:1000267',	2,	'mass analyzed ion kinetic energy spectrometry',	'\"OBSOLETE Spectra that are obtained from a sector mass spectrometer that incorporates at least one magnetic sector plus one electric sector in reverse geometry. The accelerating voltage, V, and the magnetic sector field, B, are set at fixed values to select the precursor ions, which are then allowed to dissociate or to react in a field free region between the two sectors. The kinetic energy product ions of m/z selected precursor ions is analyzed by scanning the electric sector field, E. The width of the product ion spectrum peaks is related to the kinetic energy release distribution (KERD) for the dissociation process.\" [PSI:MS]',	NULL,	1),
(649,	'MS:1000268',	2,	'mass spectrometry',	'\"OBSOLETE The branch of science that deals with all aspects of mass spectrometers and the results obtained with these instruments.\" [PSI:MS]',	NULL,	1),
(650,	'MS:1000269',	2,	'mass spectrometry/mass spectrometry',	'\"OBSOLETE The acquisition, study and spectra of the electrically charged products or precursors of a m/z selected ion or ions.\" [PSI:MS]',	NULL,	1),
(651,	'MS:1000270',	2,	'multiple stage mass spectrometry',	'\"OBSOLETE Multiple stages of precursor ion m/z selection followed by product ion detection for successive progeny ions.\" [PSI:MS]',	NULL,	1),
(652,	'MS:1000271',	2,	'Negative Ion chemical ionization',	'\"Chemical ionization that results in the formation of negative ions.\" [PSI:MS]',	NULL,	0),
(653,	'MS:1000272',	2,	'neutralization reionization mass spectrometry',	'\"With this technique, m/z selected ions form neutrals by charge transfer to a collision gas or by dissociation. The neutrals are separated from the remaining ions and ionized in collisions with a second gas. This method is used to investigate reaction intermediates and other unstable species.\" [PSI:MS]',	NULL,	0),
(654,	'MS:1000273',	2,	'photoionization',	'\"The ionization of an atom or molecule by a photon, written M + h? ? M^+ + e. The term photon impact is not recommended.\" [PSI:MS]',	NULL,	0),
(655,	'MS:1000274',	2,	'pyrolysis mass spectrometry',	'\"A mass spectrometry technique in which the sample is heated to the point of decomposition and the gaseous decomposition products are introduced into the ion source.\" [PSI:MS]',	NULL,	0),
(656,	'MS:1000275',	2,	'collision quadrupole',	'\"A transmission quadrupole to which an oscillating potential is applied so as to focus a beam of ions through a collision gas with no m/z separation.\" [PSI:MS]',	NULL,	0),
(657,	'MS:1000276',	2,	'resonance enhanced multiphoton ionization',	'\"Multiphoton ionization in which the ionization cross section is significantly enhanced because the energy of the incident photons is resonant with an intermediate excited state of the neutral species.\" [PSI:MS]',	NULL,	0),
(658,	'MS:1000277',	2,	'residual gas analyzer',	'\"OBSOLETE A mass spectrometer used to measure the composition and pressure of gasses in an evacuated chamber.\" [PSI:MS]',	NULL,	1),
(659,	'MS:1000278',	2,	'surface enhanced laser desorption ionization',	'\"The formation of ionized species in the gas phase from analytes deposited on a particular surface substrate which is irradiated with a laser beam of which wavelength is absorbed by the surface. See also desorption/ionization on silicon and laser desorption/ionization.\" [PSI:MS]',	NULL,	0),
(660,	'MS:1000279',	2,	'surface enhanced neat desorption',	'\"Matrix-assisted laser desorption ionization in which the matrix is covalently linked to the target surface.\" [PSI:MS]',	NULL,	0),
(661,	'MS:1000280',	2,	'suface ionization',	'\"OBSOLETE The ionization of a neutral species when it interacts with a solid surface with an appropriate work function and temperature.\" [PSI:MS]',	NULL,	1),
(662,	'MS:1000281',	2,	'selected ion flow tube',	'\"A device in which m/z selected ions are entrained in an inert carrier gas and undergo ion-molecule reactions.\" [PSI:MS]',	NULL,	0),
(663,	'MS:1000282',	2,	'sustained off-resonance irradiation',	'\"A technique associated with Fourier transform ion cyclotron resonance (FT-ICR) mass spectrometry to carry out ion/neutral reactions such as low-energy collision-induced dissociation. A radio-frequency electric field of slightly off-resonance to the cyclotron frequency of the reactant ion cyclically accelerates and decelerates the reactant ion that is confined in the Penning ion trap. The ion\'s orbit does not exceed the dimensions of ion trap while the ion undergoes an ion/neutral species process that produces a high average translational energy for an extended time.\" [PSI:MS]',	NULL,	0),
(664,	'MS:1000283',	2,	'Spark Source Mass Spectrometry',	'\"OBSOLETE Mass spectrometry using spark ionization.\" [PSI:MS]',	NULL,	1),
(665,	'MS:1000284',	2,	'stored waveform inverse fourier transform',	'\"A technique to create excitation waveforms for ions in FT-ICR mass spectrometer or Paul ion trap. An excitation waveform in the time-domain is generated by taking the inverse Fourier transform of an appropriate frequency-domain programmed excitation spectrum, in which the resonance frequencies of ions to be excited are included. This technique may be used for selection of precursor ions in MS2 experiments.\" [PSI:MS]',	NULL,	0),
(666,	'MS:1000285',	2,	'total ion current',	'\"The sum of all the separate ion currents carried by the ions of different m/z contributing to a complete mass spectrum or in a specified m/z range of a mass spectrum.\" [PSI:MS]',	NULL,	0),
(667,	'MS:1000286',	2,	'time lag focusing',	'\"Energy focusing in a time-of-flight mass spectrometer that is accomplished by introducing a time delay between the formation of the ions and the application of the accelerating voltage pulse.\" [PSI:MS]',	NULL,	0),
(668,	'MS:1000287',	2,	'time-of-flight mass spectrometer',	'\"OBSOLETE An instrument that separates ions by m/z in a field-free region after acceleration to a fixed kinetic energy.\" [PSI:MS]',	NULL,	1),
(669,	'MS:1000288',	2,	'cyclotron',	'\"A device that uses an oscillating electric field and magnetic field to accelerate charged particles.\" [PSI:MS]',	NULL,	0),
(670,	'MS:1000289',	2,	'double-focusing mass spectrometer',	'\"OBSOLETE A mass spectrometer that uses a magnetic sector for m/z focusing and an electric sector for energy focusing of an ion beam.\" [PSI:MS]',	NULL,	1),
(671,	'MS:1000290',	2,	'hybrid mass spectrometer',	'\"OBSOLETE A mass spectrometer that combines m/z analyzers of different types to perform tandem mass spectrometry.\" [PSI:MS]',	NULL,	1),
(672,	'MS:1000291',	2,	'linear ion trap',	'\"A two dimensional Paul ion trap in which ions are confined in the axial dimension by means of an electric field at the ends of the trap.\" [PSI:MS]',	NULL,	0),
(673,	'MS:1000292',	2,	'mass spectrograph obsolete',	'\"OBSOLETE An instrument that separates a beam of ions according to their mass-to-charge ratio in which the ions are directed onto a focal plane detector such as a photographic plate.\" [PSI:MS]',	NULL,	1),
(674,	'MS:1000293',	2,	'mass spectrometer',	'\"OBSOLETE An instrument that measures the mass-to-charge ratio and relative abundances of ions.\" [PSI:MS]',	NULL,	1),
(675,	'MS:1000294',	2,	'mass spectrum',	'\"A plot of the relative abundance of a beam or other collection of ions as a function of the mass-to-charge ratio (m/z).\" [PSI:MS]',	NULL,	0),
(676,	'MS:1000295',	2,	'mattauch-herzog geometry',	'\"OBSOLETE An arrangement for a double-focusing mass spectrometer in which a deflection of ?/(4 ?(2)) radians in a radial electric field is followed by a magnetic deflection of ?/2 radians.\" [PSI:MS]',	NULL,	1),
(677,	'MS:1000296',	2,	'nier-johnson geometry',	'\"OBSOLETE An arrangement for a double-focusing mass spectrometer in which a deflection of ?/2 radians in a radial electric field analyzer is followed by a magnetic deflection of ?/3 radians.\" [PSI:MS]',	NULL,	1),
(678,	'MS:1000297',	2,	'paul ion trap',	'\"OBSOLETE A device that permits the trapping of ions by means of an alternating current voltage. The ejection of ions with a m/z less than a prescribed value and retention of those with higher mass depends on the application of radio frequency voltages between a ring electrode and two end-cap electrodes to confine the ions in a circular path. The choice of these voltages determines the m/z below which ions are ejected.\" [PSI:MS]',	NULL,	1),
(679,	'MS:1000298',	2,	'prolate traochoidal mass spectrometer',	'\"OBSOLETE A mass spectrometer in which the ions of different m/z are separated by means of crossed electric and magnetic fields in such a way that the selected ions follow a prolate trochoidal path.\" [PSI:MS]',	NULL,	1),
(680,	'MS:1000299',	2,	'quistor',	'\"OBSOLETE An abbreviation of quadrupole ion storage trap. This term is synonymous with Paul Ion Trap. If so then add a synonym to paul and obsolete this term.\" [PSI:MS]',	NULL,	1),
(681,	'MS:1000300',	2,	'reflectron',	'\"A time-of-flight mass spectrometer that uses a static electric field to reverse the direction of travel of the ions entering it. A reflectron improves mass resolution by assuring that ions of the same m/z but different kinetic energy arrive at the detector at the same time.\" [PSI:MS]',	NULL,	0),
(682,	'MS:1000301',	2,	'sector mass spectrometer',	'\"OBSOLETE A mass spectrometer consisting of one or more magnetic sectors for m/z selection in a beam of ions. Such instruments may also have one or more electric sectors for energy selection.\" [PSI:MS]',	NULL,	1),
(683,	'MS:1000302',	2,	'tandem mass spectrometer',	'\"OBSOLETE A mass spectrometer designed for mass spectrometry/mass spectrometry.\" [PSI:MS]',	NULL,	1),
(684,	'MS:1000303',	2,	'transmission quadrupole mass spectrometer',	'\"OBSOLETE A mass spectrometer that consists of four parallel rods whose centers form the corners of a square and whose opposing poles are connected. The voltage applied to the rods is a superposition of a static potential and a sinusoidal radio frequency potential. The motion of an ion in the x and y dimensions is described by the Matthieu equation whose solutions show that ions in a particular m/z range can be transmitted along the z axis.\" [PSI:MS]',	NULL,	1),
(685,	'MS:1000304',	2,	'accelerating voltage',	'\"The electrical potential used to impart kinetic energy to ions in a mass spectrometer.\" [PSI:MS]',	NULL,	0),
(686,	'MS:1000305',	2,	'cyclotron motion',	'\"OBSOLETE The circular motion of a charged particle moving at velocity v in a magnetic field B that results from the force qvB.\" [PSI:MS]',	NULL,	1),
(687,	'MS:1000306',	2,	'dynamic mass spectrometry',	'\"OBSOLETE A mass spectrometer in which m/z separation using one or more electric fields that vary with time.\" [PSI:MS]',	NULL,	1),
(688,	'MS:1000307',	2,	'einzel lens',	'\"Three element charged particle lens in which the first and third elements are held at the same voltage. Such a lens produces focusing without changing the translational energy of the particle.\" [PSI:MS]',	NULL,	0),
(689,	'MS:1000308',	2,	'electric field strength',	'\"The magnitude of the force per unit charge at a given point in space.\" [PSI:MS]',	NULL,	0),
(690,	'MS:1000309',	2,	'first stability region',	'\"The region of a Mathieu stability diagram closest to the origin. Ions within this region can traverse the full length of a transmission quadrupole.\" [PSI:MS]',	NULL,	0),
(691,	'MS:1000310',	2,	'fringing field',	'\"The electric or magnetic field that extends from the edge of a sector, lens or other ion optics element.\" [PSI:MS]',	NULL,	0),
(692,	'MS:1000311',	2,	'kinetic energy analyzer',	'\"A device for measuring the kinetic energy of charged particles using a retarding field, time-of-flight, or the extent of deflection in an electric or magnetic field.\" [PSI:MS]',	NULL,	0),
(693,	'MS:1000312',	2,	'mass limit',	'\"OBSOLETE The m/z value above which ions cannot be detected in a mass spectrometer.\" [PSI:MS]',	NULL,	1),
(694,	'MS:1000313',	2,	'scan m/z range?',	'\"OBSOLETE The limit of m/z over which a mass spectrometer can detect ions.\" [PSI:MS]',	NULL,	1),
(695,	'MS:1000314',	2,	'mass selective axial ejection',	'\"OBSOLETE The use of mass selective instability to eject ions of selected m/z values from an ion trap.\" [PSI:MS]',	NULL,	1),
(696,	'MS:1000315',	2,	'mass selective instability',	'\"OBSOLETE A method for selective ejection of ions according to their m/z value in an ion trap.\" [PSI:MS]',	NULL,	1),
(697,	'MS:1000316',	2,	'mathieu stability diagram',	'\"OBSOLETE A graphical representation expressed in terms of reduced coordinates that describes charged particle motion in a quadrupole mass filter or quadrupole ion trap mass spectrometer.\" [PSI:MS]',	NULL,	1),
(698,	'MS:1000317',	2,	'orthogonal extraction',	'\"OBSOLETE The pulsed acceleration of ions perpendicular to their direction of travel into a time-of-flight mass spectrometer. Ions may be extracted from a directional ion source, drift tube or m/z separation stage.\" [PSI:MS]',	NULL,	1),
(699,	'MS:1000318',	2,	'resonance ion ejection',	'\"OBSOLETE A mode of ion ejection in a quadrupole ion trap that relies on a auxiliary radio frequency voltage that is applied to the end-cap electrodes. The voltage is tuned to the secular frequency of a particular ion to eject it.\" [PSI:MS]',	NULL,	1),
(700,	'MS:1000319',	2,	'space charge effect',	'\"The mutual repulsion of particles of like charge that limits the current in a charged-particle beam and causes beams or packets of charged particles to expand radially over time.\" [PSI:MS]',	NULL,	0),
(701,	'MS:1000320',	2,	'static field',	'\"An electric or magnetic field that does not change in time.\" [PSI:MS]',	NULL,	0),
(702,	'MS:1000321',	2,	'2E Mass Spectrum',	'\"OBSOLETE A mass spectrum obtained by setting the electric sector field E to twice the value required to transmit the main ion-beam thereby allowing ions with a kinetic energy-to-charge ratio twice that of the main ion-beam to be transmitted. Product ions resulting from partial charge transfer reactions such as m^2+ + N ? m^+ + N^+ that occur in a collision cell (containing a gas, N) located in a field-free region preceding a magnetic and electric sector combination are detected. When the magnetic sector field B is scanned, a mass spectrum of singly charged product ions of doubly charged precursor ions is obtained.\" [PSI:MS]',	NULL,	1),
(703,	'MS:1000322',	2,	'charge inversion mass spectrum',	'\"The measurement of the relative abundance of ions that result from a charge inversion reaction as a function of m/z.\" [PSI:MS]',	NULL,	0),
(704,	'MS:1000323',	2,	'constant neutral loss scan',	'\"OBSOLETE Spectrum of all precursor ions that undergo a selected m/z decrement.\" [PSI:MS]',	NULL,	1),
(705,	'MS:1000324',	2,	'constant neutral gain scan',	'\"OBSOLETE Spectrum of all precursor ions that undergo a selected m/z increment.\" [PSI:MS]',	NULL,	1),
(706,	'MS:1000325',	2,	'constant neutral gain spectrum',	'\"A spectrum formed of all product ions that have been produced by gain of a pre-selected neutral mass following the reaction with and addition of the gas in a collision cell.\" [PSI:MS]',	NULL,	0),
(707,	'MS:1000326',	2,	'constant neutral loss spectrum',	'\"A spectrum formed of all product ions that have been produced with a selected m/z decrement from any precursor ions. The spectrum shown correlates to the precursor ion spectrum. See also neutral loss spectrum.\" [PSI:MS]',	NULL,	0),
(708,	'MS:1000327',	2,	'consecutive reaction monitoring',	'\"OBSOLETE A type of MS2 experiments with three or more stages of m/z separation and in which a particular multi-step reaction path is monitored.\" [PSI:MS]',	NULL,	1),
(709,	'MS:1000328',	2,	'e/2 mass spectrum',	'\"A mass spectrum obtained using a sector mass spectrometer in which the electric sector field E is set to half the value required to transmit the main ion-beam. This spectrum records the signal from doubly charged product ions of charge-stripping reactions.\" [PSI:MS]',	NULL,	0),
(710,	'MS:1000329',	2,	'linked scan',	'\"OBSOLETE A scan in an instrument with two or more m/z analysers or in a sector mass spectrometer that incorporates at least one magnetic sector and one electric sector. Two or more of the analyzers are scanned simultaneously so as to preserve a predetermined relationship between scan parameters to produce a product ion, precursor ion or constant neutral loss spectrum.\" [PSI:MS]',	NULL,	1),
(711,	'MS:1000330',	2,	'linked scan at constant b/e',	'\"OBSOLETE A linked scan at constant B/E may be performed on a sector mass spectrometer that incorporates at least one magnetic sector plus one electric sector. The magnetic field B and the electric field E are scanned simultaneously while the accelerating voltage V is held constant, so as to maintain the ratio of the two fields constant. This linked scan may record a product ion spectrum of dissociation or other reactions occurring in a field free region preceding the two sectors.\" [PSI:MS]',	NULL,	1),
(712,	'MS:1000331',	2,	'Linked Scan at Constant E2/V',	'\"OBSOLETE A linked scan performed on a sector instrument that incorporates at least one electric sector plus one magnetic sector. The electric sector field, E, and the accelerating voltage, V, are scanned simultaneously, so as to maintain the ratio E2/V at a constant value. This linked scan recordss a product ion spectrum of dissociation or other reactions occurring in a field free region (FFR) preceding the two sectors.\" [PSI:MS]',	NULL,	1),
(713,	'MS:1000332',	2,	'Linked Scan at Constant B2/E',	'\"OBSOLETE A linked scan performed on a sector mass spectrometer that incorporates at least one electric sector plus one magnetic sector in either order. The accelerating voltage is fixed and the magnetic field, B, and the electric field, E, are scanned simultaneously so as to maintain the ratio B2/E at a constant value. This linked scan records a precursor ion spectrum of dissociation or other reactions occurring in the field free region preceding the two sectors. The term B2/E linked scan is not recommended.\" [PSI:MS]',	NULL,	1),
(714,	'MS:1000333',	2,	'Linked Scan at Constant B[1-(E/E0)]^1/2 / E',	'\"OBSOLETE A linked scan performed on a sector instrument that incorporates at least one electric sector plus one magnetic sector placed in either order. The accelerating voltage is fixed while scanning the magnetic field, B, and electric field, E, simultaneously, so as to maintain the quantity B[1-(E/E0)]1/2/E at a constant value. This linked scan records a constant neutral mass loss (or gain) spectrum of dissociation or other reactions occurring in a field free region preceding the two sectors. E0 is the electric field required to transmit the singly charged analog of the desired neutral fragment. The term B[1-(E/E0)]1/2/E linked scan.\" [PSI:MS]',	NULL,	1),
(715,	'MS:1000334',	2,	'MS/MS in Time',	'\"OBSOLETE A tandem mass spectrometry method in which product ion spectra are recorded in a single m/z analyzer (such as a Paul Ion Trap or FTMS) in discreet steps over time. Ions in a specific m/z range are selected, dissociated, and the product ions analyzed sequentially in time.\" [PSI:MS]',	NULL,	1),
(716,	'MS:1000335',	2,	'MS/MS in Space',	'\"OBSOLETE A tandem mass spectrometry method in which product ion spectra are recorded in m/z analyzers separated in space. Specific m/z separation functions are designed such that in one section of the instrument ions are selected, dissociated in an intermediate region, and the product ions are then transmitted to another analyser for m/z separation and data acquisition.\" [PSI:MS]',	NULL,	1),
(717,	'MS:1000336',	2,	'neutral loss',	'\"The loss of an uncharged species during a rearrangement process. The value slot holds the molecular formula in Hill notation of the neutral loss molecule, see PMID',	NULL,	0),
(718,	'MS:1000337',	2,	'nth generation product ion',	'\"OBSOLETE Serial product ions from dissociation of selected precursor ions where n refers to the number of stages of dissociation. The term granddaughter ion is deprecated.\" [PSI:MS]',	NULL,	1),
(719,	'MS:1000338',	2,	'nth generation product ion scan',	'\"OBSOLETE The specific scan functions or processes that record the appropriate generation of product ion or ions of any m/z selected precursor ions.\" [PSI:MS]',	NULL,	1),
(720,	'MS:1000339',	2,	'nth generation product ion spectrum',	'\"OBSOLETE The mass spectrum recorded from any mass spectrometer in which the appropriate scan function can be set to record the appropriate generation product ion or ions of m/z selected precursor ions.\" [PSI:MS]',	NULL,	1),
(721,	'MS:1000340',	2,	'precursor ion',	'\"OBSOLETE An ion that reacts to form particular product ions. The reaction can be unimolecular dissociation, ion/molecule reaction, isomerization, or change in charge state. The term parent ion is deprecated.\" [PSI:MS]',	NULL,	1),
(722,	'MS:1000341',	2,	'precursor ion spectrum',	'\"Spectrum generated by scanning precursor m/z while monitoring a fixed product m/z.\" [PSI:MS]',	NULL,	0),
(723,	'MS:1000342',	2,	'product ion',	'\"OBSOLETE An ion formed as the product of a reaction involving a particular precursor ion. The reaction can be unimolecular dissociation to form fragment ions, an ion/molecule reaction, or simply involve a change in the number of charges. The term fragment ion is deprecated. The term daughter ion is deprecated.\" [PSI:MS]',	NULL,	1),
(724,	'MS:1000343',	2,	'product ion spectrum',	'\"OBSOLETE A mass spectrum recorded from any spectrometer in which the appropriate m/z separation scan function is set to record the product ion or ions of selected precursor ions.\" [PSI:MS]',	NULL,	1),
(725,	'MS:1000344',	2,	'progeny ion',	'\"OBSOLETE A charged product of a series of consecutive reactions that includes product ions, 1st generation product ions, 2nd generation product ions, etc. Given the sequential fragmentation scheme',	NULL,	1),
(726,	'MS:1000345',	2,	'array detector',	'\"Detector comprising several ion collection elements, arranged in a line or grid where each element is an individual detector.\" [PSI:MS]',	NULL,	0),
(727,	'MS:1000346',	2,	'conversion dynode',	'\"A surface that is held at high potential such that ions striking the surface produce electrons that are subsequently detected.\" [PSI:MS]',	NULL,	0),
(728,	'MS:1000347',	2,	'dynode',	'\"One of a series of electrodes in a photomultiplier tube. Such an arrangement is able to amplify the current emitted by the photocathode.\" [PSI:MS]',	NULL,	0),
(729,	'MS:1000348',	2,	'focal plane collector',	'\"A detector for spatially disperse ion beams in which all ions simultaneously impinge on the detector plane.\" [PSI:MS]',	NULL,	0),
(730,	'MS:1000349',	2,	'ion-to-photon detector',	'\"A detector in which ions strike a conversion dynode to produce electrons that in turn strike a phosphor and the resulting photons are detected by a photomultiplier.\" [PSI:MS]',	NULL,	0),
(731,	'MS:1000350',	2,	'point collector',	'\"A detector in which the ion beam is focused onto a point and the individual ions arrive sequentially.\" [PSI:MS]',	NULL,	0),
(732,	'MS:1000351',	2,	'postacceleration detector',	'\"A detector in which the charged particles are accelerated to a high velocity and impinge on a conversion dynode, emitting secondary electrons. The electrons are accelerated onto a phosphor screen, which emits photons that are in turn detected using a photomultiplier or other photon detector.\" [PSI:MS]',	NULL,	0),
(733,	'MS:1000352',	2,	'secondary electron',	'\"OBSOLETE Electrons that are ejected from a sample surface as a result of bombardment by a primary beam of atoms, ions or photons. WAS IN DETECTOR TYPE. Where should it go.\" [PSI:MS]',	NULL,	1),
(734,	'MS:1000353',	2,	'adduct ion',	'\"Ion formed by the interaction of an ion with one or more atoms or molecules to form an ion containing all the constituent atoms of the precursor ion as well as the additional atoms from the associated atoms or molecules.\" [PSI:MS]',	NULL,	0),
(735,	'MS:1000354',	2,	'aromatic ion',	'\"OBSOLETE A planar cyclic ion that obeys the Hueckel (4n + 2) rule where n is a positive integer representing the number of conjugated Pi electrons. Charge delocalization leads to greater stability compared to a hypothetical localized structure.\" [PSI:MS]',	NULL,	1),
(736,	'MS:1000355',	2,	'analog ion',	'\"OBSOLETE Ions that have similar chemical valence, for example the acetyl cation CH3-CO+ and the thioacetyl cation CH3-CS+.\" [PSI:MS]',	NULL,	1),
(737,	'MS:1000356',	2,	'anti-aromatic ion',	'\"OBSOLETE A planar cyclic ion with 4n ? electrons and is therefore not aromatic.\" [PSI:MS]',	NULL,	1),
(738,	'MS:1000357',	2,	'cationized molecule',	'\"OBSOLETE An ion formed by the association of a cation with a neutral molecule, M, for example [M+ Na]+ and [M + K]+. The terms quasi-molecular ion and pseudo-molecular ion should not be used.\" [PSI:MS]',	NULL,	1),
(739,	'MS:1000358',	2,	'cluster ion',	'\"OBSOLETE An ion formed by a multi-component atomic or molecular assembly of one or more ions with atoms or molecules, such as [(H20)nH]+, [(NaCl)nNa]+ and [(H3PO3)nHPO3]-.\" [PSI:MS]',	NULL,	1),
(740,	'MS:1000359',	2,	'Conventional ion',	'\"OBSOLETE A radical cation or anion in which the charge site and the unpaired electron spin are both formally located in the same atom or group of atoms, as opposed to the spatially separate electronic configuration of distonic ions. The radical cation of methanol, CH3OH+, in which the charge and spin sites are formally located at the O atom is an example of a conventional ion, whereas .CH2-OH2+ is a distonic ion.\" [PSI:MS]',	NULL,	1),
(741,	'MS:1000360',	2,	'diagnostic ion',	'\"OBSOLETE A product ion whose formation reveals structural or compositional information of its precursor. For instance, the phenyl cation in an electron ionization mass spectrum is a diagnostic ion for benzene and derivatives.\" [PSI:MS]',	NULL,	1),
(742,	'MS:1000361',	2,	'dimeric ion',	'\"OBSOLETE An ion formed by ionization of a dimer or by the association of an ion with its neutral counterpart such as [M2]+ or [M-H-M]+.\" [PSI:MS]',	NULL,	1),
(743,	'MS:1000362',	2,	'distonic ion',	'\"OBSOLETE A radical cation or anion in which the charge site and the unpaired electron spin cannot be both formally located in the same atom or group of atoms as it can be with a conventional ion. For example, CH2-OH2+ is a distonic ion whereas the radical cation of methanol, CH3OH+ is a conventional ion.\" [PSI:MS]',	NULL,	1),
(744,	'MS:1000363',	2,	'enium ion',	'\"OBSOLETE A positively charged lower-valency ion of the nonmetallic elements. The methenium ion is CH3+. Other examples are the oxenium, sulfenium, nitrenium, phosphenium, and halenium ions.\" [PSI:MS]',	NULL,	1),
(745,	'MS:1000364',	2,	'fragment ion',	'\"OBSOLETE A product ion that results from the dissociation of a precursor ion.\" [PSI:MS]',	NULL,	1),
(746,	'MS:1000365',	2,	'ion?',	'\"OBSOLETE An atomic or molecular species having a net positive or negative electric charge.\" [PSI:MS]',	NULL,	1),
(747,	'MS:1000366',	2,	'Isotopologue ion',	'\"OBSOLETE An ion that differs only in the isotopic composition of one or more of its constituent atoms. For example CH4+ and CH3D+ or 10BF3 and 11BF3. The term isotopologue is a contraction of isotopic homologue.\" [PSI:MS]',	NULL,	1),
(748,	'MS:1000367',	2,	'Isotopomeric ion',	'\"OBSOLETE Isomeric ion having the same numbers of each isotopic atom but differing in their positions. Isotopomeric ions can be either configurational isomers in which two atomic isotopes exchange positions or isotopic stereoisomers. The term isotopomer is a shortening of isotopic isomer.\" [PSI:MS]',	NULL,	1),
(749,	'MS:1000368',	2,	'metastable ion',	'\"OBSOLETE An ion that is formed with internal energy higher than the threshold for dissociation but with a lifetime great enough to allow it to exit the ion source and enter the mass spectrometer where it dissociates before detection.\" [PSI:MS]',	NULL,	1),
(750,	'MS:1000369',	2,	'molecular ion',	'\"OBSOLETE An ion formed by the removal of one or more electrons to form a positive ion or the addition off one or more electrons to form a negative ion.\" [PSI:MS]',	NULL,	1),
(751,	'MS:1000370',	2,	'negative ion',	'\"OBSOLETE An atomic or molecular species having a net negative electric charge.\" [PSI:MS]',	NULL,	1),
(752,	'MS:1000371',	2,	'non-classical ion',	'\"OBSOLETE Hyper-coordinated carbonium ion such as the penta-coordinated norbornyl cation. Note',	NULL,	1),
(753,	'MS:1000372',	2,	'onium ion',	'\"OBSOLETE A positively charged hypervalent ion of the nonmetallic elements. Examples are the methonium ion CH5+, the hydrogenonium ion H3+ and the hydronium ion H3O+. Other examples are the carbonium, oxonium, sulfonium, nitronium, diazonium, phosphonium, and halonium ions. Onium ions are not limited to monopositive ions; multiply-charged onium ions exist such as the gitonic (proximal) oxonium dication H4O2+ and the distonic oxonium dication H2O+-CH2-CH2-OH2+.\" [PSI:MS]',	NULL,	1),
(754,	'MS:1000373',	2,	'principal ion',	'\"OBSOLETE Most abundant ion of an isotope cluster, such as the 11B79Br2 81Br+ ion of m/z 250 of the cluster of isotopologue molecular ions of BBr3. The term principal ion has also been used to describe ions that have been artificially isotopically enriched in one or more positions such as CH3 13CH3+ or CH2D2 +, but those are best defined as isotopologue ions.\" [PSI:MS]',	NULL,	1),
(755,	'MS:1000374',	2,	'positive ion',	'\"OBSOLETE An atomic or molecular species having a net positive electric charge.\" [PSI:MS]',	NULL,	1),
(756,	'MS:1000375',	2,	'protonated molecule',	'\"OBSOLETE An ion formed by interaction of a neutral molecule with a proton and represented by the symbol [M + H]+, where M is the neutral molecule. The term \'protonated molecular ion,\' \'quasi-molecular ion\' and \'pseudo-molecular ion\' are not recommended.\" [PSI:MS]',	NULL,	1),
(757,	'MS:1000376',	2,	'radical ion',	'\"OBSOLETE An ion, either a cation or anion, containing unpaired electrons in its ground state. The unpaired electron is denoted by a superscript dot alongside the superscript symbol for charge, such as for the molecular ion of a molecule M, that is, M+. Radical ions with more than one charge and/or more than one unpaired electron are denoted such as M(2+)(2). Unless the positions of the unpaired electron and charge can be associated with specific atoms, superscript charge designation should be placed before the superscript dot designation.\" [PSI:MS]',	NULL,	1),
(758,	'MS:1000377',	2,	'reference ion',	'\"OBSOLETE A stable ion whose structure is known with certainty. These ions are usually formed by direct ionization of a neutral molecule of known structure and are used to verify by comparison the structure of an unknown ion.\" [PSI:MS]',	NULL,	1),
(759,	'MS:1000378',	2,	'stable ion',	'\"OBSOLETE An ion with internal energy sufficiently low that it does not rearrange or dissociate prior to detection in a mass spectrometer.\" [PSI:MS]',	NULL,	1),
(760,	'MS:1000379',	2,	'unstable ion',	'\"OBSOLETE An ion with sufficient energy to dissociate within the ion source.\" [PSI:MS]',	NULL,	1),
(761,	'MS:1000380',	2,	'adiabatic ionization',	'\"A process whereby an electron is removed from an atom, ion, or molecule to produce an ion in its lowest energy state.\" [PSI:MS]',	NULL,	0),
(762,	'MS:1000381',	2,	'associative ionization',	'\"An ionization process in which two excited atoms or molecules react to form a single positive ion and an electron.\" [PSI:MS]',	NULL,	0),
(763,	'MS:1000382',	2,	'atmospheric pressure photoionization',	'\"Atmospheric pressure chemical ionization in which the reactant ions are generated by photo-ionization.\" [PSI:MS]',	NULL,	0),
(764,	'MS:1000383',	2,	'autodetachment',	'\"The formation of a neutral when a negative ion in a discrete state with an energy greater than the detachment threshold loses an electron spontaneously without further interaction with an energy source.\" [PSI:MS]',	NULL,	0),
(765,	'MS:1000384',	2,	'autoionization',	'\"The formation of an ion when an atom or molecule in a discrete state with an energy greater than the ionization threshold loses an electron spontaneously without further interaction with an energy source.\" [PSI:MS]',	NULL,	0),
(766,	'MS:1000385',	2,	'charge exchange ionization',	'\"The interaction of an ion with an atom or molecule in which the charge on the ion is transferred to the neutral without the dissociation of either. Synonymous with charge transfer ionization.\" [PSI:MS]',	NULL,	0),
(767,	'MS:1000386',	2,	'chemi-ionization',	'\"The reaction of a neutral molecule with an internally excited molecule to form an ion. Note that this term is not synonymous with chemical ionization.\" [PSI:MS]',	NULL,	0),
(768,	'MS:1000387',	2,	'desorption/ionization on silicon',	'\"The formation of ions by laser desorption ionization of a sample deposited on a porous silicon surface.\" [PSI:MS]',	NULL,	0),
(769,	'MS:1000388',	2,	'dissociative ionization',	'\"The reaction of a gas-phase molecule that results in its decomposition to form products, one of which is an ion.\" [PSI:MS]',	NULL,	0),
(770,	'MS:1000389',	2,	'electron ionization',	'\"The ionization of an atom or molecule by electrons that are typically accelerated to energies between 50 and 150 eV. Usually 70 eV electrons are used to produce positive ions. The term \'electron impact\' is not recommended.\" [PSI:MS]',	NULL,	0),
(771,	'MS:1000390',	2,	'ion desolvation',	'\"OBSOLETE The removal of solvent molecules clustered around a gas-phase ion by means of heating and/or collisions with gas molecules.\" [PSI:MS]',	NULL,	1),
(772,	'MS:1000391',	2,	'ion-pair formation',	'\"OBSOLETE The reaction of a molecule to form both a positive ion and negative ion fragment among the products.\" [PSI:MS]',	NULL,	1),
(773,	'MS:1000392',	2,	'ionization efficiency',	'\"The ratio of the number of ions formed to the number of electrons, molecules or photons used.\" [PSI:MS]',	NULL,	0),
(774,	'MS:1000393',	2,	'',	'',	NULL,	0),
(775,	'MS:1000395',	2,	'liquid secondary ionization',	'\"The ionization of any species by the interaction of a focused beam of ions with a sample that is dissolved in a solvent matrix. See also fast atom bombardment and secondary ionization.\" [PSI:MS]',	NULL,	0),
(776,	'MS:1000396',	2,	'membrane inlet',	'\"A semi-permeable membrane separator that permits the passage of gas sample directly to the mass spectrometer ion source.\" [PSI:MS]',	NULL,	0),
(777,	'MS:1000397',	2,	'microelectrospray',	'\"Electrospray ionization at a solvent flow rate of 300-800 nL/min where the flow is a result of a mechanical pump. See nanoelectrospray.\" [PSI:MS]',	NULL,	0),
(778,	'MS:1000398',	2,	'nanoelectrospray',	'\"Electrospray ionization at a flow rate less than ~25 nL/min. Nanoelectrospray is synonymous with nanospray. The flow is dependent on the potenial on the tip of the electrospray needle and/or a gas presure to push the sample through the needle. See also electrospray ionization and microelectrospray.\" [PSI:MS]',	NULL,	0),
(779,	'MS:1000399',	2,	'penning ionization',	'\"Ionization that occurs through the interaction of two or more neutral gaseous species, at least one of which is internally excited.\" [PSI:MS]',	NULL,	0),
(780,	'MS:1000400',	2,	'plasma desorption ionization',	'\"The ionization of material in a solid sample by bombarding it with ionic or neutral atoms formed as a result of the fission of a suitable nuclide, typically 252Cf. Synonymous with fission fragment ionization.\" [PSI:MS]',	NULL,	0),
(781,	'MS:1000401',	2,	'pre-ionization state',	'\"OBSOLETE An electronic state capable of undergoing auto-Ionization.\" [PSI:MS]',	NULL,	1),
(782,	'MS:1000402',	2,	'secondary ionization',	'\"The process in which ions are ejected from a sample surface as a result of bombardment by a primary beam of atoms or ions.\" [PSI:MS]',	NULL,	0),
(783,	'MS:1000403',	2,	'soft ionization',	'\"The formation of gas-phase ions without extensive fragmentation.\" [PSI:MS]',	NULL,	0),
(784,	'MS:1000404',	2,	'spark ionization',	'\"The formation of ions from a solid material by an intermittent electrical discharge.\" [PSI:MS]',	NULL,	0),
(785,	'MS:1000405',	2,	'surface-assisted laser desorption ionization',	'\"The formation of gas-phase ions from molecules that are deposited on a particular surface substrate that is irradiated with a pulsed laser. See also matrix-assisted laser desorption ionization.\" [PSI:MS]',	NULL,	0),
(786,	'MS:1000406',	2,	'surface ionization',	'\"The ionization of a neutral species when it interacts with a solid surface with an appropriate work function and temperature.\" [PSI:MS]',	NULL,	0),
(787,	'MS:1000407',	2,	'thermal ionization',	'\"The ionization of a neutral species through contact with a high temperature surface.\" [PSI:MS]',	NULL,	0),
(788,	'MS:1000408',	2,	'vertical ionization',	'\"A process in which an electron is removed from or added to a molecule without a change in the positions of the atoms. The resulting ion is typically in an excited vibrational state.\" [PSI:MS]',	NULL,	0),
(789,	'MS:1000409',	2,	'association reaction',	'\"OBSOLETE The reaction of an ion with a neutral species in which the reactants combine to form a single ion.\" [PSI:MS]',	NULL,	1),
(790,	'MS:1000410',	2,	'alpha-cleavage',	'\"OBSOLETE A homolytic cleavage where the bond fission occurs between at the atom adjacent to the atom at the apparent charge site and an atom removed from the aparent charge site by two bonds.\" [PSI:MS]',	NULL,	1),
(791,	'MS:1000411',	2,	'beta-cleavage',	'\"OBSOLETE A homolytic cleavage where the bond fission occurs between at an atom removed from the apparent charge site atom by two bonds and an atom adjacent to that atom and removed from the aparent charge site by three bonds.\" [PSI:MS]',	NULL,	1),
(792,	'MS:1000412',	2,	'buffer gas',	'\"An inert gas used for collisional deactivation of internally excited ions.\" [PSI:MS]',	NULL,	0),
(793,	'MS:1000413',	2,	'charge-induced fragmentation',	'\"OBSOLETE Fragmentation of an odd electron ion in which the cleaved bond is adjacent to the apparent charge site. Synonymous with charge mediated fragmentation.\" [PSI:MS]',	NULL,	1),
(794,	'MS:1000414',	2,	'charge inversion reaction',	'\"OBSOLETE Reaction of an ion with a neutral species in which the charge on the product ion is reversed in sign with respect to the reactant ion.\" [PSI:MS]',	NULL,	1),
(795,	'MS:1000415',	2,	'charge permutation reaction',	'\"OBSOLETE The reaction of an ion with a neutral species with a resulting change in the magnitude or sign of the charge on the reactant ion.\" [PSI:MS]',	NULL,	1),
(796,	'MS:1000416',	2,	'charge stripping reaction',	'\"OBSOLETE Reaction of a positive ion with a neutral species in which the positive charge on the product ion is greater than that on the reactant ion.\" [PSI:MS]',	NULL,	1),
(797,	'MS:1000417',	2,	'charge transfer reaction',	'\"OBSOLETE The reaction of an ion with a neutral species in which some or all of the charge of the reactant ion is transferred to the neutral species.\" [PSI:MS]',	NULL,	1),
(798,	'MS:1000418',	2,	'collisional excitation',	'\"OBSOLETE The reaction of an ion with a neutral species in which the translational energy of the collision is converted into internal energy of the ion.\" [PSI:MS]',	NULL,	1),
(799,	'MS:1000419',	2,	'collision gas',	'\"An inert gas used for collisional excitation. The term target gas is not recommended.\" [PSI:MS]',	NULL,	0),
(800,	'MS:1000420',	2,	'heterolytic cleavage',	'\"OBSOLETE Fragmentation of a molecule or ion in which both electrons forming the single bond that is broken remain on one of the atoms that were originally bonded. This term is synonymous with heterolysis.\" [PSI:MS]',	NULL,	1),
(801,	'MS:1000421',	2,	'high energy collision',	'\"OBSOLETE Collision-induced dissociation process wherein the projectile ion has laboratory-frame translational energy higher than 1 keV.\" [PSI:MS]',	NULL,	1),
(802,	'MS:1000422',	2,	'beam-type collision-induced dissociation',	'\"A collision-induced dissociation process that occurs in a beam-type collision cell.\" [PSI:MS]',	NULL,	0),
(803,	'MS:1000423',	2,	'homolytic cleavage',	'\"OBSOLETE Fragmentation of an odd electron ion that results from one of a pair of electrons that form a bond between two atoms moving to form a pair with the odd electron on the atom at the apparent charge site. Fragmentation results in the formation of an even electron ion and a radical. This reaction involves the movement of a single electron and is symbolized by a single-barbed arrow. Synonymous with Homolysis.\" [PSI:MS]',	NULL,	1),
(804,	'MS:1000424',	2,	'hydrogen/deuterium exchange',	'\"OBSOLETE Exchange of hydrogen atoms with deuterium atoms in a molecule or pre-formed ion in solution prior to introduction into a mass spectrometer, or by reaction of an ion with a deuterated collision gas inside a mass spectrometer.\" [PSI:MS]',	NULL,	1),
(805,	'MS:1000425',	2,	'ion energy loss spectrum',	'\"OBSOLETE A plot of the relative abundance of a beam or other collection of ions as a function their loss of translational energy in reactions with neutral species.\" [PSI:MS]',	NULL,	1),
(806,	'MS:1000426',	2,	'ionizing collision',	'\"OBSOLETE The reaction of an ion with a neutral species in which one or more electrons are removed from either the ion or neutral.\" [PSI:MS]',	NULL,	1),
(807,	'MS:1000427',	2,	'ion/molecule reaction',	'\"OBSOLETE The reaction of an ion with a neutral molecule. The term ion-molecule reaction is not recommended because the hyphen suggests a single species that is that is both an ion and a molecule.\" [PSI:MS]',	NULL,	1),
(808,	'MS:1000428',	2,	'ion/neutral complex',	'\"OBSOLETE A particular type of transition state that lies between precursor and product ions on the reaction coordinate of some ion reactions.\" [PSI:MS]',	NULL,	1),
(809,	'MS:1000429',	2,	'ion/neutral species reaction',	'\"OBSOLETE A process wherein a charged species interacts with a neutral reactant to produce either chemically different species or changes in the internal energy of one or both of the reactants.\" [PSI:MS]',	NULL,	1),
(810,	'MS:1000430',	2,	'ion/neutral species exchange reaction',	'\"OBSOLETE In this reaction an association reaction is accompanied by the subsequent or simultaneous liberation of a different neutral species as a product.\" [PSI:MS]',	NULL,	1),
(811,	'MS:1000431',	2,	'kinetic method',	'\"OBSOLETE An approach to determination of ion thermodynamic quantities by a bracketing procedure in which the relative probabilities of competing ion fragmentations are measured via the relative abundances of the reaction products. The extended kinetic method takes the associated entropy changes into account.\" [PSI:MS]',	NULL,	1),
(812,	'MS:1000432',	2,	'low energy collisions',	'\"OBSOLETE A collision between an ion and neutral species with translational energy approximately 1000 eV or lower.\" [PSI:MS]',	NULL,	1),
(813,	'MS:1000433',	2,	'low-energy collision-induced dissociation',	'\"A collision-induced dissociation process wherein the precursor ion has the translational energy lower than approximately 1000 eV. This process typically requires multiple collisions and the collisional excitation is cumulative.\" [PSI:MS]',	NULL,	0),
(814,	'MS:1000434',	2,	'McLafferty Rearrangement',	'\"OBSOLETE A dissociation reaction triggered by transfer of a hydrogen atom via a 6-member transition state to the formal radical/charge site from a carbon atom four atoms removed from the charge/radical site (the gamma-carbon); subsequent rearrangement of electron density leads to expulsion of an olefin molecule. This term was originally applied to ketone ions where the charge/radical site is the carbonyl oxygen, but it is now more widely applied.\" [PSI:MS]',	NULL,	1),
(815,	'MS:1000435',	2,	'photodissociation',	'\"A process wherein the reactant ion is dissociated as a result of absorption of one or more photons.\" [PSI:MS]',	NULL,	0),
(816,	'MS:1000436',	2,	'partial charge transfer reaction',	'\"OBSOLETE Reaction of an ion with a neutral species in which some but not all of the ion charge is transferred to the neutral.\" [PSI:MS]',	NULL,	1),
(817,	'MS:1000437',	2,	'ion reaction',	'\"OBSOLETE Chemical transformation involving an ion.\" [PSI:MS]',	NULL,	1),
(818,	'MS:1000438',	2,	'superelastic collision',	'\"OBSOLETE Collision in which the translational energy of the fast-moving collision partner is increased at the expense of internal energy of one or both collision partners.\" [PSI:MS]',	NULL,	1),
(819,	'MS:1000439',	2,	'surface-induced reaction',	'\"OBSOLETE A process wherein a reactant ion interacts with a surface to produce either chemically different species or a change in the internal energy of the reactant ion.\" [PSI:MS]',	NULL,	1),
(820,	'MS:1000440',	2,	'unimolecular dissociation',	'\"OBSOLETE Fragmentation reaction in which the molecularity is treated as one, irrespective of whether the dissociative state is that of a metastable ion produced in the ion source or results from collisional excitation of a stable ion.\" [PSI:MS]',	NULL,	1),
(821,	'MS:1000441',	2,	'scan',	'\"Function or process of the mass spectrometer where it records a spectrum.\" [PSI:MS]',	NULL,	0),
(822,	'MS:1000442',	2,	'spectrum',	'\"Representation of intensity values corresponding to a range of measurement space.\" [PSI:MS]',	NULL,	0),
(823,	'MS:1000443',	2,	'mass analyzer type',	'\"Mass analyzer separates the ions according to their mass-to-charge ratio.\" [PSI:MS]',	NULL,	0),
(824,	'MS:1000444',	2,	'm/z Separation Method',	'\"OBSOLETE Mass/charge separation Method.\" [PSI:MS]',	NULL,	1),
(825,	'MS:1000445',	2,	'sequential m/z separation method',	'\"OBSOLETE Sequential m/z separation method.\" [PSI:MS]',	NULL,	1),
(826,	'MS:1000446',	2,	'fast ion bombardment',	'\"The ionization of any species by the interaction of a focused beam of ions having a translational energy of several thousand eV with a solid sample.\" [PSI:MS]',	NULL,	0),
(827,	'MS:1000447',	2,	'LTQ',	'\"Finnigan LTQ MS.\" [PSI:MS]',	NULL,	0),
(828,	'MS:1000448',	2,	'LTQ FT',	'\"Finnigan LTQ FT MS.\" [PSI:MS]',	NULL,	0),
(829,	'MS:1000449',	2,	'LTQ Orbitrap',	'\"Finnigan LTQ Orbitrap MS.\" [PSI:MS]',	NULL,	0),
(830,	'MS:1000450',	2,	'LXQ',	'\"Finnigan LXQ MS.\" [PSI:MS]',	NULL,	0),
(831,	'MS:1000451',	2,	'mass analyzer',	'\"Terms used to describe the Analyzer.\" [PSI:MS]',	NULL,	0),
(832,	'MS:1000452',	2,	'data transformation',	'\"Terms used to describe types of data processing.\" [PSI:MS]',	NULL,	0),
(833,	'MS:1000453',	2,	'detector',	'\"The device that detects ions.\" [PSI:MS]',	NULL,	0),
(834,	'MS:1000454',	2,	'instrument additional description',	'\"OBSOLETE Additional terms to describe the instrument as outlined in the mass spec doc, Appendix 1, section 1.5.\" [PSI:MS]',	NULL,	1),
(835,	'MS:1000455',	2,	'ion selection attribute',	'\"Ion selection properties that are associated with a value.\" [PSI:MS]',	NULL,	0),
(836,	'MS:1000456',	2,	'precursor activation',	'\"Terms to describe the precursor activation.\" [PSI:MS]',	NULL,	0),
(837,	'MS:1000457',	2,	'sample',	'\"Terms to describe the sample.\" [PSI:MS]',	NULL,	0),
(838,	'MS:1000458',	2,	'source',	'\"Terms to describe the source.\" [PSI:MS]',	NULL,	0),
(839,	'MS:1000459',	2,	'spectrum instrument description',	'\"OBSOLETE Terms used to describe the spectrum.\" [PSI:MS]',	NULL,	1),
(840,	'MS:1000460',	2,	'unit',	'\"OBSOLETE Terms to describe units.\" [PSI:MS]',	NULL,	1),
(841,	'MS:1000461',	2,	'additional description',	'\"OBSOLETE Terms to describe Additional.\" [PSI:MS]',	NULL,	1),
(842,	'MS:1000462',	2,	'ion optics',	'\"Device used in the construction of a mass spectrometer to focus, contain or otherwise manipulate ions.\" [PSI:MS]',	NULL,	0),
(843,	'MS:1000463',	2,	'instrument',	'\"Description of the instrument or the mass spectrometer.\" [PSI:MS]',	NULL,	0),
(844,	'MS:1000464',	2,	'mass unit',	'\"OBSOLETE A unit of measurement for mass.\" [PSI:MS]',	NULL,	1),
(845,	'MS:1000465',	2,	'scan polarity',	'\"Relative orientation of the electromagnetic field during the selection and detection of ions in the mass spectrometer.\" [PSI:MS]',	NULL,	0),
(846,	'MS:1000466',	2,	'alternating',	'\"OBSOLETE Alternating.\" [PSI:MS]',	NULL,	1),
(847,	'MS:1000467',	2,	'1200 series LC/MSD SL',	'\"The 1200 Series LC/MSD SL ion trap belongs to the Agilent LC/MSD ion trap family. It provides fast polarity switching and multisignal data acquisition capabilities in a single run while also providing 5 stages of automated data dependent MS2 and 11 stages of manual MS2.\" [PSI:MS]',	NULL,	0),
(848,	'MS:1000468',	2,	'6110 Quadrupole LC/MS',	'\"The 6110 Quadrupole LC/MS system is a Agilent liquid chromatography instrument combined with an entry level single quadrupole mass spectrometer from the 6100 Series of Agilent quadrupole mass spectrometers. 6110 Quadrupole mass spectrometer has m/z range of 10-1500 and 2500 u/s scan speed. It proves useful for wide range of SIM quantitative applications.\" [PSI:MS]',	NULL,	0),
(849,	'MS:1000469',	2,	'6120A Quadrupole LC/MS',	'\"The 6120A Quadrupole LC/MS system is a Agilent liquid chromatography instrument combined with a single quadrupole mass spectrometer from the 6100 Series of Agilent mass spectrometers. 6120 quadrupole mass spectrometer has m/z range of 10-1500, 2500 u/s scan speed and utilizes multiple signal acquisition.\" [PSI:MS]',	NULL,	0),
(850,	'MS:1000470',	2,	'6130 Quadrupole LC/MS',	'\"The 6130 Quadrupole LC/MS system is a Agilent liquid chromatography instrument combined with a single quadrupole mass spectrometer from the 6100 series of Agilent mass spectrometers. The 6130 quadrupole mass spectrometer has m/z range of 2-3000, 2500 u/s scan speed in standard mode and 5250 u/s speed in fast-scan mode. It also uses multiple signal acquisition.\" [PSI:MS]',	NULL,	0),
(851,	'MS:1000471',	2,	'6140 Quadrupole LC/MS',	'\"The 6140 Quadrupole LC/MS system is a Agilent liquid chromatography instrument combined with a single quadrupole mass spectrometer from the 6100 Series of Agilent quadrupole mass spectrometers. 6140 Quadrupole mass spectrometer has m/z range of 10-1350, 2500 u/s scan speed in standard mode and 10000 u/s speed in fast-scan mode. It also uses multiple signal acquisition.\" [PSI:MS]',	NULL,	0),
(852,	'MS:1000472',	2,	'6210 Time-of-Flight LC/MS',	'\"The 6210 Time-of-Flight LC/MS is a Agilent liquid chromatography instrument combined with a Agilent time of flight mass spectrometer. This time of flight mass spectrometer has a m/z range of 50-12000, mass accuracy of less than 2 ppm and resolution greater than 13,000 at m/z 2722. It has multiple ion sources and can be used with multimode ion sources.\" [PSI:MS]',	NULL,	0),
(853,	'MS:1000473',	2,	'6310 Ion Trap LC/MS',	'\"The 6310 Ion Trap LC/MS is a Agilent liquid chromatography instrument combined with a 6300 series Agilent ion trap. It has a mass range of 50-2200 between 0.6 to 0.35 resolution and mass range of 200-4000 with resolution of 3-4. The scan speed varies from 1650-27000 for the respective mass ranges.\" [PSI:MS]',	NULL,	0),
(854,	'MS:1000474',	2,	'6320 Ion Trap LC/MS',	'\"The 6320 Ion Trap LC/MS is a Agilent liquid chromatography instrument combined with a 6300 series Agilent ion trap. It has a mass range of 50-2200 between 0.6 to 0.25 resolution and mass range of 200-4000 with resolution of less than 3. The scan speed varies from 1650-27000 for the respective mass ranges.\" [PSI:MS]',	NULL,	0),
(855,	'MS:1000475',	2,	'6330 Ion Trap LC/MS',	'\"The 6330 Ion Trap LC/MS is a Agilent liquid chromatography instrument combined with a 6300 series Agilent ion trap. It has a mass range of 50-2200 between 0.6 to 0.25 resolution and mass range of 200-4000 with resolution of less than 3. The scan speed varies from 1650-27000 for the respective mass ranges.\" [PSI:MS]',	NULL,	0),
(856,	'MS:1000476',	2,	'6340 Ion Trap LC/MS',	'\"The 6340 Ion Trap LC/MS is a Agilent liquid chromatography instrument combined with a 6300 series Agilent ion trap. It has a mass range of 50-2200 between 0.6 to 0.25 resolution and mass range of 200-4000 with resolution of less than 3. The scan speed varies from 1650-27000 for the respective mass ranges.\" [PSI:MS]',	NULL,	0),
(857,	'MS:1000477',	2,	'6410 Triple Quadrupole LC/MS',	'\"The 6410 Quadrupole LC/MS system is a Agilent liquid chromatography instrument combined with a Agilent triple quadrupole mass spectrometer. Mass range of the mass spectrometer is 15-1650 m/z, resolution is at three settings of 0.7 u (unit), 1.2 u (wide) and 2.5 u (widest). The mass accuracy for 6410 mass spectrometer is 0.1 across the mass range. The collision cell is a hexapole with linear acceleration.\" [PSI:MS]',	NULL,	0),
(858,	'MS:1000478',	2,	'1200 series LC/MSD VL',	'\"The LC/MSD VL ion trap is part of the family of Agilent ion trap mass spectrometers. It has ESI, APCI and APPI ion sources and is a useful ion trap when the amount of sample is not the limiting factor.\" [PSI:MS]',	NULL,	0),
(859,	'MS:1000479',	2,	'purgatory',	'\"OBSOLETE Terms that will likely become obsolete unless there are wails of dissent.\" [PSI:MS]',	NULL,	1),
(860,	'MS:1000480',	2,	'mass analyzer attribute',	'\"Analyzer properties that are associated with a value.\" [PSI:MS]',	NULL,	0),
(861,	'MS:1000481',	2,	'detector attribute',	'\"Detector attribute recognized as a value.\" [PSI:MS]',	NULL,	0),
(862,	'MS:1000482',	2,	'source attribute',	'\"Property of a source device that need a value.\" [PSI:MS]',	NULL,	0),
(863,	'MS:1000483',	2,	'Thermo Fisher Scientific instrument model',	'\"Thermo Fisher Scientific instrument model. The company has gone through several names including Thermo Finnigan, Thermo Scientific.\" [PSI:MS]',	NULL,	0),
(864,	'MS:1000484',	2,	'orbitrap',	'\"An ion trapping device that consists of an outer barrel-like electrode and a coaxial inner spindle-like electrode that form an electrostatic field with quadro-logarithmic potential distribution. The frequency of harmonic oscillations of the orbitally trapped ions along the axis of the electrostatic field is independent of the ion velocity and is inversely proportional to the square root of m/z so that the trap can be used as a mass analyzer.\" [PSI:MS]',	NULL,	0),
