(1161,	'MS:1000782',	2,	'Savitzky-Golay smoothing',	'\"Reduces intensity spikes by applying local polynomial regression (of degree k) on a distribution (of at least k+1 equally spaced points) to determine the smoothed value for each point. It tends to preserve features of the distribution such as relative maxima, minima and width, which are usually \'flattened\' by other adjacent averaging techniques.\" [PSI:MS]',	NULL,	0),
(1162,	'MS:1000783',	2,	'LOWESS smoothing',	'\"Reduces intensity spikes by applying a modelling method known as locally weighted polynomial regression. At each point in the data set a low-degree polynomial is fit to a subset of the data, with explanatory variable values near the point whose response is being estimated. The polynomial is fit using weighted least squares, giving more weight to points near the point whose response is being estimated and less weight to points further away. The value of the regression function for the point is then obtained by evaluating the local polynomial using the explanatory variable values for that data point. The LOESS fit is complete after regression function values have been computed for each of the n data points. Many of the details of this method, such as the degree of the polynomial model and the weights, are flexible.\" [PSI:MS]',	NULL,	0),
(1163,	'MS:1000784',	2,	'Gaussian smoothing',	'\"Reduces intensity spikes by convolving the data with a one-dimensional Gaussian function.\" [PSI:MS]',	NULL,	0),
(1164,	'MS:1000785',	2,	'moving average smoothing',	'\"Reduces intensity spikes by averaging each point with two or more adjacent points. The more adjacent points that used, the stronger the smoothing effect.\" [PSI:MS]',	NULL,	0),
(1165,	'MS:1000786',	2,	'non-standard data array',	'\"A data array that contains data not covered by any other term in this group. Please do not use this term, if the binary data array type might be commonly used - contact the PSI-MS working group in order to have another CV term added.\" [PSI:MS]',	NULL,	0),
