(3704,	'PO:0005004',	3,	'shoot axis node',	'\"A cardinal organ part (PO:0025001) of a shoot axis (PO:0025029) where a bud (PO:0000055) may form and develop into a branch (PO:0025073), leaf (PO:0025034), flower (PO:0004541), inflorescence (PO:0009049) or nodal root (PO:0003005).\" [Gramene:Pankaj_Jaiswal, POC:curators, POC:Laurel_Cooper]',	NULL,	0),
(3705,	'PO:0005005',	3,	'shoot axis internode',	'\"A cardinal organ part (PO:0025001) of a shoot axis (PO:0025029) that is between two shoot axis nodes (PO:0005004).\" [POC:curators, POC:Laurel_Cooper]',	NULL,	0),
(3706,	'PO:0005006',	3,	'articulated laticifer',	'\"A portion of secretory tissue (PO:0005656) that has as parts articulated laticifer cells (PO:0006221).\" [Gramene:Pankaj_Jaiswal, ISBN:0471245208, POC:curators]',	NULL,	0),
(3707,	'PO:0005007',	3,	'non-articulated laticifer',	'\"OBSOLETE. A structure consisting of long multinucleate tubes in which latex is found, having no cross walls.\" [APweb:Glossary, Gramene:Pankaj_Jaiswal]',	NULL,	1),
(3708,	'PO:0005008',	3,	'obsolete fruit septum',	'\"OBSOLETE. A thin partition or membrane that divides a cavity or a mass of tissue in the fruit that is derived from the carpel septum.\" [Gramene:Chih-Wei_Tung]',	NULL,	1),
