(3710,	'PO:0005010',	3,	'anther septum',	'\"A septum (PO:0000030) that is part of an anther dehiscence zone (PO:0005011).\" [Gramene:Chih-Wei_Tung, Gramene:Pankaj_Jaiswal, POC:Laurel_Cooper]',	NULL,	0),
(3711,	'PO:0005011',	3,	'anther dehiscence zone',	'\"A dehiscence zone (PO:0025092) that is part of an anther (PO:0009066).\" [POC:curators]',	NULL,	0),
(3712,	'PO:0005012',	3,	'pedicel vascular system',	'\"A shoot axis vascular system (PO:0000039) that includes the totality of the portions of vascular tissue in their specific arrangement in a pedicel (PO:0030112).\" [PMID:17217456, POC:Ramona_Walls]',	NULL,	0),
(3713,	'PO:0005013',	3,	'hypocotyl epidermis',	'\"The outermost primary cell layer of the hypocotyl.\" [PMID:15368128, TAIR_curator:Donghui_Li]',	NULL,	0),
(3714,	'PO:0005014',	3,	'embryo cortex',	'\"A portion of cortex (PO:0005708) that is part of a plant embryo (PO:0009009).\" [PMID:16543410, POC:curators, TAIR_curator:Donghui_Li]',	NULL,	0),
(3715,	'PO:0005015',	3,	'embryo endodermis',	'\"A portion of endodermis (PO:0000252) that is part of an plant embryo (PO:0009009).\" [PMID:16543410]',	NULL,	0),
(3716,	'PO:0005016',	3,	'replum',	'\"OBSOLETE. A false septum formed by the ingrowth from the placenta of an ovary rather than from the carpel walls. This is formed post fertilization.\" [Gramene:Pankaj_Jaiswal, PMID:13678595, PMID:15035986]',	NULL,	1),
