(3718,	'PO:0005018',	3,	'stamen vascular system',	'\"A phyllome vascular system (PO:0025206) that includes the totality of the portions of vascular tissue in their specific arrangement in a stamen (PO:0009029).\" [POC:Ramona_Walls]',	NULL,	0),
