(3720,	'PO:0005020',	3,	'vascular bundle',	'\"A portion of vascular tissue (PO:0009015) that is a unit strand of the vascular system (PO:0000034) and has as part xylem (PO:0005352) or phloem (PO:0005417).\" [POC:curators]',	NULL,	0),
