(3722,	'PO:0005022',	3,	'plant ovary wall',	'\"A portion of plant tissue (PO:0009007) that is composed of plant ovary outer epidermis (PO:0005023), plant ovary inner epidermis (PO:0005024), and a plant ovary wall middle layer (PO:0005025)\" [Gramene:Pankaj_Jaiswal, PMID:10332605, POC:Laurel_Cooper]',	NULL,	0),
