(3724,	'PO:0005024',	3,	'plant ovary inner epidermis',	'\"A portion of ovary epidermis (PO:0006063) which is the inner surface of a plant ovary (PO:0009072).\" [Gramene:Pankaj_Jaiswal, POC:Laurel_Cooper]',	NULL,	0),
(3725,	'PO:0005025',	3,	'plant ovary wall middle layer',	'\"A portion of chlorenchyma tissue (PO:0005426) that is part of the plant ovary wall (PO:0005022) and is composed of mesophyll cells (PO:0004006).\" [Gramene:Pankaj_Jaiswal, PMID:10332605]',	NULL,	0),
(3726,	'PO:0005026',	3,	'root giant cell',	'\"Multinucleate cell developed by a series of events involving kayokinesis but not cytokinesis of the initial feeding cell. The events are induced by root knot nematodes (e.g., Meloidogyne sp. ) entering the feeding cells (any cells) of the root vascular system.\" [Gramene:Pankaj_Jaiswal, PMID:15053756]',	NULL,	0),
(3727,	'PO:0005027',	3,	'root syncytium cell',	'\"Multinucleate cell developed by a series of events involving fusion with the neighboring dividing cells. The events are induced by cyst nematodes (e.g. <i>Heterodera schachtii</i>) entering the feeding cells (any cells) of the root vascular system.\" [Gramene:Pankaj_Jaiswal, PMID:15053756]',	NULL,	0),
(3728,	'PO:0005028',	3,	'inflorescence vascular system',	'\"A shoot system vascular system  (PO:0025205) that includes the totality of the portions of vascular tissue in their specific arrangement in an inflorescence (PO:0009049).\" [POC:Ramona_Walls]',	NULL,	0),
(3729,	'PO:0005029',	3,	'root primordium',	'\"A primordium (PO:0025127) that develops from a root anlagen (PO:0025433) and is committed to the development of a root (PO:0009005).\" [ISBN:0521288959, POC:curators]',	NULL,	0),
(3730,	'PO:0005030',	3,	'lupulin gland',	'\"A glandular trichome (PO:0004509) that synthesizes terpenophenolic resins and prenylflavonoids.\" [CHEBI:66331, PMID:18223037, PO:austin_meier]',	NULL,	0),
(3731,	'PO:0005031',	3,	'microsporangiate strobilus',	'\"A strobilus (PO:0025083) that bears only pollen (PO:0025281).\" [POC:austin_meier, POC:Laurel_Cooper]',	NULL,	0),
(3732,	'PO:0005032',	3,	'megasporangiate strobilus',	'\"A strobilus (PO:0025083) that bears only plant ovules (PO:0020003).\" [POC:austin_meier, POC:Laurel_Cooper]',	NULL,	0),
(3733,	'PO:0005039',	3,	'primary thickening meristem',	'\"A shoot lateral meristem (PO:0006344) that is part of a shoot axis (PO:0025029) and has a parts multiple layers of meristematic cells (PO:0004010) located near the shoot apical meristem (PO:0020148).\" [ISBN:0471245208, JSTOR:4354165]',	NULL,	0),
