(3735,	'PO:0005041',	3,	'shoot axis pith',	'\"A portion of pith (PO:0006109) that is part of a shoot axis (PO:0025029).\" [ISBN:0080280307]',	NULL,	0),
(3736,	'PO:0005043',	3,	'secondary phloem',	'\"A portion of phloem (PO:0005417) tissue that develops from a vascular cambium (PO:0005598).\" [ISBN:0471245208]',	NULL,	0),
(3737,	'PO:0005046',	3,	'periderm',	'\"A peripheral portion of ground tissue (PO:0025059) in a plant axis (PO:0025004) that is composed of cork cambium (phellogen; PO:0005599), phellem (PO:0004003), and phelloderm (PO:0005050).\" [ISBN:0471245208, POC:curators]',	NULL,	0),
(3738,	'PO:0005047',	3,	'root periderm',	'\"A portion of periderm tissue (PO:0005046) that is part of a root (PO:0009005).\" [POC:curators]',	NULL,	0),
(3739,	'PO:0005048',	3,	'shoot axis periderm',	'\"A portion of periderm tissue (PO:0005046) that is part of a shoot axis (PO:0025029).\" [POC:curators]',	NULL,	0),
