(3741,	'PO:0005051',	3,	'hypodermis',	'\"A portion of ground tissue (PO:0025059) that is the outermost layer of a portion of cortex (PO:0005708).\" [POC:curators]',	NULL,	0),
(3742,	'PO:0005052',	3,	'plant callus',	'\"A portion of plant tissue (PO:0009007) that consists of mass of undifferentiated plant cells (PO:0009002).\" [Gramene:Pankaj_Jaiswal, POC:curators]',	NULL,	0),
(3743,	'PO:0005053',	3,	'laticifer',	'\"OBSOLETE. A secretory structure that produces latex.\" [ISBN:0080374913]',	NULL,	1),
(3744,	'PO:0005057',	3,	'shoot axis hypodermis',	'\"A portion of shoot axis hypodermis (PO:0005057) that is part of a stem cortex (PO:0000223).\" [ISBN:0080374913, POC:curators]',	NULL,	0),
