(3769,	'PO:0005665',	3,	'resin canal',	'\"A canal (PO:0025132) of schizogenous origin, lined with secretory resin cells (PO:0025604) and containing plant resin (PO:0025603).\" [Gramene:Pankaj_Jaiswal, ISBN:0080374913, PMID:11337413, POC:Laurel_Cooper]',	NULL,	0),
