(3773,	'PO:0005704',	3,	'rhexigenous aerenchyma',	'\"OBSOLETE. Aerenchyma originating by rupture of cells.\" [Gramene:Pankaj_Jaiswal, ISBN:0080374913]',	NULL,	1),
(3774,	'PO:0005706',	3,	'lysigenous aerenchyma',	'\"OBSOLETE. Aerenchyma originating by dissolution of cells.\" [Gramene:Pankaj_Jaiswal, ISBN:0080374913]',	NULL,	1),
(3775,	'PO:0005708',	3,	'cortex',	'\"A maximal portion of ground tissue (PO:0025059) between the vascular system (PO:0000034) and the epidermis (PO:0005679) in a plant.\" [POC:curators]',	NULL,	0),
