(3778,	'PO:0005848',	3,	'secondary xylem',	'\"A portion of xylem (PO:0005352) tissue that develops from a vascular cambium (PO:0005598).\" [ISBN:0471245194]',	NULL,	0),
(3779,	'PO:0005849',	3,	'primary xylem',	'\"A portion of xylem (PO:0005352) tissue that develops from the procambium (PO:0025275).\" [ISBN:0122151704, ISBN:0471245194]',	NULL,	0),
(3780,	'PO:0006000',	3,	'caryopsis hull',	'\"A collective phyllome structure that encloses a fruit of the Poaceae (caryopsis) and develops from a dried lemma and palea.\" [POC:Ramona_Walls]',	NULL,	0),
(3781,	'PO:0006001',	3,	'phyllome',	'\"A lateral plant organ (PO:0009008) produced by a shoot apical meristem (PO:0020148).\" [POC:curators]',	NULL,	0),
(3782,	'PO:0006002',	3,	'lower glume',	'\"A glume that is the proximal/basal of the two glumes subtending a pair of florets.\" [Gramene:Pankaj_Jaiswal]',	NULL,	0),
(3783,	'PO:0006003',	3,	'scale leaf',	'\"A phyllome that is reduced in size relative to a vascular leaf on the same plant and is often associated with a perennating or dormant bud or a vegetatively propagating organ such as a rhizome.\" [ISBN:0080374913]',	NULL,	0),
(3784,	'PO:0006004',	3,	'upper glume',	'\"A glume that is the apical/distal of the two glumes subtending a pair of florets.\" [Gramene:Pankaj_Jaiswal, POC:Ramona_Walls]',	NULL,	0),
(3785,	'PO:0006005',	3,	'carpel anlagen',	'\"A phyllome anlagen (PO:0025430) that will give rise to a carpel primordium (PO:0004703) and is part of a peripheral zone (PO:000225) of a flower meristem (PO:0000229).\" [PMID:14729915, POC:curators]',	NULL,	0),
(3786,	'PO:0006006',	3,	'anther wall primary parietal cell layer',	'\"A portion of ground tissue (PO:0025059) that is part of an anther wall (PO:0000002) and has as parts a primary parietal cell (PO:0006010) and adjacent plant cells.\" [Gramene:Pankaj_Jaiswal, ISBN:9780003686647, PMID:2476454]',	NULL,	0),
(3787,	'PO:0006007',	3,	'anther wall secondary parietal cell layer',	'\"A portion of ground tissue (PO:0025059) that is part of an anther wall (PO:0000002) and develops from an anther wall primary parietal cell layer (PO:0006006).\" [Gramene:Pankaj_Jaiswal, ISBN:9780003686647, PMID:2476454]',	NULL,	0),
(3788,	'PO:0006008',	3,	'anther wall inner secondary parietal cell layer',	'\"An anther wall secondary parietal cell layer (PO:0006007) that is formed towards the inside, after the cells of an anther wall primary parietal cell layer (PO:0006006) undergo a periclinal division.\" [Gramene:Pankaj_Jaiswal, ISBN:9780003686647, PMID:2476454]',	NULL,	0),
(3789,	'PO:0006009',	3,	'anther wall outer secondary parietal cell layer',	'\"An anther wall secondary parietal cell layer (PO:0006007) formed towards the outside, after an anther wall primary parietal cell layer (An anther wall secondary parietal cell layer (PO:0006006) undergoes a periclinal division.\" [Gramene:Pankaj_Jaiswal, ISBN:9780003686647, PMID:2476454]',	NULL,	0),
(3790,	'PO:0006010',	3,	'primary parietal cell',	'\"A native plant cell (PO:0025606) which is formed by the division of a male archesporial cell (PO:0006014), and is part of the anther wall primary parietal cell layer (PO:0006006).\" [PMID:2476454, POC:Laurel_Cooper]',	NULL,	0),
(3791,	'PO:0006011',	3,	'lateral leaf vein',	'\"An unbranched second order leaf vein (PO:0020140) that runs between two adjacent primary leaf veins (PO:0025413).\" [Gramene:Pankaj_Jaiswal, POC:Ramona_Walls]',	NULL,	0),
(3792,	'PO:0006012',	3,	'leaf collar',	'\"A thin band of intercalary meristematic tissue at the junction of a leaf blade (lamina) and a leaf sheath found in grasses.\" [Gramene:Pankaj_Jaiswal, ISBN:0080374913]',	NULL,	0),
(3793,	'PO:0006013',	3,	'juice sac tissue',	'\"A portion of plant tissue (PO:0009007) which is composed of highly vacuolated cells forming closely-packed, club-shaped sacs with long slender stalks and containing juice.\" [Gramene:Pankaj_Jaiswal, ISBN:0471245208, POC:Laurel_Cooper]',	NULL,	0),
(3794,	'PO:0006014',	3,	'male archesporial cell',	'\"An archesporial cell (PO:0030056) that is part of a microsporangium (PO:0025202) and divides to gives rise to a microsporocyte (PO:0020047).\" [PMID:10465788, POC:curators]',	NULL,	0),
(3795,	'PO:0006015',	3,	'female archesporial cell',	'\"An archesporial cell (PO:0030056) that is part of a megasporangium (PO:0025201) and divides to give rise to a megasporocyte (PO:0000431).\" [PMID:10465788, POC:curators]',	NULL,	0),
(3796,	'PO:0006016',	3,	'leaf epidermis',	'\"A portion of phyllome epidermis (PO:0025157) that is part of a leaf (PO:0025034).\" [POC:curators]',	NULL,	0),
