(4221,	'PO:0009013',	3,	'portion of meristem tissue',	'\"A portion of plant tissue (PO:0009007) in which plant cells (PO:0009002) have retained their embryonic characteristics, or have reverted to them secondarily, and that divide to produce new cells that can undergo differentiation to form mature tissues, i.e. they have a capacity for morphogenesis and growth.\" [APweb:Glossary, Gramene:Pankaj_Jaiswal]',	NULL,	0),
(4222,	'PO:0009014',	3,	'dermal tissue',	'\"OBSOLETE. A portion of plant tissue that covers the surface of the plant.\" [Gramene:Pankaj_Jaiswal, ISBN:0122151704]',	NULL,	1),
(4223,	'PO:0009015',	3,	'portion of vascular tissue',	'\"A portion of plant tissue (PO:0009007) that has as part one or more tracheary elements (PO:0000290) or sieve elements (PO:0025406).\" [POC:curators]',	NULL,	0),
(4224,	'PO:0009016',	3,	'ground tissue',	'\"OBSOLETE. Tissues other than the vascular tissues, epidermis and the periderm.\" [Gramene:Pankaj_Jaiswal]',	NULL,	1),
(4225,	'PO:0009017',	3,	'inflorescence branch pulvinus',	'\"A pulvinus (PO:0009000) of an inflorescence branch (PO:0009081).\" [Gramene:Chih-Wei_Tung, POC:Laurel_Cooper]',	NULL,	0),
(4226,	'PO:0009018',	3,	'basal endosperm transfer cell',	'\"A transfer cell that is part of a basal endosperm transfer layer.\" [POC:Ramona_Walls]',	NULL,	0),
(4227,	'PO:0009019',	3,	'obsolete basal endosperm transfer layer',	'\"OBSOLETE. A cell layer found in basal endosperm transfer cell.\" [Gramene:Chih-Wei_Tung]',	NULL,	1),
(4228,	'PO:0009020',	3,	'meristem L1 layer',	'\"A portion of meristem tissue (PO:0009013) that is the outermost layer of a shoot apical meristem (PO:0020148) and gives rise to a shoot system epidermis (PO:0006035).\" [Gramene:Pankaj_Jaiswal, PMID:11283725, PMID:12221985, POC:Laurel_Cooper]',	NULL,	0),
(4229,	'PO:0009021',	3,	'meristem L2 layer',	'\"A portion of meristem tissue (PO:0009013) directly beneath a meristem L1 layer (PO:0009020) in a shoot apical meristem (PO:0020148) which gives rise to ground tissue (PO:0025059).\" [Gramene:Pankaj_Jaiswal, PMID:11283725, PMID:12221985, POC:Laurel_Cooper]',	NULL,	0),
(4230,	'PO:0009022',	3,	'meristem L3 layer',	'\"A portion of meristem tissue (PO:0009013) beneath a meristem L2 layer (PO:0009021) in a shoot apical meristem (PO:0020148) which gives rise to internal tissues of leaf and stem.\" [Gramene:Pankaj_Jaiswal, PMID:11283725, PMID:12221985, POC:Laurel_Cooper]',	NULL,	0),
(4231,	'PO:0009023',	3,	'leaf axil',	'\"An axil that is the space between a shoot axis and a leaf that branches from the shoot axis.\" [POC:Ramona_Walls]',	NULL,	0),
(4232,	'PO:0009025',	3,	'vascular leaf',	'\"A leaf (PO:0025034) in a vascular plant.\" [POC:curators]',	NULL,	0),
(4233,	'PO:0009026',	3,	'sporophyll',	'\"A leaf-like organ on which one or more sporangia are borne.\" [APweb:Glossary]',	NULL,	0),
(4234,	'PO:0009027',	3,	'megasporophyll',	'\"A structure upon which (or in the axil of which) one or more megasporangia are borne; in flowering plants, a carpel.\" [APweb:Glossary]',	NULL,	0),
(4235,	'PO:0009028',	3,	'microsporophyll',	'\"A structure on which one or more microsporangia are borne; in flowering plants, the stamen.\" [APweb:Glossary]',	NULL,	0),
(4236,	'PO:0009029',	3,	'stamen',	'\"A microsporophyll bearing one or more microsporangia.\" [APweb:Glossary]',	NULL,	0),
(4237,	'PO:0009030',	3,	'carpel',	'\"A megasporophyll, almost always at the center of a flower, its margins more or less fused together or with other carpels to enclose the ovule(s).\" [APweb:Glossary]',	NULL,	0),
(4238,	'PO:0009031',	3,	'sepal',	'\"A phyllome (PO:0006001) that is usually green, and is part of the calyx (PO:0009060).\" [APweb:Glossary]',	NULL,	0),
(4239,	'PO:0009032',	3,	'petal',	'\"A phyllome (PO:0006001) that is part of the corolla (PO:0009059), and is usually colored (not green).\" [APweb:Glossary, POC:curators]',	NULL,	0),
(4240,	'PO:0009033',	3,	'tepal',	'\"A phyllome (PO:0006001) that is part of a perianth (PO:0009058) where it is not possible to distinguish between the petals (PO:0009032) and sepals (PO:0009031).\" [POC:curators]',	NULL,	0),
(4241,	'PO:0009034',	3,	'flower bract',	'\"A bract (PO:0009055) that subtends a perianth (PO:0009058) that is part of a flower (PO:0009046).\" [POC:curators]',	NULL,	0),
(4242,	'PO:0009035',	3,	'nectary',	'\"A portion of secretory tissue (PO:0005656) which is a multicellular glandular structure secreting a liquid containing organic substances, including sugars.\" [Gramene:Pankaj_Jaiswal, ISBN:0471245208, POC:Laurel_Cooper]',	NULL,	0),
(4243,	'PO:0009036',	3,	'lodicule',	'\"A phyllome that is part of a grass floret and is one of two or three tiny scales or flaps of tissue outside the stamens.\" [POC:curators]',	NULL,	0),
(4244,	'PO:0009037',	3,	'lemma',	'\"The lower, usually larger, of the pair of flower bracts (PO:0009034) enclosing a (PO:0009082) spikelet floret.\" [APweb:Glossary, POC:curators, POC:Laurel_Cooper]',	NULL,	0),
(4245,	'PO:0009038',	3,	'palea',	'\"The upper (distal), usually smaller, of the pair of flower bracts (PO:0009034) enclosing a (PO:0009082) spikelet floret.\" [APweb:Glossary, POC:curators, POC:Laurel_Cooper]',	NULL,	0),
(4246,	'PO:0009039',	3,	'glume',	'\"One of a pair of inflorescence bracts that is part of a spikelet and subtends the two florets.\" [POC:Ramona_Walls]',	NULL,	0),
(4247,	'PO:0009040',	3,	'sterile lemma',	'\"A flower bract in the position of a lemma, but not enclosing floral organs.\" [UMSL_curator:tk]',	NULL,	0),
(4248,	'PO:0009041',	3,	'fertile lemma',	'\"A lemma that encloses a functional flower, with androecium, gynoecium or both.\" [UMSL_curator:tk]',	NULL,	0),
(4249,	'PO:0009042',	3,	'prophyll',	'\"A phyllome that is the first organ or one of the first two organs formed at the base of an axillary shoot, often smaller and/or in a distinctively different position from leaves formed subsequently.\" [POC:curators]',	NULL,	0),
(4250,	'PO:0009043',	3,	'bracteole',	'\"A prophyll (PO:0009042) which is borne singly or in pairs on a pedicel (PO:0030112).\" [APweb:Glossary, POC:Laurel_Cooper]',	NULL,	0),
(4251,	'PO:0009044',	3,	'perigynium',	'\"Sac-like bract subtending the pistillate flower, as in <i>Carex</i>.\" [Gramene:Pankaj_Jaiswal]',	NULL,	0),
(4252,	'PO:0009045',	3,	'involucral bract',	'\"An inflorescence bract (PO:0009054) of an involucre (PO:0009100).\" [] {comment=\"POC:Laurel_Cooper\"}',	NULL,	0),
(4253,	'PO:0009046',	3,	'flower',	'\"A determinate reproductive shoot system (PO:0025082) that has as part at least one carpel (PO:0009030) or at least one stamen (PO:0009029) and does not contain any other determinate shoot system (PO:0009006) as a part.\" [POC:curators]',	NULL,	0),
(4254,	'PO:0009047',	3,	'stem',	'\"A shoot axis (PO:0025029) that is the primary axis of a plant.\" [POC:curators]',	NULL,	0),
(4255,	'PO:0009049',	3,	'inflorescence',	'\"A reproductive shoot system (PO:0025082) that has as parts all of the shoot axes (PO:0025029) and flowers (PO:0009046; must have two or more) distal to the most distal leaf (PO:0009025).\" [NYBG:Brandon_Sinn, NYBG:Dario_Cavaliere, POC:Laurel_Cooper, POC:Ramona_Walls]',	NULL,	0),
(4256,	'PO:0009051',	3,	'spikelet',	'\"A reproductive shoot system (PO:0025082) that is the ultimate and congested, higher order inflorescence axis (PO:0009081) of the grasses.\" [APweb:Glossary, PO:cooperl]',	NULL,	0),
(4257,	'PO:0009052',	3,	'inflorescence flower pedicel',	'\"A flower pedicel (PO:0030113) that bears a flower (PO:0009046) in an inflorescence (PO:0009049).\" [ISBN:0716710072, NYBG:Brandon_Sinn, NYBG:Dario_Cavaliere, POC:Laurel_Cooper]',	NULL,	0),
(4258,	'PO:0009053',	3,	'peduncle',	'\"A shoot axis that extends from the last foliage leaf on a stem or branch until the next distal node.\" [ISBN:9781842464229, POC:curators]',	NULL,	0),
(4259,	'PO:0009054',	3,	'inflorescence bract',	'\"A bract (PO:0009055) subtending a branch of the inflorescence (PO:0009049) or borne on the inflorescence axis (PO:0020122) below any branch (PO:0025073) or flower (PO:0009046).\" [APweb:Glossary]',	NULL,	0),
(4260,	'PO:0009055',	3,	'bract',	'\"A phyllome that subtends a reproductive structure.\" [POC:curators]',	NULL,	0),
(4261,	'PO:0009056',	3,	'flower nectary',	'\"A nectary (PO:0009035) occurring on a floral organ (PO:0025395) or other part of a flower (PO:0009046).\" [ISBN:0471245208, POC:Laurel_Cooper]',	NULL,	0),
(4262,	'PO:0009057',	3,	'extrafloral nectary',	'\"A nectary (PO:0009035), not occurring on a floral organ (PO:0025395) or other part of a flower (PO:0009046).\" [ISBN:0471245208, POC:Laurel_Cooper]',	NULL,	0),
(4263,	'PO:0009058',	3,	'perianth',	'\"A collective phyllome structure (PO:0025023) that includes as parts the corolla (PO:0009059) and/or the calyx (PO:0009060); or one or more tepals (PO:0009033).\" [POC:curators, POC:Laurel_Cooper]',	NULL,	0),
(4264,	'PO:0009059',	3,	'corolla',	'\"A collective phyllome structure (PO:0025023) that is composed of one or more petals (PO:0009032), comprising the inner whorl of non-reproductive floral organs (PO:0025395) and surrounds the androecium (PO:0009061) and the gynoecium (PO:0009062).\" [POC:curators, POC:Laurel_Cooper]',	NULL,	0),
(4265,	'PO:0009060',	3,	'calyx',	'\"A collective phyllome structure (PO:0025023) that is composed of one or more sepals (PO:0009031), and comprises the outer whorl of non-reproductive floral organs (PO:0025395).\" [POC:curators, POC:Laurel_Cooper]',	NULL,	0),
(4266,	'PO:0009061',	3,	'androecium',	'\"A collective phyllome structure (PO:0025023) composed all of the stamens (PO:0009029) in a flower (PO:0009046).\" [POC:curators]',	NULL,	0),
(4267,	'PO:0009062',	3,	'gynoecium',	'\"A collective phyllome structure (PO:0025023) composed all of the carpels (PO:0009030) in a flower (PO:0009046).\" [POC:curators]',	NULL,	0),
(4268,	'PO:0009063',	3,	'epicalyx',	'\"A collective phyllome structure (PO:0025023) composed of two or more phyllomes immediately outside the calyx (PO:0009060).\" [POC:curators]',	NULL,	0),
