(4271,	'PO:0009066',	3,	'anther',	'\"A collective plant organ structure (PO:0025007) that is the pollen-bearing part of a stamen (PO:0009029).\" [APweb:Glossary]',	NULL,	0),
(4272,	'PO:0009067',	3,	'filament',	'\"A stalk  (PO:0025066) that is part of a stamen (PO:0009029).\" [Gramene:Pankaj_Jaiswal, MaizeGDB_curator:Leszek_Vincent]',	NULL,	0),
(4273,	'PO:0009068',	3,	'connective',	'\"The part of the stamen that connects the microsporangia/pollen sacs.\" [APweb:Glossary]',	NULL,	0),
(4274,	'PO:0009069',	3,	'anther theca',	'\"A collective plant organ structure (PO:0025007) that is part of an anther (PO:0009066) and consists of a pair of sporangia (PO:0025094) that dehisce down a common slit.\" [APweb:Glossary]',	NULL,	0),
(4275,	'PO:0009070',	3,	'obsolete pollen sac',	'\"OBSOLETE. A microsporangium in an angiosperm that is a cavity in an anther that contains pollen grains.\" [ISBN:0716710072]',	NULL,	1),
(4276,	'PO:0009071',	3,	'anther wall tapetum',	'\"A microsporangium tapetum (PO:0025314) that is part of an anther wall (PO:0000002).\" [ISBN:0471244554, ISBN:9780003686647]',	NULL,	0),
(4277,	'PO:0009072',	3,	'plant ovary',	'\"A plant structure (PO:0009011) that is the basal portion of a carpel (PO:0009030) or group of fused carpels (gynoecium; PO:0009062) and encloses the plant ovule(s) (PO:0020003).\" [APweb:Glossary, TAIR_curator:Leonore_Reiser]',	NULL,	0),
(4278,	'PO:0009073',	3,	'stigma',	'\"A cardinal organ part (PO:0025001), usually apical, that is part of a carpel (PO:0009030) or group of fused carpels on which the pollen (PO:0025281) germinates.\" [APweb:Glossary, POC:Laurel_Cooper, TAIR_curator:Leonore_Reiser]',	NULL,	0),
(4279,	'PO:0009074',	3,	'style',	'\"A cardinal organ part (PO:0025001) which is an elongated part of a carpel (PO:0009030) or gynoecium (PO:0009062) between the plant ovary (PO:0009072) and the stigma (PO:0009073), and through which the pollen tube (GO:0090406) grows.\" [APweb:Glossary, POC:Laurel_Cooper, TAIR_curator:Leonore_Reiser]',	NULL,	0),
(4280,	'PO:0009075',	3,	'plant ontology',	'\"OBSOLETE. A controlled vocabulary to describe the various plant parts and the growth and developmental stages.\" [Poc:curators]',	NULL,	1),
