(4284,	'PO:0009081',	3,	'higher order inflorescence axis',	'\"An inflorescence axis (PO:0020122) that develops from an inflorescence axillary meristem (PO:0009105) of an inflorescence axis (PO:0020122).\" [NYBG:Brandon_Sinn, NYBG:Dario_Cavaliere, POC:Laurel_Cooper]',	NULL,	0),
(4285,	'PO:0009082',	3,	'spikelet floret',	'\"A small flower (PO:0009046) that is part of a spikelet (PO:0009051).\" [PMID:20197291, POC:curators]',	NULL,	0),
