(4287,	'PO:0009084',	3,	'pericarp',	'\"A portion of plant tissue (PO:0009007) that is the outer layer (wall) of a fruit (PO:0009001), and develops from a plant ovary (PO:0009072) or a carpel (PO:0009030) wall.\" [APweb:Glossary, Gramene:Pankaj_Jaiswal, TAIR_curator:Leonore_Reiser]',	NULL,	0),
(4288,	'PO:0009085',	3,	'exocarp',	'\"A portion of plant tissue (PO:0009007) that is the outer layer of a pericarp (PO:0009084).\" [Gramene:Pankaj_Jaiswal]',	NULL,	0),
(4289,	'PO:0009086',	3,	'endocarp',	'\"A portion of plant tissue (PO:0009007) that is the innermost differentiated layer of a pericarp (PO:0009084).\" [Gramene:Pankaj_Jaiswal]',	NULL,	0),
(4290,	'PO:0009087',	3,	'mesocarp',	'\"A portion of plant tissue (PO:0009007) that is the middle layer of a pericarp (PO:0009084).\" [Gramene:Pankaj_Jaiswal]',	NULL,	0),
(4291,	'PO:0009088',	3,	'seed coat',	'\"A portion of plant tissue that is the covering of a seed derived from ovular - mainly integumentary - tissue.\" [APweb:Glossary, Gramene:Pankaj_Jaiswal, TAIR_curator:Leonore_Reiser]',	NULL,	0),
(4292,	'PO:0009089',	3,	'endosperm',	'\"A portion of plant tissue (PO:0009007) which is a maximal portion of nutritive plant tissue in a seed (PO:0009010).\" [APweb:Glossary, Gramene:Pankaj_Jaiswal]',	NULL,	0),
(4293,	'PO:0009090',	3,	'aril',	'\"An arilloid that is an outgrowth of a seed from a seed funicle.\" [ISBN:9780881928501]',	NULL,	0),
