(4295,	'PO:0009100',	3,	'involucre',	'\"A collective phyllome structure composed of two or more involucral bracts at the base of a cluster of flowers, as found in Asteraceae or Compositae.\" [POC:curators]',	NULL,	0),
(4296,	'PO:0009101',	3,	'long lateral tassel branch',	'\"The long branch that arise from the central spike of tassel in maize.\" [Gramene:Pankaj_Jaiswal, MaizeGDB_curator:Leszek_Vincent]',	NULL,	0),
(4297,	'PO:0009102',	3,	'short tassel branch',	'\"The very short branch that may arise from either or both the long lateral branch and the central spike of tassel in maize.\" [Gramene:Pankaj_Jaiswal, MaizeGDB_curator:Leszek_Vincent]',	NULL,	0),
(4298,	'PO:0009103',	3,	'short tassel branch meristem',	'\"The meristem present on either or both the long lateral branch and central spike of a maize tassel that gives rise to short tassel branch.\" [Gramene:Pankaj_Jaiswal, MaizeGDB_curator:Leszek_Vincent]',	NULL,	0),
(4299,	'PO:0009104',	3,	'long lateral tassel branch meristem',	'\"The meristem that gives rise to the long lateral branch in the maize tassel.\" [MaizeGDB_curator:Leszek_Vincent]',	NULL,	0),
(4300,	'PO:0009105',	3,	'inflorescence axillary meristem',	'\"An inflorescence meristem (PO:0009108) that gives rise to a higher order inflorescence axis (PO:0009081).\" [MaizeGDB_curator:Leszek_Vincent, NYBG:Brandon_Sinn, NYBG:Dario_Cavaliere, POC:curators, POC:Laurel_Cooper]',	NULL,	0),
(4301,	'PO:0009106',	3,	'tassel meristem',	'\"Meristem that gives rise to the apical and lateral structures of the tassel inflorescence in maize.\" [Gramene:Pankaj_Jaiswal]',	NULL,	0),
(4302,	'PO:0009107',	3,	'tassel inflorescence axillary meristem',	'\"An inflorescence axillary meristem (PO:0009105) that gives rise to the long lateral tassel branch (PO:0009101), short tassel branch (PO:0009102), and tassel spikelets (PO:0006309) in a tassel inflorescence (PO:0020126).\" [MaizeGDB_curator:Leszek_Vincent, NYBG:Brandon_Sinn, NYBG:Dario_Cavaliere, POC:Ramona_Walls]',	NULL,	0),
(4303,	'PO:0009108',	3,	'inflorescence apical meristem',	'\"A reproductive shoot apical meristem that gives rise to the apical growth of the inflorescence. It develops from the shoot apical meristem (SAM) after it undergoes transition from vegetative to reproductive phase.\" [Gramene:Pankaj_Jaiswal, MaizeGDB_curator:Leszek_Vincent]',	NULL,	0),
(4304,	'PO:0009109',	3,	'ear meristem',	'\"The meristem which gives rise to the female inflorescence or ear in maize.\" [MaizeGDB_curator:Leszek_Vincent]',	NULL,	0),
(4305,	'PO:0009110',	3,	'ear inflorescence axillary meristem',	'\"An inflorescence axillary meristem (PO:0009105) that gives rise to a higher order inflorescence axis (PO:0009081) of an ear inflorescence (PO:0020136).\" [Gramene:Pankaj_Jaiswal, NYBG:Brandon_Sinn, NYBG:Dario_Cavaliere, POC:Laurel_Cooper, POC:Ramona_Walls]',	NULL,	0),
(4306,	'PO:0009111',	3,	'petiole pulvinus',	'\"Pulvinus of the petiole.\" [Gramene:Chih-Wei_Tung]',	NULL,	0),
