(4308,	'PO:0019022',	3,	'arilloid',	'\"A cardinal part of multi-tissue plant structure (PO:0025498) that is a fleshy outgrowth of a seed (PO:0009010).\" [ISBN:9780881928501]',	NULL,	0),
(4309,	'PO:0019023',	3,	'strophiole',	'\"An arilloid that is an outgrowth of a seed on a raphe.\" [ISBN:9780881928501]',	NULL,	0),
