(4311,	'PO:0019026',	3,	'tracheid bar',	'\"A portion of xylem (PO:0005352) tissue that is a distinct ring-like structure composed of tracheids (PO:0000301), that is part of a seed (PO:0009010) and surrounds the hilum (PO:0020063) and forms a groove in the surface of the pericarp (PO:0009084) immediately adjacent to the hilum.\" [ISBN:0080280293]',	NULL,	0),
(4312,	'PO:0020001',	3,	'plant ovary placenta',	'\"A portion of placenta tissue (PO:0025078) which is part of a plant ovary (PO:0009072), and to which plant ovary ovules (PO:0025490) are attached.\" [APweb:Glossary]',	NULL,	0),
(4313,	'PO:0020002',	3,	'anther wall endothecium',	'\"An microsporangium endothecium (PO:0025309) that part of an anther wall (PO:0000002).\" [ISBN:9780003686647]',	NULL,	0),
(4314,	'PO:0020003',	3,	'plant ovule',	'\"A plant organ (PO:0009008) that has as parts a nucellus (PO:0020020) in which a female gametophyte (PO:0025279) is located, one or two integuments (PO:0020021), and a funicle (PO:0020006).\" [POC:curators]',	NULL,	0),
(4315,	'PO:0020004',	3,	'anther wall exothecium',	'\"An microsporangium exothecium that is part of an anther wall.\" [ISBN:0471244554, ISBN:9780003686647]',	NULL,	0),
(4316,	'PO:0020005',	3,	'placentoid',	'\"A portion of parenchyma tissue that is part of a connective and projects into a pollen sac.\" [ISBN:9780470752685]',	NULL,	0),
(4317,	'PO:0020006',	3,	'funicle',	'\"A stalk (PO:0025066) that attaches a plant ovule (PO:0020003) to a placenta (PO:0025078).\" [APweb:Glossary, Gramene:Pankaj_Jaiswal]',	NULL,	0),
(4318,	'PO:0020008',	3,	'exine',	'\"OBSOLETE. The outer layer of the pollen grain wall, highly resistant to strong acids and bases, and composed primarily of sporopollenin.\" [APweb:Glossary]',	NULL,	1),
(4319,	'PO:0020009',	3,	'ectexine',	'\"OBSOLETE. The outer part of the exine, which stains positively with basic fuchsin in optical microscopy and has higher electron density in conventionally prepared TEM sections.\" [APweb:Glossary]',	NULL,	1),
(4320,	'PO:0020010',	3,	'endexine',	'\"OBSOLETE. The inner part of the exine, which stains.\" [APweb:Glossary]',	NULL,	1),
(4321,	'PO:0020011',	3,	'nexine',	'\"OBSOLETE. The inner, non-sculptured part of the exine which lies below the sexine.\" [APweb:Glossary]',	NULL,	1),
(4322,	'PO:0020012',	3,	'sexine',	'\"OBSOLETE. The outer, sculptured layer of the exine, which lies above the nexine.\" [APweb:Glossary]',	NULL,	1),
(4323,	'PO:0020013',	3,	'tectum',	'\"OBSOLETE. The layer of sexine, which forms a roof over the columellae, granules or other infratectal elements.\" [APweb:Glossary]',	NULL,	1),
(4324,	'PO:0020014',	3,	'pollen wall columella',	'\"OBSOLETE. A rod-like element of the sexine/ectexine, either supporting the tectum or a caput.\" [APweb:Glossary]',	NULL,	1),
(4325,	'PO:0020015',	3,	'sculpture elements',	'\"OBSOLETE. Third layer of sexine.\" [APweb:Glossary]',	NULL,	1),
(4326,	'PO:0020016',	3,	'foot layer',	'\"OBSOLETE. The inner layer of the ectexine.\" [APweb:Glossary]',	NULL,	1),
(4327,	'PO:0020017',	3,	'intine',	'\"OBSOLETE. The innermost of the major layers of the pollen grain wall, underlies the exine and borders the cytoplasm, not acetolysis resistant and is therefore absent in conventionally prepared palynological material.\" [APweb:Glossary]',	NULL,	1),
(4328,	'PO:0020018',	3,	'germination pore',	'\"OBSOLETE. Area through which the pollen imports the nutrition during its development, at the time of pollen germination, the pollen tube emerges through it.\" [Gramene:Pankaj_Jaiswal]',	NULL,	1),
(4329,	'PO:0020019',	3,	'megaspore',	'\"The larger, in general, of the two kinds of spores produced after meiosis in the life cycle of a heterosporous plant, and on germination giving rise to the female gametophyte (embryo sac).\" [APweb:Glossary]',	NULL,	0),
(4330,	'PO:0020020',	3,	'nucellus',	'\"A megasporangium (PO:0025201) in a seed plant, composed of fleshy subepidermal tissue that is part of a plant ovule (PO:0020003) and surrounds a megasporocyte (PO:0000431).\" [POC:curators]',	NULL,	0),
(4331,	'PO:0020021',	3,	'integument',	'\"A portion of plant tissue (PO:0009007) that usually covers a plant ovule (PO:0020003), enveloping a nucellus (PO:0020020) and forming a micropyle (PO:0020025) at the apex.\" [APweb:Glossary]',	NULL,	0),
(4332,	'PO:0020022',	3,	'inner integument',	'\"An integument (PO:0020021) which is the innermost of the two layers of tissue that usually cover the ovule, contiguous to the nucellus and usually contributing to the formation of the micropyle at the apex.\" [APweb:Glossary]',	NULL,	0),
(4333,	'PO:0020023',	3,	'outer integument',	'\"An integument (PO:0020021) which is one of the two layers of tissue that usually cover the ovule, contiguous to the inner integument and usually involved in forming the micropyle at the apex.\" [APweb:Glossary]',	NULL,	0),
(4334,	'PO:0020024',	3,	'endothelium',	'\"A portion of plant tissue (PO:0009007) which is composed of cells of the inner epidermis of the inner (or only) integument of the ovule that are radially elongated and metabolically very active.\" [APweb:Glossary]',	NULL,	0),
(4335,	'PO:0020025',	3,	'plant ovule micropyle',	'\"A plant anatomical space (PO:0025117) that is enclosed by and forms an opening in an integument at the apex of a plant ovule (PO:0020003).\" [POC:curators]',	NULL,	0),
(4336,	'PO:0020026',	3,	'chalaza',	'\"A portion of plant tissue (PO:0009007) that is the region in a plant ovule (PO:0020003) where the integuments (PO:0020021) and the nucellus (PO:0020020) join with the funicule (PO:0020006).\" [ISBN:0471245208]',	NULL,	0),
(4337,	'PO:0020027',	3,	'raphe',	'\"A cardinal organ part (PO:0025001) that is a ridge on a plant ovule (PO:0020003) where a funicle (PO:0020006) is or was fused to the ovule.\" [ISBN:0471245208, POC:curators]',	NULL,	0),
(4338,	'PO:0020028',	3,	'antiraphe',	'\"A cardinal organ part (PO:0025001) that is the part of a plant ovule (PO:0020003) on the opposite side from a raphe (PO:0020027).\" [POC:curators]',	NULL,	0),
(4339,	'PO:0020029',	3,	'obturator',	'\"A portion of plant tissue (PO:0009007) which is an outgrowth of the funicle, that forms a bridge between the micropyle and other tissues.\" [APweb:Glossary]',	NULL,	0),
(4340,	'PO:0020030',	3,	'cotyledon',	'\"A vascular leaf (PO:0009025) formed at the first shoot node (PO:0005004) of a plant embryo (PO:0009009) or a seedling (PO:0000003).\" [Gramene:Pankaj_Jaiswal, ISBN:9780879015329, POC:curators]',	NULL,	0),
(4341,	'PO:0020031',	3,	'radicle',	'\"An embryo root (PO:0000045) that is the basal continuation of a hypocotyl (PO:0020100) in a plant embryo (PO:0009009) or a seedling (PO:0000003).\" [ISBN:0471245208]',	NULL,	0),
(4342,	'PO:0020032',	3,	'plumule',	'\"The shoot apex (PO:0000037) of the plant embryo (PO:0009009), above the cotyledonary node (PO:0025321).\" [POC:curators]',	NULL,	0),
(4343,	'PO:0020033',	3,	'coleoptile',	'\"A sheath-like plant organ (PO:0009008) that surrounds the plumule (PO:0020032) of a plant embryo (PO:0009009) or the emerging shoot apex (PO:0000037) of a seedling.\" [ISBN:0471244554, ISBN:9781842464229]',	NULL,	0),
(4344,	'PO:0020034',	3,	'coleorhiza',	'\"A sheath-like plant organ (PO:0009008) that surrounds the radicle (PO:0020031) of a plant embryo (PO:0009009) or the emerging root (PO:0009005) of a seedling (PO:0000003).\" [ISBN:0471244554, PMID:19386806, PO_REF:00003]',	NULL,	0),
(4345,	'PO:0020035',	3,	'epicotyl',	'\"The first stem internode (PO:0020142) above the cotyledonary node (PO:0025321) of a plant embryo (PO:0009009) or a seedling (PO:0000003).\" [ISBN:0471244554]',	NULL,	0),
(4346,	'PO:0020036',	3,	'epiblast',	'\"A portion of plant tissue (PO:0009007) that is a flap-like projection of the coleorhiza (PO:0020034), inserted opposite the scutellum (PO:0020110).\" [ISBN:0471244554]',	NULL,	0),
(4347,	'PO:0020037',	3,	'mesocotyl',	'\"A stem internode (PO:0020142) that is the part of a plant embryo axis (PO:0019018) or a seedling stem (PO:0009047) above the scutellum (PO:0020110) and below the coleoptile (PO:0020033).\" [ISBN:0471244554, POC:Laurel_Cooper]',	NULL,	0),
(4348,	'PO:0020038',	3,	'petiole',	'\"A stalk (PO:0025066) of a vascular leaf (PO:0009025).\" [APweb:Glossary, Gramene:Pankaj_Jaiswal]',	NULL,	0),
(4349,	'PO:0020039',	3,	'leaf lamina',	'\"A phyllome lamina (PO:0025396) that is the part of a leaf (PO:0025034) exclusive of the petiole (PO:0020038) or leaf sheath (PO:0020104), if either is present.\" [POC:curators]',	NULL,	0),
(4350,	'PO:0020040',	3,	'leaf base',	'\"A phyllome base (PO:0025140) that is part of a leaf (PO:0025034).\" [POC:Ramona_Walls]',	NULL,	0),
(4351,	'PO:0020041',	3,	'stipule',	'\"A cardinal organ part that is an appendage at the base of a vascular leaf.\" [POC:curators]',	NULL,	0),
(4352,	'PO:0020042',	3,	'simple leaf',	'\"A leaf in which the lamina is undivided.\" [Poc:curators]',	NULL,	0),
(4353,	'PO:0020043',	3,	'compound leaf',	'\"A leaf having two or more distinct leaflets that are evident as such from early in development.\" [APweb:Glossary]',	NULL,	0),
(4354,	'PO:0020044',	3,	'hyperphyll',	'\"The unifacial terete apical portion of a monocot cotyledon, sometimes also visible on other leaves.\" [APweb:Glossary]',	NULL,	0),
(4355,	'PO:0020045',	3,	'pinnate leaf',	'\"A once-compound leaf with leaflets borne along a rachis.\" [APweb:Glossary]',	NULL,	0),
(4356,	'PO:0020046',	3,	'palmate leaf',	'\"A once-compound leaf divided into several leaflets which arise at the same point, there being no rachis.\" [APweb:Glossary]',	NULL,	0),
(4357,	'PO:0020047',	3,	'microsporocyte',	'\"A sporocyte (PO:0006204) that produces four haploid (1n) microspores (PO:0020048).\" [ISBN:0878934030, POC:Laurel_Cooper]',	NULL,	0),
(4358,	'PO:0020048',	3,	'microspore',	'\"The smaller, in general, of the two kinds of spores produced after meiosis in the life cycle of a heterosporous plant, and on germination giving rise to the male gametophyte.\" [APweb:Glossary]',	NULL,	0),
(4359,	'PO:0020049',	3,	'leaflet',	'\"A cardinal organ part (PO:0025001) that is one of the ultimate segments of a compound leaf (PO:0020043).\" [APweb:Glossary, POC:laurel_cooper]',	NULL,	0),
(4360,	'PO:0020050',	3,	'petiolule',	'\"A stalk (PO:0009025) of a leaflet (PO:0020049).\" [APweb:Glossary]',	NULL,	0),
(4361,	'PO:0020051',	3,	'stipel',	'\"Stipule-like appendage(s) at the base of a leaflet (in unifoliolate or simple leaves, found at the top of the petiole).\" [APweb:Glossary]',	NULL,	0),
(4362,	'PO:0020052',	3,	'megaphyll',	'\"OBSOLETE. Literally a large leaf, a leaf of any size whose vascular supply leaves one or more gaps as it departs from the stem vascular tissue.\" [APweb:Glossary]',	NULL,	1),
(4363,	'PO:0020053',	3,	'microphyll',	'\"OBSOLETE. Literally a small leaf, a leaf of any size in which any vascular trace supplying it does not interrupt the central vascular cylinder when it departs, i.e. there are no leaf gaps.\" [APweb:Glossary]',	NULL,	1),
(4364,	'PO:0020054',	3,	'bud scale leaf',	'\"A scale leaf that surrounds a dormant or perennating bud.\" [UMSL_curator:tk]',	NULL,	0),
(4365,	'PO:0020055',	3,	'leaf rachis',	'\"A stalk (PO:0025066) that is the main axis of a pinnate or more highly compound leaf, that bears leaflets or divisions of the axis.\" [APweb:Glossary]',	NULL,	0),
(4366,	'PO:0020056',	3,	'tegmen',	'\"That part of the seed coat that develops from the inner integument.\" [APweb:Glossary, ISBN:0080374913]',	NULL,	0),
(4367,	'PO:0020057',	3,	'testa',	'\"That part of the seed coat that develops from the outer integument, or from the single integument when there is only one.\" [APweb:Glossary, ISBN:0080374913]',	NULL,	0),
(4368,	'PO:0020058',	3,	'perisperm',	'\"A portion of plant tissue (PO:0009007) which is diploid nutritive tissue in an angiosperm seed derived from nucellar tissue.\" [APweb:Glossary]',	NULL,	0),
(4369,	'PO:0020059',	3,	'pollen wall',	'\"OBSOLETE. Complex wall surrounding the micrsopore.\" [UMSL_curator:fz]',	NULL,	1),
(4370,	'PO:0020060',	3,	'caruncle',	'\"An arilloid that is an outgrowth of a seed next to the micropyle.\" [ISBN:9780881928501]',	NULL,	0),
(4371,	'PO:0020061',	3,	'coma',	'\"A portion of seed coat epidermis (PO:0006048) that consists of multiple seed trichomes (PO:0004511) at the seed micropyle (PO:0006334).\" [POC:curators]',	NULL,	0),
(4372,	'PO:0020062',	3,	'elaiosome',	'\"A cardinal organ part that is an oil-secreting outgrowth of a seed or fruit.\" [ISBN:9780881928501]',	NULL,	0),
(4373,	'PO:0020063',	3,	'hilum',	'\"A cardinal part of multi-tissue plant structure (PO:0025498) that is a scar on a seed (PO:0009010) at the place where it was attached to a funicle (PO:0020006).\" [POC:curators]',	NULL,	0),
(4374,	'PO:0020064',	3,	'dehiscent fruit',	'\"OBSOLETE. Fruit that breaks open at maturity to release the contents.\" [APweb:Glossary]',	NULL,	1),
(4375,	'PO:0020065',	3,	'indehiscent fruit',	'\"OBSOLETE. Fruit that does not open at maturity.\" [APweb:Glossary]',	NULL,	1),
(4376,	'PO:0020066',	3,	'fleshy fruit',	'\"OBSOLETE. The fruit may be derived from monocarpellate or multicarpellate gynoecia. Their walls may consist of the pericarp or of pericarp fused with extracarpellary tissue. The outer part of the fruit wall or the entire fruit wall may become fleshy by differentiating into soft, succulent parenchyma. Parts other than the wall such as placentae and partitions in multilocular ovaries may become fleshy.\" [ISBN:0471245208]',	NULL,	1),
(4377,	'PO:0020075',	3,	'mericarp',	'\"A cardinal part of multi-tissue plant structure (PO:0025498) which is one carpellate unit of a schizocarp fruit (PO:0030098) consisting of pericarp (PO:0009084) and one or more seeds (PO:0009010).\" [NYBG:Brandon_Sinn, NYBG:Dario_Cavaliere, POC:Laurel_Cooper]',	NULL,	0),
(4378,	'PO:0020081',	3,	'seed as dispersal unit',	'\"OBSOLETE.\" [Poc:curators]',	NULL,	1),
(4379,	'PO:0020084',	3,	'pyrene',	'\"OBSOLETE. The \'stone\' or \'pit\' (endocarp plus seed) of a succulent fruit.\" [APweb:Glossary]',	NULL,	1),
(4380,	'PO:0020085',	3,	'seed and fruit wall as dispersal unit',	'\"OBSOLETE.\" [Poc:curators]',	NULL,	1),
(4381,	'PO:0020086',	3,	'multiple fruit',	'\"OBSOLETE. Fruit on a common axis derived from the ovaries of several flowers.\" [APweb:Glossary]',	NULL,	1),
(4382,	'PO:0020090',	3,	'embryo sac central cell',	'\"An embryo sac cell (PO:0025026) that is largest cell in a mature embryo sac (PO:0025074).\" [PMID:17041880, TAIR_curator:Katica_Ilic]',	NULL,	0),
(4383,	'PO:0020091',	3,	'obsolete microgametophyte',	'\"OBSOLETE. A gametophyte that produces pollen sperm cells.\" [POC:curators]',	NULL,	1),
(4384,	'PO:0020092',	3,	'obsolete megagametophyte',	'\"OBSOLETE. A gametophyte that produces female gametes.\" [APweb:Glossary]',	NULL,	1),
(4385,	'PO:0020093',	3,	'antipodal cell',	'\"Cell, commonly three in number as in the eight-nucleate embryo sac, located at the other end of the embryo sac from the egg cell.\" [APweb:Glossary]',	NULL,	0),
(4386,	'PO:0020094',	3,	'plant egg cell',	'\"A gamete (PO:0025006) produced by an archegonium (PO:0025126) or an embryo sac (PO:0025074).\" [POC:curators]',	NULL,	0),
(4387,	'PO:0020095',	3,	'polar nucleus',	'\"OBSOLETE. Usually two nuclei in the center of the eight-nucleate embryo sac that fuse, and subsequently fuse with one of the male gametes to produce the endosperm.\" [APweb:Glossary]',	NULL,	1),
(4388,	'PO:0020096',	3,	'egg apparatus',	'\"A cardinal organ part that has as parts an egg cell and two synergids and is located at the micropylar end of the embryo sac.\" [POC:Ramona_Walls]',	NULL,	0),
(4389,	'PO:0020097',	3,	'generative cell',	'\"A spermatogenous cell (PO:0025525) of the microgametophyte (PO:0025280) that divides to produce two pollen sperm cells (PO:0025121).\" [APweb:Glossary, ISBN:1572590416, POC:Laurel_Cooper]',	NULL,	0),
(4390,	'PO:0020099',	3,	'microgametophyte vegetative cell',	'\"A native plant cell (PO:0025606) that is the larger cell of a microgametophyte (PO:0025280) in seed plants. It does not divide further and develops into a pollen tube cell (PO:0025195).\" [POC:Laurel_Cooper, POC:Ramona_Walls]',	NULL,	0),
(4391,	'PO:0020100',	3,	'hypocotyl',	'\"A stem internode (PO:0020142) below the cotyledonary node (PO:0025321) and transitional to a root (PO:0009005) of a plant embryo (PO:0009009) or a seedling (PO:0000003).\" [APweb:Glossary, POC:curators]',	NULL,	0),
(4392,	'PO:0020101',	3,	'stomium',	'\"A plant anatomical space that is a slit in an anther lobe formed from when a dehiscence zone dehisces.\" [POC:curators]',	NULL,	0),
(4393,	'PO:0020102',	3,	'portion of transmitting tissue',	'\"A portion of ground tissue (PO:0025059) in the style of a carpel through which a pollen tube grows; it connects a stigma and the inside of an ovary.\" [Gramene:Pankaj_Jaiswal, ISBN:0080374913]',	NULL,	0),
(4394,	'PO:0020103',	3,	'flag leaf',	'\"The last mature leaf before the inflorescence in a cereal crop plant.\" [Gramene:Pankaj_Jaiswal]',	NULL,	0),
(4395,	'PO:0020104',	3,	'leaf sheath',	'\"A cardinal organ part (PO:0025001) that is the lower part of a vascular leaf (PO:0009025), and which more or less encases the stem (PO:0009047).\" [Gramene:Pankaj_Jaiswal, PO:laurel_cooper]',	NULL,	0),
(4396,	'PO:0020105',	3,	'ligule',	'\"A membranous or hairy appendage on the adaxial/upper surface of a leaf, at the junction between sheath and blade, especially in grasses.\" [APweb:Glossary]',	NULL,	0),
(4397,	'PO:0020106',	3,	'leaf sheath auricle',	'\"A cardinal organ part (PO:0025001) that is an ear-shaped outgrowth of the distal part of a leaf sheath (PO:0020104).\" [Gramene:Pankaj_Jaiswal, POC:curators]',	NULL,	0),
(4398,	'PO:0020108',	3,	'suspensor',	'\"An embryonic plant structure at the base of a plant embryo that develops from an embryonic basal cell and connects an embryo proper to the wall of a megagametophyte.\" [PMID:12271036]',	NULL,	0),
(4399,	'PO:0020109',	3,	'embryo hypophysis',	'\"A native plant cell (PO:0025606) that is the uppermost cell of a suspensor (PO:0020108) and from which part of the root (PO:0009005) and root cap (PO:0020123) in a plant embryo (PO:0009009) of angiosperms are derived.\" [ISBN:0471245208, POC:Laurel_Cooper]',	NULL,	0),
(4400,	'PO:0020110',	3,	'scutellum',	'\"An embryonic plant structure that is a more or less shield-shaped and absorptive portion of a plant embryo of Poaceae.\" [APweb:Glossary, ISBN:0471244554]',	NULL,	0),
(4401,	'PO:0020121',	3,	'lateral root',	'\"A root (PO:0009005) that develops from a lateral root primordium (PO:0000016) that is part of another root on the same plant.\" [ISBN:0521288959, ISRR:Richard_Zobel, POC:curators]',	NULL,	0),
(4402,	'PO:0020122',	3,	'inflorescence axis',	'\"A shoot axis (PO:0025029) that is part of an inflorescence (PO:0009049).\" [POC:curators]',	NULL,	0),
(4403,	'PO:0020123',	3,	'root cap',	'\"A portion of root parenchyma (PO:0025095) tissue that is part of the root tip (PO:0000025) and covers the root apical meristem (PO:0020147).\" [ISBN:0716710072, POC:curators]',	NULL,	0),
(4404,	'PO:0020124',	3,	'root stele',	'\"A stele (PO:0025197) that is part of a root (PO:0009005).\" [POC:Laurel_Cooper, POC:Ramona_Walls]',	NULL,	0),
(4405,	'PO:0020125',	3,	'elongation zone',	'\"OBSOLETE. The portion of the root that includes small, densely cytoplasmic cells that are dividing and expanding in size.\" [Gramene:Pankaj_Jaiswal]',	NULL,	1),
(4406,	'PO:0020126',	3,	'tassel inflorescence',	'\"A staminate inflorescence (PO:0025601) in Zea species that bears the tassel spikelet (PO:0006309) on a terminal inflorescence axis (PO:0020122).\" [MaizeGDB_curator:Leszek_Vincent, POC:Laurel_Cooper]',	NULL,	0),
(4407,	'PO:0020127',	3,	'primary root',	'\"A root (PO:0009005) that develops directly from a seedling radicle (PO:0020127).\" [ISBN:0122151704, POC:curators]',	NULL,	0),
(4408,	'PO:0020128',	3,	'leaf margin',	'\"A phyllome margin (PO:0025018) that is part of a leaf (PO:0025034).\" [POC:curators]',	NULL,	0),
(4409,	'PO:0020130',	3,	'central root cap',	'\"A portion of root parenchyma tissue that is the central part of a root cap in which the cells are arranged in longitudinal files.\" [ISBN:0878938567, POC:curators]',	NULL,	0),
(4410,	'PO:0020131',	3,	'lateral root cap',	'\"A portion of root parenchyma tissue that is part of a root cap and is parallel to the sides of a root axis.\" [ISBN:0878938567, POC:curators]',	NULL,	0),
(4411,	'PO:0020132',	3,	'columella root cap cell',	'\"Cell that constitutes the central part of the root cap, arranged in longitudinal files.\" [PMID:9384380, TAIR_curator:Katica_Ilic]',	NULL,	0),
(4412,	'PO:0020133',	3,	'columella root cap initial cell',	'\"A root initial cell that produces columella cells in the root cap. In direct contact with quiescent center.\" [ISBN:0471245208, TAIR_curator:Katica_Ilic]',	NULL,	0),
(4413,	'PO:0020134',	3,	'statolith',	'\"OBSOLETE. Solid cell inclusion of starch containing plastids occurring in root cap cells.\" [Gramene:Pankaj_Jaiswal]',	NULL,	1),
(4414,	'PO:0020135',	3,	'root differentiation zone',	'\"A plant axis differentiation zone that is the part of a root and is located behind a root elongation zone.\" [POC:curators]',	NULL,	0),
(4415,	'PO:0020136',	3,	'ear inflorescence',	'\"A pistillate inflorescence (PO:0025598) in Zea species that is highly compacted and bears the ear spikelets (PO:0006320) on a lateral inflorescence axis (PO:0020122).\" [MaizeGDB_curator:Leszek_Vincent, POC:Laurel_Cooper]',	NULL,	0),
(4416,	'PO:0020137',	3,	'leaf apex',	'\"A phyllome apex (PO:0025139) that is part of a leaf (PO:0025034).\" [POC:Ramona_Walls, UMSL_curator:fz]',	NULL,	0),
(4417,	'PO:0020138',	3,	'leaf lamina vein',	'\"A phyllome lamina vein (PO:0025348) that is part of a leaf lamina vascular system (PO:0000048).\" [POC:curators]',	NULL,	0),
(4418,	'PO:0020139',	3,	'leaf midvein',	'\"A primary leaf vein (PO:0025413) that is the central vein of a vascular leaf (PO:0009025).\" [POC:curators]',	NULL,	0),
(4419,	'PO:0020140',	3,	'secondary leaf vein',	'\"A leaf lamina vein (PO:0020138) arising from a primary leaf vein (PO:0025413).\" [Gramene:Pankaj_Jaiswal]',	NULL,	0),
(4420,	'PO:0020141',	3,	'stem node',	'\"A shoot axis node (PO:0005004) that is part of a stem (PO:0009047).\" [APweb:Glossary, POC:Laurel_Cooper]',	NULL,	0),
(4421,	'PO:0020142',	3,	'stem internode',	'\"A shoot axis internode (PO:0005005) that is part of a stem (PO:0009047).\" [POC:curators, POC:Laurel_Cooper]',	NULL,	0),
