(4880,	'PO:0025458',	3,	'transfer companion cell',	'\"A companion cell (PO:0000400) that is a transfer cell (PO:0000078) with many cell wall invaginations.\" [PMID:21669666, PO_REF:00011]',	NULL,	0),
(4881,	'PO:0025459',	3,	'ordinary companion cell',	'\"A companion cell (PO:0000400) that lacks cell wall invaginations and has few or no plasmodesmata connecting it to adjacent mesophyll cells.\" [PMID:21669666, PO_REF:00011]',	NULL,	0),
(4882,	'PO:0025460',	3,	'intermediary companion cell',	'\"A companion cell (PO:0000400) that has dense cytoplasm, a small vacuole, proplastids rather than chloroplasts, and abundant and highly branched plasmodesmata linking it to adjacent mesophyll cells.\" [PMID:21669666, PO_REF:00011]',	NULL,	0),
(4883,	'PO:0025461',	3,	'early wood tracheary element',	'\"A secondary xylem tracheary element (PO:0025445) that is part of a portion of early wood (PO:0004515).\" [POC:curators]',	NULL,	0),
(4884,	'PO:0025462',	3,	'late wood tracheary element',	'\"A secondary xylem tracheary element (PO:0025445) that is part of a portion of late wood (PO:0004516).\" [POC:curators]',	NULL,	0),
(4885,	'PO:0025463',	3,	'cell division stage of secondary xylem',	'\"A secondary xylem development stage (PO:0025427) that occurs during the interval between the first and last cell division in a portion of secondary xylem tissue (PO:0005848), during which cells are produced by divisions of cambial initials (PO:0000295) or xylem mother cells.\" [POC:wood_curators]',	NULL,	0),
(4886,	'PO:0025464',	3,	'cell expansion stage of secondary xylem',	'\"A cell differentiation stage of secondary xylem (PO:0025469) that occurs during the interval between the end of a cell division stage of secondary xylem (PO:0025463) and the onset of a secondary cell wall formation stage of secondary xylem (PO:0025465), during which the cells undergo cell growth (GO:0016049).\" [POC:wood_curators]',	NULL,	0),
(4887,	'PO:0025465',	3,	'secondary cell wall formation stage of secondary xylem',	'\"A cell differentiation stage of secondary xylem (PO:0025469) that occurs during the interval between the onset of secondary wall biogenesis (GO:0009834) of the cells in a portion of secondary xylem (PO:0005848) and the beginning of a cell death stage of secondary xylem (PO:0025466).\" [POC:wood_curators]',	NULL,	0),
(4888,	'PO:0025466',	3,	'cell death stage of secondary xylem',	'\"A cell differentiation stage of secondary xylem (PO:0025469) that occurs during the interval between the first cell death of a tracheary element (PO:0000290) or non-septate xylem fiber cell (PO:0000274) and the death of the last secondary xylem parenchyma cell (PO:0004525) or septate fiber cell (PO:0004521) in a portion of secondary xylem (PO:0005848).\" [POC:wood_curators]',	NULL,	0),
(4889,	'PO:0025467',	3,	'tracheary element death stage of secondary xylem',	'\"A cell death stage of secondary xylem (PO:0025466) that occurs during the interval between the first and last cell death of a tracheary element (PO:0000290) or non-septate xylem fiber cell (PO:0000274).\" [POC:wood_curators]',	NULL,	0),
(4890,	'PO:0025468',	3,	'secondary xylem parenchyma cell death stage of secondary xylem',	'\"A cell death stage of secondary xylem (PO:0025466) that occurs during the interval between the last cell death of a tracheary element (PO:0000290) or non-septate xylem fiber cell (PO:0000274) and the last cell death in a portion of secondary xylem (PO:0005848).\" [POC:wood_curators]',	NULL,	0),
(4891,	'PO:0025469',	3,	'cell differentiation stage of secondary xylem',	'\"A secondary xylem development stage (PO:0025427) that occurs during the interval between the end of a cell division stage of secondary xylem (PO:0025463) and the death of the last living cell in the secondary xylem.\" [POC:wood_curators]',	NULL,	0),
(4892,	'PO:0025470',	3,	'plant embryo cotyledon',	'\"A cotyledon (PO:0020030) that is part of a plant embryo (PO:0009009).\" [POC:curators, POC:Laurel_Cooper]',	NULL,	0),
(4893,	'PO:0025471',	3,	'seedling cotyledon',	'\"A cotyledon (PO:0020030) that is part of a whole plant (PO:0000003) in the seedling development stage (PO:0007131).\" [POC:curators]',	NULL,	0),
(4894,	'PO:0025472',	3,	'reaction wood',	'\"A portion of secondary xylem (PO:0005848) found on either the upper or lower side of a shoot axis (PO:0025029) that is or was angled away from vertical, with anatomical characteristics that depend on whether it is compression wood (PO:0025473) or tension wood (PO:0025474).\" [ISBN:3540411739, PO_REF:00012]',	NULL,	0),
(4895,	'PO:0025473',	3,	'compression wood',	'\"A portion of reaction wood (PO:0025472) found on the lower side of a shoot axis (PO:0025029) that is or was angled away from vertical and that has as parts heavily lignified tracheids (PO:0000301) with a specialized S2 layer that contains more lignin and has a larger (more horizontal) microfibril angle.\" [ISBN:3540411739, PO_REF:00012]',	NULL,	0),
(4896,	'PO:0025474',	3,	'tension wood',	'\"A portion of reaction wood (PO:0025472) found on the upper side of a shoot axis (PO:0025029) that is or was angled away from vertical and that has as parts gelatinous fiber cells (PO:0025422).\" [ISBN:3540411739, PO_REF:00012]',	NULL,	0),
(4897,	'PO:0025475',	3,	'coleorhiza emergence stage',	'\"A root development stage (PO:0007520) during which a coleorhiza (PO:0020034) emerges from the seed coat (PO:0009088).\" [POC:curators]',	NULL,	0),
(4898,	'PO:0025476',	3,	'tuberous root tuber',	'\"A root (PO:0009005) that develops from a tuberous root (PO:0025523) and is further radially enlarged for storage.\" [POC:curators, POC:Laurel_Cooper]',	NULL,	0),
(4899,	'PO:0025477',	3,	'floral organ primordium',	'\"A primordium (PO:0025127) that is committed to the development of a floral organ (PO:0025395) and is part of a reproductive shoot apex (PO:0025222).\" [POC:curators]',	NULL,	0),
(4900,	'PO:0025478',	3,	'androecium primordium',	'\"A floral structure primordium (PO:0025477) that is committed to the development of an androecium (PO:0009061).\" [POC:curators]',	NULL,	0),
