(4902,	'PO:0025480',	3,	'shoot-borne root primordium',	'\"A root primordium (PO:0005029) that is committed to the development of a shoot-borne root (PO:0000042).\" [POC:curators]',	NULL,	0),
(4903,	'PO:0025481',	3,	'leaflet primordium',	'\"A primordium (PO:0025127) that develops as part of a leaf primordium (PO:0000017) of a compound leaf (PO:0020043) and is committed to the development of a leaflet (PO:0020049).\" [ISBN:0521288959, POC:curators]',	NULL,	0),
(4904,	'PO:0025482',	3,	'bract anlagen',	'\"A phyllome anlagen (PO:0025430) that will give rise to a bract primordium (PO:0025487) and is part of a peripheral zone (PO:000225) of a reproductive shoot apical meristem (PO:0008028).\" [POC:Ramona_Walls]',	NULL,	0),
