(4910,	'PO:0025488',	3,	'flower bract primordium',	'\"A bract primordium (PO:0025128) is committed to the development of a flower bract (PO:0009034).\" [POC:Ramona_Walls]',	NULL,	0),
(4911,	'PO:0025489',	3,	'inflorescence bract primordium',	'\"A bract primordium (PO:0025128) is committed to the development of an inflorescence bract (PO:0009054).\" [POC:Ramona_Walls]',	NULL,	0),
(4912,	'PO:0025490',	3,	'plant ovary ovule',	'\"A plant ovule (PO:0020006) that is part of a plant ovary (PO:0009072).\" [POC:curators]',	NULL,	0),
