(4914,	'PO:0025492',	3,	'pericyclic lateral root primordium',	'\"A lateral root primordium (PO:0000016) that develops from a portion of pericycle tissue (PO:0006203) and is committed to the development of a pericyclic lateral root (PO:0025494).\" [POC:curators]',	NULL,	0),
(4915,	'PO:0025493',	3,	'non-pericyclic lateral root primordium',	'\"A lateral root primordium (PO:0000016) that develops from a portion of plant tissue (PO:0009007) other than a pericycle (PO:0006203) and is committed to the development of a non-pericyclic lateral root (PO:0025495).\" [POC:curators]',	NULL,	0),
