(4917,	'PO:0025495',	3,	'non-pericyclic lateral root',	'\"A lateral root (PO:0025495) that develops from a non-pericyclic lateral root primordium (PO:0025493).\" [ISRR:Richard_Zobel, POC:curators]',	NULL,	0),
(4918,	'PO:0025496',	3,	'multi-tissue plant structure',	'\"A plant structure (PO:0009011) that has as parts two or more portions of plant tissue (PO:0009007) of at least two different types and which through specific morphogenetic processes forms a single structural unit demarcated by primarily bona-fide boundaries from other structural units of different types.\" [CARO:0000055, POC:curators]',	NULL,	0),
(4919,	'PO:0025497',	3,	'collective plant structure',	'\"A plant structure (PO:0009011) that is a proper part of a whole plant (PO:0000003) and includes two or more adjacent plant organs (PO:0009008) or adjacent cardinal organ parts (PO:0025001), along with any associated portions of plant tissue (PO:0009007).\" [POC:curators]',	NULL,	0),
(4920,	'PO:0025498',	3,	'cardinal part of multi-tissue plant structure',	'\"A plant structure (PO:0009011) that is a proper part of a multi-tissue plant structure (PO:0025496) and includes portions of plant tissues (PO:0009007) of at least two different types.\" [POC:curators]',	NULL,	0),
(4921,	'PO:0025499',	3,	'sepal epidermis giant cell',	'\"An epidermal pavement cell (PO:0000332) that is part of sepal epidermis (PO:0006040) and is approximately one fifth the length of a sepal.\" [PMID:20485493, TAIR_curator:Tanya_Berardini]',	NULL,	0),
(4922,	'PO:0025500',	3,	'whole plant fruit development stage',	'\"A sporophyte reproductive stage that begins when a fruit (PO:0009001) on a whole plant (PO:0000003) that is not currently participating in a whole plant fruit development stage begins a fruit initiation stage (PO:0025503), and ends with the earliest of the following',	NULL,	0),
(4923,	'PO:0025501',	3,	'fruit formation stage',	'\"A fruit development stage (PO:0001002) that begins with the formation of a plant zygote (PO:0000423) that is contained in the fruit (PO:0009001) being studied and ends when that fruit\'s fruit ripening stage (PO:0025502) begins.\" [POC:curators]',	NULL,	0),
(4924,	'PO:0025502',	3,	'fruit ripening stage',	'\"A fruit development stage (PO:0001002) during which a single fruit (PO:0009001) participates in the process of fruit ripening (GO:0009835).\" [POC:curators]',	NULL,	0),
(4925,	'PO:0025503',	3,	'fruit initiation stage',	'\"A fruit formation stage (PO:0025501) that begins with the formation of a plant zygote (PO:0000423) that is contained in the fruit (PO:0009001) being studied and ends when the plant cells (PO:0009002) in the fruit begin to divide or expand.\" [POC:curators]',	NULL,	0),
(4926,	'PO:0025504',	3,	'fruit size up to 10% stage',	'\"A fruit formation stage (PO:0025501) that begins when the plant cells (PO:0009002) in a fruit (PO:0009001) begin to divide or expand, and ends when the fruit has reached 10% of its final size.\" [POC:curators]',	NULL,	0),
(4927,	'PO:0025505',	3,	'fruit size 10 to 30% stage',	'\"A fruit formation stage (PO:0025501) that spans the interval when a fruit (PO:0009001) has reached 10% to 30% of its final size.\" [POC:curators]',	NULL,	0),
(4928,	'PO:0025506',	3,	'fruit size 30 to 50% stage',	'\"A fruit formation stage (PO:0025501) that spans the interval when a fruit (PO:0009001) has reached 30 to 50% of its final size.\" [POC:curators]',	NULL,	0),
(4929,	'PO:0025507',	3,	'fruit size 50 to 70% stage',	'\"A fruit formation stage (PO:0025501) that spans the interval when a fruit (PO:0009001) has reached 50 to 70% of its final size.\" [POC:curators]',	NULL,	0),
(4930,	'PO:0025508',	3,	'fruit size 70% to final size stage',	'\"A fruit formation stage (PO:0025501) that spans begins when a fruit (PO:0009001) has reached 70% of its final size and ends when a fruit has reached its final size and a fruit ripening stage (PO:0025502) begins.\" [POC:curators]',	NULL,	0),
(4931,	'PO:0025509',	3,	'archegonium central cell',	'\"A native plant cell (PO:0025606) that is the larger, distal cell arising from the first division of an archegonium initial cell (PO:0025510).\" [PMID:17041880, POC:Laurel_Cooper]',	NULL,	0),
(4932,	'PO:0025510',	3,	'archegonium initial cell',	'\"An initial cell (PO:0004011) that divides asymmetrically to form an archegonium central cell (PO:0025509) and a smaller archegonium neck canal cell (PO:0030035).\" [PMID:17041880]',	NULL,	0),
(4933,	'PO:0025511',	3,	'petal spur',	'\"A cardinal organ part (PO:0025001) that is a slender, hollow extension of a petal (PO:0009032).\" [ISBN:9781842464229]',	NULL,	0),
(4934,	'PO:0025512',	3,	'corolla spur',	'\"A collective organ part structure (PO:0025269) that is a slender, hollow extension of a corolla and has as parts segments of two more fused petals.\" [ISBN:9781842464229]',	NULL,	0),
(4935,	'PO:0025513',	3,	'plant organ lamina',	'\"A lamina (PO:0025060) that is part of a plant organ (PO:0009008).\" [POC:curators]',	NULL,	0),
(4936,	'PO:0025514',	3,	'phyllome lamina lobe',	'\"A cardinal organ part (PO:0025001) that is a projection on a phyllome margin (PO:0025018) for which the corresponding phyllome sinus (PO:0025383) extends one quarter or more of the distance to the center of the long axis of the phyllome lamina (PO:0025396).\" [JSTOR:2441319]',	NULL,	0),
(4937,	'PO:0025515',	3,	'phyllome lamina tooth',	'\"A cardinal organ part (PO:0025001) that is an angular projection on a phyllome margin (PO:0025018) for which the corresponding phyllome sinus (PO:0025383) extends less than one quarter of the distance to the center of the long axis of the phyllome lamina (PO:0025396).\" [JSTOR:2441319]',	NULL,	0),
(4938,	'PO:0025516',	3,	'phyllome lamina crena',	'\"A cardinal organ part (PO:0025001) that is a rounded projection on a phyllome margin (PO:0025018) for which the corresponding phyllome sinus (PO:0025383) extends less than one quarter of the distance to the center of the long axis of the phyllome lamina (PO:0025396).\" [JSTOR:2441319]',	NULL,	0),
(4939,	'PO:0025517',	3,	'leaf lamina lobe',	'\"A phyllome lobe (PO:0025514) that is a projection on a leaf lamina margin (PO:0025009) for which the corresponding leaf sinus (PO:0025384) extends one quarter or more of the distance to the center of the long axis of the leaf lamina (PO:0020039).\" [JSTOR:2441319]',	NULL,	0),
(4940,	'PO:0025518',	3,	'leaf lamina tooth',	'\"A phyllome lamina tooth (PO:0025515) that is an angular projection on a leaf margin (PO:0020128) for which the corresponding leaf sinus (PO:0025384) extends less than one quarter of the distance to the center of the long axis of the leaf lamina (PO:0020039).\" [JSTOR:2441319]',	NULL,	0),
(4941,	'PO:0025519',	3,	'leaf lamina crena',	'\"A phyllome lamina crena (PO:0025516) that is a rounded projection on a leaf margin (PO:0020128) for which the corresponding leaf sinus (PO:0025384) extends less than one quarter of the distance to the center of the long axis of the leaf lamina (PO:0020039).\" [JSTOR:2441319]',	NULL,	0),
(4942,	'PO:0025520',	3,	'leaf lamina intramarginal vein',	'\"A leaf lamina vein (PO:0020138) that is just inside the leaf lamina margin (PO:0025009) and extends from the leaf lamina base (PO:0008019) to the leaf apex (PO:0020137).\" [POC:Laurel_Cooper]',	NULL,	0),
(4943,	'PO:0025521',	3,	'unicellular plant gametangium',	'\"A native plant cell (PO:0025606) that produces one or more gametes (PO:0025006) and participates in the gametophyte development stage (PO:0028003).\" [POC:Laurel_Cooper]',	NULL,	0),
(4944,	'PO:0025522',	3,	'tuber',	'\"A plant axis (PO:0025004) that is radially enlarged.\" [POC:curators]',	NULL,	0),
(4945,	'PO:0025523',	3,	'tuberous root',	'\"A root (PO:0009005) that is radially enlarged relative to other lateral roots (PO:0020121) or shoot-borne roots (PO:0000042) on the same plant, but not as enlarged as a tuberous root tuber (PO:0025476).\" [POC:curators]',	NULL,	0),
(4946,	'PO:0025524',	3,	'ventral canal cell',	'\"A native plant cell (PO:0025606) that develops from the archegonium central cell (PO:0025509), and lies at the base of the archegonium neck (PO:0030039), above the archegonium egg cell (PO:0025122) in the venter (PO:0030038).\" [ISBN:0521794331, PMID:17041880, POC:Laurel_Cooper]',	NULL,	0),
(4947,	'PO:0025525',	3,	'spermatogenous cell',	'\"A native plant cell (PO:0025606) that gives rise to one or more plant sperm cells (PO:0000084).\" [ISBN:1572590416, POC:Laurel_Cooper]',	NULL,	0),
(4948,	'PO:0025526',	3,	'body cell',	'\"A spermatogenous cell (PO:0025525) of the microgametophyte (PO:0025280) that divides to produce a vegetative cell (PO:0020099) and the pollen sperm cell (PO:0025121).\" [ISBN:1572590416, POC:Laurel_Cooper]',	NULL,	0),
(4949,	'PO:0025527',	3,	'shoot system development stage',	'\"A collective plant organ structure development stage (PO:0025338) that begins with the onset of the plant organ development stage (PO:0025339) and ends with either gametophyte senescent stage (PO:0025343) or sporophyte senescent stage (PO:0007017) or death.\" [POC:Laurel_Cooper]',	NULL,	0),
(4950,	'PO:0025528',	3,	'bud development stage',	'\"A shoot system development stage (PO:0025527) that has as primary participant a bud (PO:0009006).\" [POC:Laurel_Cooper]',	NULL,	0),
