(4953,	'PO:0025531',	3,	'bud swell stage',	'\"A bud development stage (PO:0025528) during which a bud (PO:0009006) enlarges due to growth of the shoot system (PO:0009006).\" [POC:Laurel_Cooper]',	NULL,	0),
(4954,	'PO:0025532',	3,	'bud burst stage',	'\"A shoot system development stage (PO:0025527) during which a shoot system (PO:0009006) emerges from the bud (PO:0009006).\" [POC:Laurel_Cooper]',	NULL,	0),
(4955,	'PO:0025533',	3,	'prothallial cell',	'\"A native plant cell (PO:0025606) which is vegetative and develops from the division of the microspore (PO:0020048) of vascular plants other than angiosperms.\" [ISBN:9780879015329, ISBN:9783443140113, POC:Laurel_Cooper]',	NULL,	0),
(4956,	'PO:0025534',	3,	'adventitious shoot axis',	'\"A shoot axis (PO:00025029) that develops in an unusual place.\" [POC:Laurel_Cooper]',	NULL,	0),
(4957,	'PO:0025535',	3,	'multicellular trichome tip',	'\"A portion of plant tissue (PO:0009007) that is the apical most portion of a multicellular trichome apex (PO:0025551).\" [POC:Laurel_Cooper]',	NULL,	0),
(4958,	'PO:0025536',	3,	'plant cuticle ridge',	'\"A portion of plant cuticle (PO:000022) that forms a ridge, may be overlayed with epicuticular wax (PO:0025388).\" [PMID:19959665, POC:Laurel_Cooper]',	NULL,	0),
