(4960,	'PO:0025538',	3,	'plant sap',	'\"A portion of plant substance (PO:0025161) that is an aqueous solution that can be transported through the apoplast (GO:0048046) or symplast (GO:0055044).\" [POC:Laurel_Cooper]',	NULL,	0),
(4961,	'PO:0025539',	3,	'xylem sap',	'\"A plant sap (PO:0025538) that is an aqueous solution which may contain mineral elements, nutrients, and plant hormones, and is transported from the root system (PO:0025025) toward the leaves through the tracheary elements (PO:0000290) of the xylem.\" [POC:Laurel_Cooper]',	NULL,	0),
(4962,	'PO:0025540',	3,	'phloem sap',	'\"A plant sap (PO:0025538) that is an aqueous solution which may contain sugars, mineral elements, and plant hormones, and is transported through the phloem sieve elements (PO:0025406).\" [POC:Laurel_Cooper]',	NULL,	0),
