(4974,	'PO:0025552',	3,	'centarch protoxylem',	'\"A portion of protoxylem (PO:0000272) tissue in which the maturation of primary xylem of the shoot system progresses centrifugally with the oldest elements (protoxylem) in the center of the axis.\" [ISBN:9780716719465, POC:curators]',	NULL,	0),
(4975,	'PO:0025553',	3,	'mesarch protoxylem',	'\"A portion of protoxylem (PO:0000272) tissue in which the maturation of primary xylem (PO:0005849) of the shoot system (PO:0009006) progresses both centripetally and centrifugally from the center.\" [ISBN:0471245208, POC:Laurel_Cooper]',	NULL,	0),
(4976,	'PO:0025554',	3,	'exarch protoxylem',	'\"A portion of protoxylem (PO:0000272) tissue in which the maturation of primary xylem (PO:0005849) progresses centripetally, the oldest elements (protoxylem) are farthest from the center of the plant axis (PO:0025004).\" [ISBN:0471245208, POC:Laurel_Cooper]',	NULL,	0),
(4977,	'PO:0025555',	3,	'root system exarch protoxylem',	'\"A portion of exarch protoxylem (PO:002554) tissue in which the maturation of primary xylem (PO:0005849) of the root system (PO:0025025) progresses centripedally, with the oldest elements (protoxylem) farthest from the center of the plant axis (PO:0025004).\" [ISBN:0471245208, POC:Laurel_Cooper]',	NULL,	0),
(4978,	'PO:0025556',	3,	'shoot system exarch protoxylem',	'\"A portion of exarch protoxylem (PO:002554) tissue in which the maturation of primary xylem (PO:0005849) of the shoot system (PO:0009006) progresses centripetally, with the oldest elements (protoxylem) farthest from the center of the plant axis (PO:0025004).\" [ISBN:0471245208, POC:Laurel_Cooper]',	NULL,	0),
(4979,	'PO:0025557',	3,	'endarch protoxylem',	'\"A portion of protoxylem (PO:0000272) tissue in which the maturation of primary xylem (PO:0005849) of the shoot system (PO:0009006) progresses centrifugally, with the oldest elements (protoxylem) towards the center of the plant axis (PO:0025004).\" [ISBN:0471245208, POC:Laurel_Cooper]',	NULL,	0),
(4980,	'PO:0025558',	3,	'monarch protoxylem',	'\"A portion of root exarch protoxylem (PO:0025555) tissue in which the primary xylem (PO:0005849) of the root system (PO:0025025) has only one protoxylem strand or pole, and differentiation progresses centripetally, with the oldest element (protoxylem) farthest from the center of the plant axis (PO:0025004).\" [ISBN:0471245208, POC:Laurel_Cooper]',	NULL,	0),
(4981,	'PO:0025559',	3,	'diarch protoxylem',	'\"A portion of root exarch protoxylem (PO:0025555) tissue in which the primary xylem (PO:0005849) of the root system (PO:0025025) has two protoxylem strands or poles, and differentiation progresses centripetally, with the oldest elements (protoxylem) farthest from the center of the plant axis (PO:0025004).\" [ISBN:0471245208, POC:Laurel_Cooper]',	NULL,	0),
(4982,	'PO:0025560',	3,	'triarch protoxylem',	'\"A portion of root exarch protoxylem (PO:0025555) tissue in which the primary xylem (PO:0005849) of the root system (PO:0025025) has three protoxylem strands or poles, and differentiation progresses centripetally, with the oldest elements (protoxylem) farthest from the center of the plant axis (PO:0025004).\" [ISBN:0471245208, POC:Laurel_Cooper]',	NULL,	0),
(4983,	'PO:0025561',	3,	'tetrarch protoxylem',	'\"A portion of root exarch protoxylem (PO:0025555) tissue in which the primary xylem (PO:0005849) of the root system (PO:0025025) has four protoxylem strands or poles, and differentiation progresses centripetally, with the oldest elements (protoxylem) farthest from the center of the plant axis (PO:0025004).\" [ISBN:0471245208, POC:Laurel_Cooper]',	NULL,	0),
(4984,	'PO:0025562',	3,	'pentarch protoxylem',	'\"A portion of root exarch protoxylem (PO:0025555) tissue in which the primary xylem (PO:0005849) of the root system (PO:0025025) has five protoxylem strands or poles, and differentiation progresses centripetally, with the oldest elements (protoxylem) farthest from the center of the plant axis (PO:0025004).\" [ISBN:0471245208, POC:Laurel_Cooper]',	NULL,	0),
