(4992,	'PO:0025570',	3,	'vascular leaf development stage',	'\"A leaf development stage (PO:0001050) that occurs during the interval between the onset of the vascular leaf initiation stage (PO:0001051) and the termination of the vascular leaf senescent stage (PO:0001054).\" [POC:Brian_Atkinson, POC:Laurel_Cooper]',	NULL,	0),
