(4996,	'PO:0025574',	3,	'vascular leaf differentiation stage',	'\"A vascular leaf development stage (PO:0025570) that begins with the formation of procambium (PO:0025275) and protoderm (PO:0006210) and ends with the formation and differentiation of the leaf epidermis (PO:0006016) and leaf vascular system (PO:0000036) and all the specialized cells of the vascular leaf.\" [POC:Laurel_Cooper]',	NULL,	0),
