(5002,	'PO:0025580',	3,	'fused perianth',	'\"A perianth (PO:0009058) in which one or more of the petals (PO:0009032), sepals (PO:0009031), and/or tepals (PO:0009033) are fused (PATO:0000642).\" [ISBN:9781842464229, PATO:0000642, POC:curators]',	NULL,	0),
