(5026,	'PO:0025604',	3,	'resin cell',	'\"An epidermal cell (PO:0004013) that secretes plant resin (PO:0025603), and may line resin canals (PO:0005665) and/or be associated with resin blisters (or cysts).\" [PMID:11337413, POC:Laurel_Cooper]',	NULL,	0),
