(5028,	'PO:0025606',	3,	'native plant cell',	'\"A plant cell (PO:0009002) that is either part of a multicellular whole plant (PO:0000003) \'in vivo\' or a unicellular organism \'in natura\' (i.e. part of a natural environment).\" [POC:Laurel_Cooper]',	NULL,	0),
