(5145,	'PO:0030095',	3,	'poricidal capsule fruit',	'\"A capsule fruit (PO:0030091) which at maturity dehisces through pores on a pericarp (PO:0009084).\" [NYBG:Brandon_Sinn, NYBG:Dario_Cavaliere, POC:Laurel_Cooper]',	NULL,	0),
