(5167,	'PO:0030117',	3,	'spike inflorescence',	'\"An inflorescence (PO:0009049) with a monopodial growth habit, which at flowering stage (PO:0007616), is composed of sessile flowers (PO:0009046) on an indeterminate, first order inflorescence axis (PO:0025104).\" [NYBG:Brandon_Sinn, NYBG:Dario_Cavaliere, PO:cooperl]',	NULL,	0),
(5168,	'PO:0030118',	3,	'compound spike inflorescence',	'\"An inflorescence (PO:0009049), with a monopodial growth habit, which at anthesis is composed of an indeterminate first order inflorescence axis (PO:0025104) and sessile (PATO:0001436) flowers (PO:0009046), or spikelets (PO:0009051), on indeterminate higher order inflorescence axes (PO:0009081).\" [NYBG:Brandon_Sinn, NYBG:Dario_Cavaliere, PO:cooperl]',	NULL,	0),
