(5173,	'PO:0030123',	3,	'panicle inflorescence',	'\"An inflorescence (PO:0009049) with a monopodial growth habit, which at flowering stage (PO:0007616) is composed of pedicellate flowers (PO:0009046) or spikelets (PO:0009051) on determinate inflorescence axes (PO:0020122).,\" [NYBG:Brandon_Sinn, NYBG:Dario_Cavaliere, PO:cooperl]',	NULL,	0),
(5174,	'PO:0030124',	3,	'corymb inflorescence',	'\"An inflorescence (PO:0009049) with both monopodial and sympodial growth habits, which at flowering stage (PO:0007616), is composed of a determinate, first order inflorescence axis (PO:0025104), and determinate higher order inflorescence axes (PO:0020122) with pedicellate flowers (PO:0009046) that collectively form a convex plane of flowers.\" [NYBG:Brandon_Sinn, NYBG:Dario_Cavaliere, PO:cooperl]',	NULL,	0),
(5175,	'PO:0030125',	3,	'anthela inflorescence',	'\"An inflorescence (PO:0009049) with both monopodial and sympodial growth habits, which at flowering stage (PO:0007616), is composed of a determinate, first order inflorescence axis (PO:0025104) and determinate, higher order inflorescence axes (PO:0020122) with pedicellate flowers (PO:0009046) that collectively form a concave plane of flowers.\" [NYBG:Brandon_Sinn, NYBG:Dario_Cavaliere, PO:cooperl]',	NULL,	0),
