(5179,	'PO:0030129',	3,	'umbel inflorescence',	'\"An inflorescence (PO:0009049) with a monopodial growth habit, which at flowering stage (PO:0007616), is composed of pedicellate flowers (PO:0009046) on a first order inflorescence axis (PO:0025104) with compressed inflorescence axis internodes (PO:0006326).\" [NYBG:Brandon_Sinn, NYBG:Dario_Cavaliere, PO:cooperl]',	NULL,	0),
(5180,	'PO:0030130',	3,	'compound umbel inflorescence',	'\"An inflorescence (PO:0009049) with a monopodial growth habit, which at flowering stage (PO:0007616), is composed of a first order inflorescence axis (PO:0025104) with compressed inflorescence axis internodes (PO:0006326), and pedicellate flowers (PO:0009046) on higher order inflorescence axes, with compressed inflorescence axis internodes (PO:0006326).\" [NYBG:Brandon_Sinn, NYBG:Dario_Cavaliere, PO:cooperl]',	NULL,	0),
