(9874,	'TO:0000001',	6,	'carbon sensitivity',	'\"Sensitivity to the carbon content in the growth medium. It plays an important role in the synthesis of various inorganic and organic metabolites such as carbohydrates, lipids, amino acids and peptides and plays a role in various metabolic processes.\" [Gramene:pankaj_jaiswal]',	NULL,	0),
(9875,	'TO:0000002',	6,	'epigenetic trait',	'\"OBSOLETE. An epigenetic trait is a distinguishable feature or a characteristic or a quality of character or a phenotypic feature of a developing or developed individual but have arisen as a result of mechanisms regulating the expression of the genes rather than differences in the gene sequence.\" [Gramene:pankaj_jaiswal, ISBN:0198506732]',	NULL,	1),
(9876,	'TO:0000003',	6,	'alkali soil sensitivity',	'\"Plant sensitivity to soils with alkali conditions (pH>7).\" [IRRI:SES, TO:moorel]',	NULL,	0),
(9877,	'TO:0000004',	6,	'reversible male sterility',	'\"Trait of a plant in which the action of the cytotoxic gene used to introduce male sterility is suppressed by the application of a chemical to the plant. Reversion of the sterility allows the RMS parent to be self-fertilized, a step that overcomes the need to remove fertile sib plants prior to making the hybrid cross.\" [PMID:10645437]',	NULL,	0),
(9878,	'TO:0000006',	6,	'calcium sensitivity',	'\"Sensitivity to the calcium content in the growth medium. Plays an important role in cell wall synthesis and enzyme activities.\" [Gramene:pankaj_jaiswal]',	NULL,	0),
(9879,	'TO:0000007',	6,	'sulfur sensitivity',	'\"Response by the plant in terms of sensitivity to sulfur content in the growth medium. It is important for synthesis of some amino acid residues.\" [Gramene:pankaj_jaiswal]',	NULL,	0),
(9880,	'TO:0000008',	6,	'potassium sensitivity',	'\"Sensitivity to the potassium ion content in the growth medium. It plays an important role in controlling water by osmosis and also in the metal ion homeostasis.\" [Gramene:pankaj_jaiswal]',	NULL,	0),
(9881,	'TO:0000009',	6,	'genic male sterility-photoperiod sensitive',	'\"Male sterility affected by photoperiod.\" [Gramene:pankaj_jaiswal, IRRI:SES]',	NULL,	0),
(9882,	'TO:0000010',	6,	'magnesium sensitivity',	'\"Sensitivity to the magnesium content in the growth medium. It is important for chlorophyll biosynthesis and metal ion homeostasis.\" [Gramene:pankaj_jaiswal]',	NULL,	0),
(9883,	'TO:0000011',	6,	'nitrogen sensitivity',	'\"Sensitivity to the nitrogen content in the growth medium. It is important for protein synthesis, chlorophyll etc.\" [Gramene:pankaj_jaiswal]',	NULL,	0),
(9884,	'TO:0000012',	6,	'hydrogen sensitivity',	'\"Sensitivity to the molecular hydrogen or hydrogen ion content in the growth medium. It plays an important role in the synthesis of various inorganic and organic metabolites such as carbohydrates, lipids, amino acids and peptides and plays a role in the energy metabolism, osmolarity,  etc.\" [Gramene:pankaj_jaiswal]',	NULL,	0),
(9885,	'TO:0000013',	6,	'resistance to disease by mycoplasma-like organism',	'\"An assay to determine the resistance exhibited by a plant or a group of plants (population) in response to the disease caused by a mycoplasma-like pathogen infection as compared to the susceptible and/or the reference plants of the same species.\" [Gramene:pankaj_jaiswal, IRRI:SES]',	NULL,	0),
(9886,	'TO:0000014',	6,	'panicle weight',	'\"Average weight of the panicle from the plants or tillers in a given study.\" [Gramene:pankaj_jaiswal]',	NULL,	0),
