(9924,	'TO:0000052',	6,	'primary branching of inflorescence',	'\"An inflorescence morphology trait (TO:0000373) which is the extent of primary branching that usually sets the tone for shape and compactness of the inflorescence (PO:0009049) (rice panicle).\" [Gramene:pankaj_jaiswal, PO:0009049, TO:moorel]',	NULL,	0),
(9925,	'TO:0000053',	6,	'pollen sterility',	'\"Observed under a microscope at magnification 10x10 after staining with 1% iodine potassium iodide (IKI) solution. Samples for pollen are collected from anthers and fixed in 70% alcohol. Two to three anthers are extracted from each floret and pollen grains are squeezed out into the IKI solution drop. At least three fields are used to count the sterile pollen grains; unstained withered, unstained spherical and partially stained round and fertile, from stained round pollen grains. Percentage sterility is calculated as = (unstained withered+unstained spherical+partially stained) x 100/total number of pollen grains in the field including the fertile.\" [Gramene:pankaj_jaiswal, IRRI:SES]',	NULL,	0),
