(10129,	'TO:0000259',	6,	'heat tolerance',	'\"Tolerance to warm temperatures if plant is exposed to above than permissive temperature limits. Observe differences in vigor along with subtle changes in leaf color. The optimum time to make observations would be the seedling, tillering (sensu Poaceae), flowering and mature stages. Mainly scored in terms of spikelet fertility in grasses.\" [Gramene:pankaj_jaiswal, IRRI:SES]',	NULL,	0),
