(10131,	'TO:0000261',	6,	'insect damage resistance',	'\"An assay to determine the resistance exhibited by a plant or a group of plants (population) in response to insect infestation as compared to the susceptible and/or the reference plants of the same species.\" [Gramene:pankaj_jaiswal, IRRI:SES]',	NULL,	0),
